INSERT INTO `lessons` VALUES (552,173,98,'Договор','<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">АҚЫЛЫ БІЛІМ БЕРУ ҚЫЗМЕТІН КӨРСЕТУ ТУРАЛЫ ЖАРИЯ ОФЕРТА ШАРТЫ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алматы қ.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&laquo;--&raquo; қараша 2021 жыл</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы шарт жеке тұлғаларға бағытталған, (әрі қарай - &laquo;Тапсырыс беруші&raquo;). Сайтты&nbsp;<strong>&laquo;INCON GROUP&raquo;</strong>&nbsp;ЖШС ұсынады (әрі қарай - &laquo;Орындаушы&raquo;). Тапсырыс беруші мен Орындаушы осы шарттың (әрі қарай - &laquo;Шарт&raquo;) &nbsp;төмендегі талаптарын қабылдай отырып жасасты:</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТЕРМИНДЕР МЕН АНЫҚТАМАЛАР</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы жария оферта шартында төменде көрсетілген ұғымдар келесі мағынада қолданылады:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оферта</em></strong>&nbsp;&ndash; жеке және заңды тұлғаларға онлайн, ақылы білім беру қызметін көрсету туралы Орындаушымен жария оферта шартын жасасу жөнінде ұсыныс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Офертаның акцепті</em></strong>&nbsp;&ndash; Тапсырыс берушінің Орындаушының көрсететін қызметіне жүгінуі арқылы Офертаны толық және сөзсіз қабылдауы. Офертаның акцепті Тараптар арасында Оферта шартының жасалғанын білдіреді.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Қызметтің прейскуранты (прайс-лист)</em></strong>&nbsp;&ndash; Орындаушы көрсететін қызметтердің тиісті түрде, бағасын көрсете отырып Сайтта жариялаған жүйелі тізбесі.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оқу</em></strong>&nbsp;&ndash; бейнесабақ, тест және өзге де материалдардан құралған оқуға арналған сабақтар.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Тіркеу</em></strong>&nbsp;&ndash; Тапсырыс берушінің Сайтта орналасқан тіркеу формасын толтыру және жөнелтуге қатысты әрекеттері, Орындаушының Тапсырыс берушіні тіркеуге қатысты ешқандай наразылығы болмаса Тапсырыс берушіге Сайтқа кіруге логин мен құпиясөз &nbsp;беріліп, аккаунт ашылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Сайт</em></strong>&nbsp;&ndash; Онлайн-курстарды орналастыруға арналған, интернет желісінде келесі мекен жай бойынша &laquo;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&raquo; орналастырылған, ақпараттық ресурс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Онлайн-курс</em></strong>&nbsp;&ndash; Орындаушымен құрастырылып, Сайтта орналастырылған және Орындаушымен онлайн оқытуды қолдану арқылы жүзеге асырылатын &laquo;Focus&raquo; атты курс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Коммуникациялық сервистер</em></strong>&nbsp;&ndash; Онлайн-курсқа қатысушылар өзара байланысатын немесе лездік хабарламалар алмасуды қамтамасыз ететін WhatsApp Business API (Вотсап, Воцап немесе Ватсап), Telegram (Телеграмм), Viber (Вайбер), Facebook (Фейсбук), VKontakte (ВКонтакте), Skype (Скайп), Odnoklassniki (Одноклассники), Yandex (Яндекс), WeChat (ВиЧат) сияқты сервистер.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы Офертаның мəтіні Интернет желісінде мына мекен жай бойынша орналастырылған:&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">1.&nbsp;&nbsp;&nbsp;&nbsp; НЕГІЗГІ ЕРЕЖЕЛЕР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Шарттың мəтіні жария оферта болып табылады (Қазақстан Республикасының Азаматтық кодексінің 395 бабының, 5-тармағына сәйкес жария оферта - бұл ұсыныс жасаушы жақтың кез келген хабарлаушысымен ұсыныста көрсетілген жағдайларда шарт жасасу еркі көрінетін, шарттың барлық елеулі ережелері бар ұсыныс. Офертаның акцепті - онлайн сервисті қолдану (Қазақстан Республикасының Азаматтық кодексінің 396 бабына сəйкес). Акцепт - бұл оферта жолданған жақтың оны қабылдағаны туралы жауабы. Акцепт толық әрі бұлтарыссыз болуға тиіс. Осы жария оферта шартының акцепті бойынша іс-қимыл жасай отырып, Тапсырыс беруші өзінің құқық және әрекет қабілеттілігін, сондай-ақ Орындаушымен шарттық қатынасқа түсуіне заңдық құқығы бар екенін растайды. Шартты жасасудың толық әрі бұлтарыссыз келісімі (әрі қарай - Акцепт) болып&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&nbsp;қосымшасының&nbsp;қызметтеріне төлем жасау және/немесе Орындаушының ұсыну шарттарын қабылдау болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ МƏНІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарттың мәні бойынша Орындаушы ағымдағы Прейскурант пен осы Оферта шартының талаптарына сәйкес&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасында Тапсырыс берушіге авторлық құқықпен қорғалатын &laquo;Focus&raquo; курстарын оқыту бойынша қызмет көрсетуге, ал Тапсырыс беруші осы қызмет үшін ақша төлеуге міндетті болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ҚҰҚЫҚТАРЫ МЕН МІНДЕТТЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің алдын-ала келісімінсіз кез келген уақытта, біржақты тәртіппен қызметтердің Прейкурантын және осы жария Офертаның шарттарын өзгертуге құқылы, сонымен бірге өзгертілген шарттарды Интернет желісіндегі мына мекен жайда&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY жариялауды қамтамасыз етеді. Өзгертілген шарттар жарияланған сәттен бастап күшіне енеді;</span></li>\r\n<li><span style=\"color: #ffffff;\">Онлайн-курс бойынша білім беру үдерісін өздігінен жүргізуге, баға беру жүйесін (соның ішінде, Тапсырыс берушінің Онлайн-курсты игеру үдерісі кезінде), аралық және қорытынды аттестациялардың формасын, тәртібін және кезеңдерін, Онлайн-курсты игеру мерзімін таңдауға және өзгертуге.</span></li>\r\n<li><span style=\"color: #ffffff;\">Оқу аяқталғаннан кейін Тапсырыс берушімен біржақты шарты бұзуға, сондай-ақ Тапсырыс беруші Шарттың қандай-да бір талаптарын бұзған жағдайда қызмет толығымен атқарылмай тұрып біржақты шартты бұзуға құқылы. Тапсырыс берушіні шартты бұзу жайлы хабарлама тапсырылған күннен бастап Шарт бұзылған болып есептеледі. Осы тармақта көрсетілген негіздемелер бойынша Шарт бұзылған кезде Тапсырыс берушіге қызметтер құны қайтарылмайды.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Тараптар келіскен мерзімде осы Офертаның шарттарын сәйкес Тапсырыс берушіге тиісті ретпен қызмет көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Тапсырыс беруші ұсынған құпия ақпарат пен мәліметтерді жарияламау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Сайтта Онлайн-курсқа қатысты өзекті ақпаратты, соның ішінде Онлайн курстың мазмұны, көлемі, құны және оқу мерзімі бойынша ақпаратты орналастыру;</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарттың талаптарын сақтаған жағдайда Тапсырыс берушіге қызмет көрсетуге;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс берушіге оның Онлайн-курсты игеруіне барлық қажетті жағдайларды жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші барлық сабақтарды өтіп, тапсырмаларды орындаған жағдайда Онлай-курстан 100 (жүз) пайыз нәтиже шығаруға кепілдік беру.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаның шарттарына сәйкес Орындаушыдан қызметтердің уақытылы және толық көлемде көрсетілуін талап етуге құқылы.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Оферта мен қызметтер Прейскурантында қарастырылған тәртіпте, мерзімде және мөлшерде Орындаушыға көрсетілетін қызметтері үшін төлемді уақытылы және толық жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\"><a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасындағы Тіркеу кезінде өзіңіз туралы расталған, толық және нақты ақпаратты көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Орындаушы берген ақпарат пен басқа да мәліметтерді жария етпеу, соның ішінде Орындаушының жазбаша келісімісіз Оқу материалдарын қандай да бір үшінші тұлғаларға жария етпеу, жария ету арқылы пайда таппау немесе үшінші тұлғаға пайда тапқызбау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы ұсынған сабақтарды оқып біткеннен кейні, &laquo;Сабақты аяқтау&raquo; батырмасын басу арқылы аяқтау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Қызметтерді көрсету мерзімінің басталуын өздігінен қадағалау, оқу жоспарына сәйкес Онлайн-курс бағдарламасын толық көлемде игеру, соның ішінде Орындаушы бекіткен оқу жүктемелері мен өзіндік тапсырмаларды орындау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тіркеу кезінде берілген логин мен құпиясөзді үшінші тұлғаларға бермеу;</span></li>\r\n<li><span style=\"color: #ffffff;\">Логин мен құпиясөзді бұзу әрекеттері арқылы Сайттағы басқа аккаунттарға кіруге бағытталған іс-әрекеттерді жасамау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Коммуникациялық сервистерде дөрекі сөздер мен сондай мағынаға ие хабарламаларды жарияламауға, сондай-ақ келесідей әрекеттерге жол бермеуге:</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\">өшпенділікті насихаттайтын, нәсілдік, этникалық, жыныстық, діни және әлеуметтік белгілері бойынша кемсітетін;</span></li>\r\n<li><span style=\"color: #ffffff;\">басқа қолданушыларды және (немесе) үшінші тұлғаларды балағаттайтын, олардың ары мен абыройына, іскерлік беделіне нұқсан келтіретін;</span></li>\r\n<li><span style=\"color: #ffffff;\">дербес деректер заңнамасын бұзатын;</span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Өз жұмыс орнын 10 Мбит/с кем емес жылдамдықтағы Интернет желісіне қосу, және Онлайн-курс сипаттамасында көрсетілген талаптарға сай дербес компьютер немесе басқа құрылғымен өздігімен ұйымдастыру.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp; ҚЫЗМЕТ КӨРСЕТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші Орындаушы жариялаған ағымдағы Қызметтің прейскурантына сәйкес өзіне қажетті Курс түрін өздігінен анықтап және осы Шарттың 6 Бөліміне сәйкес төлем жасайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс беруші берген мәліметтерді тексереді және Орындаушының есеп шотына ақшалай қаражат түскеннен кейін, бірақ төлем жасағаны туралы төлем құжатының көшірмесін ұсынғаннан кейін, Орындаушы жеке кабинетке қолжетімділікті ашып, Тапсырыс беруші оқуды бастайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші төлемді растайтын құжаттарды ұсынып, бірақ ақшалай қаражат қандай да бір себептермен Орындаушының есеп шотына түспеген болса, онда Орындаушы бұл туралы Тапсырыс берушіге хабарлайды және осы шарт бойынша қызмет көрсетпеуге құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушының кінәсі бойынша өткізілмеген сабақтар еш жоғалтусыз сол тарификациямен басқа уақытқа ауыстырылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ БАҒАСЫ ЖӘНЕ ТӨЛЕУ ТӘРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қызметтер құны бекітілген бағалар - қызметтер Прейскуранты, прайс-лист бойынша есептеледі және төлем жасауға арналған сервис арқылы Тапсырыс берушіге ақша аударылып, түбіртекпен бекітіледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шартқа сәйкес төлем қызмет көрсетілгенге дейін 100 % мөлшерде, Онлайн-курстың басталуына 1 (бір) күн бұрын жасалады.</span></li>\r\n<li><span style=\"color: #ffffff;\">Ақшалай қаражатты аудару міндеттемелерінің орындалу күні болып ақшалай қаражаттың Орындаушының есеп шотына немесе кассасына түскен күні есептеледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің жазбаша талабы бойынша шарт жасасқан күннен бастап 14 (он төрт) күн ішінде, егер қызметтін төлену фактісін растайтын құжат сақталса:</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.1. Қызмет үшін төленген сомманың 30% шарттан шығу ақысы болып ұсталынады;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.2. Қалған қызмет үшін төленген сомманың 70% Сатып алушыға қайтарылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ЖАУАПКЕРШІЛІГІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.3. тармақшасында көрсетілген талаптар бұзылған жағдайда, Тапсырыс беруші Орындаушыға туындаған залалдың және айырылып қалған пайданың толық соммасын өтеуге міндеттенеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.5. немесе 3.4.8. тармақшасындағы көрсетілген талаптарды бұзған жағдайда, Тапсырыс беруші Орындаушыны Оқу қызметін атқаруға арналған WhatsApp сервисынадағы топтан алдын-ала ескертусіз шығаруға құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша міндеттемелерді орындамағаны немесе тиісті деңгейде орындамағы үшін Тараптар ҚР қолданыстағы заңнамасы бойынша жауап береді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тараптар Шарттың талаптарын орындау үдерісінде пайда болған келіспеушіліктерді шешу үшін барлық қажетті шараларды қабылдап, келіссөздер арқылы шешіледі. Дау туындаған сәттен бастап Шағым 20 (жиырма) жұмыс күн ішінде жіберілуі керек. Шағымды қарау мерзімі &ndash; оны алған күннен бастап 7 (жеті) жұмыс күн.</span></li>\r\n<li><span style=\"color: #ffffff;\">Келіссөздер арқылы дауды шешуге қол жеткізілмеген жағдайда, келіспеушіліктер немесе талаптар Қазақстан Республикасының материалдық және іс жүргізу құқығына сәйкес тиісті сотта шешілуге жатады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫ ТОҚТАТУ НЕГІЗДЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарт тараптардың келісімімен тоқтатылуы мүмкін. Бір Тараптың бастамасымен Шарт Қазақстан Республикасы қолданыстағы заңнамасында қарастырылған негіздер бойынша тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ ƏРЕКЕТ ЕТУ МЕРЗІМІ, ОНЫ ӨЗГЕРТУ МЕН ТОҚТАТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Орындаушының жария офертасын Тапсырыс беруші акцепті сәтінен бастап Шарт жасасқан болып есептеледі және Тараптардың Шарт бойынша өз міндеттемелерін толық орындағанға дейін әрекет етеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарт Қазақстан Республикасы заңнамасы мен Шартта қарастырылған негіздер бойынша өзгертілуі немесе тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ФОРС-МАЖОРЛЫҚ ЖАҒДАЙЛАР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Егер Тараптар осы Шартты жасасқаннан кейін, форс-мажорлық мән-жайлардан немесе Тараптардың бақылауына тәуелді болмайтын жағдайлардың әсерінен жауапкершіліктерін орындай алмаса және оның сондай мән-жайлардан туындағанын дәлелдесе, Тараптар ақы төлеу жөніндегі міндеттемелерді қоспағанда, өз міндеттемелерінің кез келгенін орындамағаны үшін жауап бермейді. Форс-мажорлық жағдайларға атап айтқанда, серверді бұғаттау, табиғи катаклизмдер, ереуілдер, өрт, су тасқыны, жарылыстар, соғыстар (жарияланған және жарияланбаған), бүліктер, апаттар, мемлекеттік органдар салатын шектеулер, төтенше жағдай, карантин жатады. Аталған мән-жайлар осы Шартты орындауға тікелей әсер етуі мүмкін.</span></li>\r\n<li><span style=\"color: #ffffff;\">Форс-мажорлық жағдайлардың туындауына байланысты осы Шарт бойынша міндеттемелерді орында алмаған Тарап жоғарыда көрсетілген жағдайлардың пайда болуы туралы екінші Тарапқа жазбаша түрде күнтізбелік 3 (үш) күн ішінде хабарлауға тиіс.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша өз міндеттемелерін орындау үшін тараптарға талап етілетін уақыт аталған жағдайларға байланысты кез келген мерзімге ұзартылады</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ОРЫНДАУШЫНЫҢ РЕКВИЗИТТЕРІ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">\"INCON GROUP\" ЖШС</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">ИИК: KZ879470398927017962</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Валюта: KZT</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН/ИИН: 200240007431</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Банк: АО ДБ &laquo;Альфа-Банк&raquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН Банка: 941240000341</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИК Банка: ALFAKZKA</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Юр адрес: Аль Фараби 13, 1В</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Директор: Асқар Алмас Ержанұлы</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">_______________________________</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; М.О.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><em>Келісім шартты мұқият оқып, танысып, пікір бөліміне \"КЕЛІСЕМІН\" деп жазыңыз. Менеджер сіздің жауабыңызды қабылдағаннан кейін сізге сабақтарға доступ ашылады.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,531,1,NULL,1,'2021-12-16 10:58:47','2022-01-14 16:42:10'),(553,172,99,'Договор','<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">АҚЫЛЫ БІЛІМ БЕРУ ҚЫЗМЕТІН КӨРСЕТУ ТУРАЛЫ ЖАРИЯ ОФЕРТА ШАРТЫ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алматы қ.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&laquo;--&raquo; қараша 2021 жыл</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы шарт жеке тұлғаларға бағытталған, (әрі қарай - &laquo;Тапсырыс беруші&raquo;). Сайтты&nbsp;<strong>&laquo;INCON GROUP&raquo;</strong>&nbsp;ЖШС ұсынады (әрі қарай - &laquo;Орындаушы&raquo;). Тапсырыс беруші мен Орындаушы осы шарттың (әрі қарай - &laquo;Шарт&raquo;) &nbsp;төмендегі талаптарын қабылдай отырып жасасты:</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТЕРМИНДЕР МЕН АНЫҚТАМАЛАР</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы жария оферта шартында төменде көрсетілген ұғымдар келесі мағынада қолданылады:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оферта</em></strong>&nbsp;&ndash; жеке және заңды тұлғаларға онлайн, ақылы білім беру қызметін көрсету туралы Орындаушымен жария оферта шартын жасасу жөнінде ұсыныс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Офертаның акцепті</em></strong>&nbsp;&ndash; Тапсырыс берушінің Орындаушының көрсететін қызметіне жүгінуі арқылы Офертаны толық және сөзсіз қабылдауы. Офертаның акцепті Тараптар арасында Оферта шартының жасалғанын білдіреді.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Қызметтің прейскуранты (прайс-лист)</em></strong>&nbsp;&ndash; Орындаушы көрсететін қызметтердің тиісті түрде, бағасын көрсете отырып Сайтта жариялаған жүйелі тізбесі.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оқу</em></strong>&nbsp;&ndash; бейнесабақ, тест және өзге де материалдардан құралған оқуға арналған сабақтар.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Тіркеу</em></strong>&nbsp;&ndash; Тапсырыс берушінің Сайтта орналасқан тіркеу формасын толтыру және жөнелтуге қатысты әрекеттері, Орындаушының Тапсырыс берушіні тіркеуге қатысты ешқандай наразылығы болмаса Тапсырыс берушіге Сайтқа кіруге логин мен құпиясөз &nbsp;беріліп, аккаунт ашылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Сайт</em></strong>&nbsp;&ndash; Онлайн-курстарды орналастыруға арналған, интернет желісінде келесі мекен жай бойынша &laquo;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&raquo; орналастырылған, ақпараттық ресурс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Онлайн-курс</em></strong>&nbsp;&ndash; Орындаушымен құрастырылып, Сайтта орналастырылған және Орындаушымен онлайн оқытуды қолдану арқылы жүзеге асырылатын &laquo;Focus&raquo; атты курс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Коммуникациялық сервистер</em></strong>&nbsp;&ndash; Онлайн-курсқа қатысушылар өзара байланысатын немесе лездік хабарламалар алмасуды қамтамасыз ететін WhatsApp Business API (Вотсап, Воцап немесе Ватсап), Telegram (Телеграмм), Viber (Вайбер), Facebook (Фейсбук), VKontakte (ВКонтакте), Skype (Скайп), Odnoklassniki (Одноклассники), Yandex (Яндекс), WeChat (ВиЧат) сияқты сервистер.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы Офертаның мəтіні Интернет желісінде мына мекен жай бойынша орналастырылған:&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">1.&nbsp;&nbsp;&nbsp;&nbsp; НЕГІЗГІ ЕРЕЖЕЛЕР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Шарттың мəтіні жария оферта болып табылады (Қазақстан Республикасының Азаматтық кодексінің 395 бабының, 5-тармағына сәйкес жария оферта - бұл ұсыныс жасаушы жақтың кез келген хабарлаушысымен ұсыныста көрсетілген жағдайларда шарт жасасу еркі көрінетін, шарттың барлық елеулі ережелері бар ұсыныс. Офертаның акцепті - онлайн сервисті қолдану (Қазақстан Республикасының Азаматтық кодексінің 396 бабына сəйкес). Акцепт - бұл оферта жолданған жақтың оны қабылдағаны туралы жауабы. Акцепт толық әрі бұлтарыссыз болуға тиіс. Осы жария оферта шартының акцепті бойынша іс-қимыл жасай отырып, Тапсырыс беруші өзінің құқық және әрекет қабілеттілігін, сондай-ақ Орындаушымен шарттық қатынасқа түсуіне заңдық құқығы бар екенін растайды. Шартты жасасудың толық әрі бұлтарыссыз келісімі (әрі қарай - Акцепт) болып&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&nbsp;қосымшасының&nbsp;қызметтеріне төлем жасау және/немесе Орындаушының ұсыну шарттарын қабылдау болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ МƏНІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарттың мәні бойынша Орындаушы ағымдағы Прейскурант пен осы Оферта шартының талаптарына сәйкес&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасында Тапсырыс берушіге авторлық құқықпен қорғалатын &laquo;Focus&raquo; курстарын оқыту бойынша қызмет көрсетуге, ал Тапсырыс беруші осы қызмет үшін ақша төлеуге міндетті болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ҚҰҚЫҚТАРЫ МЕН МІНДЕТТЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің алдын-ала келісімінсіз кез келген уақытта, біржақты тәртіппен қызметтердің Прейкурантын және осы жария Офертаның шарттарын өзгертуге құқылы, сонымен бірге өзгертілген шарттарды Интернет желісіндегі мына мекен жайда&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY жариялауды қамтамасыз етеді. Өзгертілген шарттар жарияланған сәттен бастап күшіне енеді;</span></li>\r\n<li><span style=\"color: #ffffff;\">Онлайн-курс бойынша білім беру үдерісін өздігінен жүргізуге, баға беру жүйесін (соның ішінде, Тапсырыс берушінің Онлайн-курсты игеру үдерісі кезінде), аралық және қорытынды аттестациялардың формасын, тәртібін және кезеңдерін, Онлайн-курсты игеру мерзімін таңдауға және өзгертуге.</span></li>\r\n<li><span style=\"color: #ffffff;\">Оқу аяқталғаннан кейін Тапсырыс берушімен біржақты шарты бұзуға, сондай-ақ Тапсырыс беруші Шарттың қандай-да бір талаптарын бұзған жағдайда қызмет толығымен атқарылмай тұрып біржақты шартты бұзуға құқылы. Тапсырыс берушіні шартты бұзу жайлы хабарлама тапсырылған күннен бастап Шарт бұзылған болып есептеледі. Осы тармақта көрсетілген негіздемелер бойынша Шарт бұзылған кезде Тапсырыс берушіге қызметтер құны қайтарылмайды.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Тараптар келіскен мерзімде осы Офертаның шарттарын сәйкес Тапсырыс берушіге тиісті ретпен қызмет көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Тапсырыс беруші ұсынған құпия ақпарат пен мәліметтерді жарияламау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Сайтта Онлайн-курсқа қатысты өзекті ақпаратты, соның ішінде Онлайн курстың мазмұны, көлемі, құны және оқу мерзімі бойынша ақпаратты орналастыру;</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарттың талаптарын сақтаған жағдайда Тапсырыс берушіге қызмет көрсетуге;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс берушіге оның Онлайн-курсты игеруіне барлық қажетті жағдайларды жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші барлық сабақтарды өтіп, тапсырмаларды орындаған жағдайда Онлай-курстан 100 (жүз) пайыз нәтиже шығаруға кепілдік беру.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаның шарттарына сәйкес Орындаушыдан қызметтердің уақытылы және толық көлемде көрсетілуін талап етуге құқылы.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Оферта мен қызметтер Прейскурантында қарастырылған тәртіпте, мерзімде және мөлшерде Орындаушыға көрсетілетін қызметтері үшін төлемді уақытылы және толық жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\"><a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасындағы Тіркеу кезінде өзіңіз туралы расталған, толық және нақты ақпаратты көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Орындаушы берген ақпарат пен басқа да мәліметтерді жария етпеу, соның ішінде Орындаушының жазбаша келісімісіз Оқу материалдарын қандай да бір үшінші тұлғаларға жария етпеу, жария ету арқылы пайда таппау немесе үшінші тұлғаға пайда тапқызбау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы ұсынған сабақтарды оқып біткеннен кейні, &laquo;Сабақты аяқтау&raquo; батырмасын басу арқылы аяқтау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Қызметтерді көрсету мерзімінің басталуын өздігінен қадағалау, оқу жоспарына сәйкес Онлайн-курс бағдарламасын толық көлемде игеру, соның ішінде Орындаушы бекіткен оқу жүктемелері мен өзіндік тапсырмаларды орындау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тіркеу кезінде берілген логин мен құпиясөзді үшінші тұлғаларға бермеу;</span></li>\r\n<li><span style=\"color: #ffffff;\">Логин мен құпиясөзді бұзу әрекеттері арқылы Сайттағы басқа аккаунттарға кіруге бағытталған іс-әрекеттерді жасамау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Коммуникациялық сервистерде дөрекі сөздер мен сондай мағынаға ие хабарламаларды жарияламауға, сондай-ақ келесідей әрекеттерге жол бермеуге:</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\">өшпенділікті насихаттайтын, нәсілдік, этникалық, жыныстық, діни және әлеуметтік белгілері бойынша кемсітетін;</span></li>\r\n<li><span style=\"color: #ffffff;\">басқа қолданушыларды және (немесе) үшінші тұлғаларды балағаттайтын, олардың ары мен абыройына, іскерлік беделіне нұқсан келтіретін;</span></li>\r\n<li><span style=\"color: #ffffff;\">дербес деректер заңнамасын бұзатын;</span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Өз жұмыс орнын 10 Мбит/с кем емес жылдамдықтағы Интернет желісіне қосу, және Онлайн-курс сипаттамасында көрсетілген талаптарға сай дербес компьютер немесе басқа құрылғымен өздігімен ұйымдастыру.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp; ҚЫЗМЕТ КӨРСЕТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші Орындаушы жариялаған ағымдағы Қызметтің прейскурантына сәйкес өзіне қажетті Курс түрін өздігінен анықтап және осы Шарттың 6 Бөліміне сәйкес төлем жасайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс беруші берген мәліметтерді тексереді және Орындаушының есеп шотына ақшалай қаражат түскеннен кейін, бірақ төлем жасағаны туралы төлем құжатының көшірмесін ұсынғаннан кейін, Орындаушы жеке кабинетке қолжетімділікті ашып, Тапсырыс беруші оқуды бастайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші төлемді растайтын құжаттарды ұсынып, бірақ ақшалай қаражат қандай да бір себептермен Орындаушының есеп шотына түспеген болса, онда Орындаушы бұл туралы Тапсырыс берушіге хабарлайды және осы шарт бойынша қызмет көрсетпеуге құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушының кінәсі бойынша өткізілмеген сабақтар еш жоғалтусыз сол тарификациямен басқа уақытқа ауыстырылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ БАҒАСЫ ЖӘНЕ ТӨЛЕУ ТӘРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қызметтер құны бекітілген бағалар - қызметтер Прейскуранты, прайс-лист бойынша есептеледі және төлем жасауға арналған сервис арқылы Тапсырыс берушіге ақша аударылып, түбіртекпен бекітіледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шартқа сәйкес төлем қызмет көрсетілгенге дейін 100 % мөлшерде, Онлайн-курстың басталуына 1 (бір) күн бұрын жасалады.</span></li>\r\n<li><span style=\"color: #ffffff;\">Ақшалай қаражатты аудару міндеттемелерінің орындалу күні болып ақшалай қаражаттың Орындаушының есеп шотына немесе кассасына түскен күні есептеледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің жазбаша талабы бойынша шарт жасасқан күннен бастап 14 (он төрт) күн ішінде, егер қызметтін төлену фактісін растайтын құжат сақталса:</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.1. Қызмет үшін төленген сомманың 30% шарттан шығу ақысы болып ұсталынады;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.2. Қалған қызмет үшін төленген сомманың 70% Сатып алушыға қайтарылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ЖАУАПКЕРШІЛІГІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.3. тармақшасында көрсетілген талаптар бұзылған жағдайда, Тапсырыс беруші Орындаушыға туындаған залалдың және айырылып қалған пайданың толық соммасын өтеуге міндеттенеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.5. немесе 3.4.8. тармақшасындағы көрсетілген талаптарды бұзған жағдайда, Тапсырыс беруші Орындаушыны Оқу қызметін атқаруға арналған WhatsApp сервисынадағы топтан алдын-ала ескертусіз шығаруға құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша міндеттемелерді орындамағаны немесе тиісті деңгейде орындамағы үшін Тараптар ҚР қолданыстағы заңнамасы бойынша жауап береді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тараптар Шарттың талаптарын орындау үдерісінде пайда болған келіспеушіліктерді шешу үшін барлық қажетті шараларды қабылдап, келіссөздер арқылы шешіледі. Дау туындаған сәттен бастап Шағым 20 (жиырма) жұмыс күн ішінде жіберілуі керек. Шағымды қарау мерзімі &ndash; оны алған күннен бастап 7 (жеті) жұмыс күн.</span></li>\r\n<li><span style=\"color: #ffffff;\">Келіссөздер арқылы дауды шешуге қол жеткізілмеген жағдайда, келіспеушіліктер немесе талаптар Қазақстан Республикасының материалдық және іс жүргізу құқығына сәйкес тиісті сотта шешілуге жатады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫ ТОҚТАТУ НЕГІЗДЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарт тараптардың келісімімен тоқтатылуы мүмкін. Бір Тараптың бастамасымен Шарт Қазақстан Республикасы қолданыстағы заңнамасында қарастырылған негіздер бойынша тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ ƏРЕКЕТ ЕТУ МЕРЗІМІ, ОНЫ ӨЗГЕРТУ МЕН ТОҚТАТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Орындаушының жария офертасын Тапсырыс беруші акцепті сәтінен бастап Шарт жасасқан болып есептеледі және Тараптардың Шарт бойынша өз міндеттемелерін толық орындағанға дейін әрекет етеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарт Қазақстан Республикасы заңнамасы мен Шартта қарастырылған негіздер бойынша өзгертілуі немесе тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ФОРС-МАЖОРЛЫҚ ЖАҒДАЙЛАР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Егер Тараптар осы Шартты жасасқаннан кейін, форс-мажорлық мән-жайлардан немесе Тараптардың бақылауына тәуелді болмайтын жағдайлардың әсерінен жауапкершіліктерін орындай алмаса және оның сондай мән-жайлардан туындағанын дәлелдесе, Тараптар ақы төлеу жөніндегі міндеттемелерді қоспағанда, өз міндеттемелерінің кез келгенін орындамағаны үшін жауап бермейді. Форс-мажорлық жағдайларға атап айтқанда, серверді бұғаттау, табиғи катаклизмдер, ереуілдер, өрт, су тасқыны, жарылыстар, соғыстар (жарияланған және жарияланбаған), бүліктер, апаттар, мемлекеттік органдар салатын шектеулер, төтенше жағдай, карантин жатады. Аталған мән-жайлар осы Шартты орындауға тікелей әсер етуі мүмкін.</span></li>\r\n<li><span style=\"color: #ffffff;\">Форс-мажорлық жағдайлардың туындауына байланысты осы Шарт бойынша міндеттемелерді орында алмаған Тарап жоғарыда көрсетілген жағдайлардың пайда болуы туралы екінші Тарапқа жазбаша түрде күнтізбелік 3 (үш) күн ішінде хабарлауға тиіс.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша өз міндеттемелерін орындау үшін тараптарға талап етілетін уақыт аталған жағдайларға байланысты кез келген мерзімге ұзартылады</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ОРЫНДАУШЫНЫҢ РЕКВИЗИТТЕРІ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">\"INCON GROUP\" ЖШС</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">ИИК: KZ879470398927017962</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Валюта: KZT</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН/ИИН: 200240007431</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Банк: АО ДБ &laquo;Альфа-Банк&raquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН Банка: 941240000341</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИК Банка: ALFAKZKA</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Юр адрес: Аль Фараби 13, 1В</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Директор: Асқар Алмас Ержанұлы</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">_______________________________</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; М.О.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><em>Келісім шартты мұқият оқып, танысып, пікір бөліміне \"КЕЛІСЕМІН\" деп жазыңыз. Менеджер сіздің жауабыңызды қабылдағаннан кейін сізге сабақтарға доступ ашылады.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,118,1,NULL,1,'2021-12-16 11:03:43','2022-01-12 14:04:16'),(554,171,72,'Договор','<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">АҚЫЛЫ БІЛІМ БЕРУ ҚЫЗМЕТІН КӨРСЕТУ ТУРАЛЫ ЖАРИЯ ОФЕРТА ШАРТЫ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алматы қ.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&laquo;--&raquo; қараша 2021 жыл</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы шарт жеке тұлғаларға бағытталған, (әрі қарай - &laquo;Тапсырыс беруші&raquo;). Сайтты&nbsp;<strong>&laquo;INCON GROUP&raquo;</strong>&nbsp;ЖШС ұсынады (әрі қарай - &laquo;Орындаушы&raquo;). Тапсырыс беруші мен Орындаушы осы шарттың (әрі қарай - &laquo;Шарт&raquo;) &nbsp;төмендегі талаптарын қабылдай отырып жасасты:</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТЕРМИНДЕР МЕН АНЫҚТАМАЛАР</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы жария оферта шартында төменде көрсетілген ұғымдар келесі мағынада қолданылады:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оферта</em></strong>&nbsp;&ndash; жеке және заңды тұлғаларға онлайн, ақылы білім беру қызметін көрсету туралы Орындаушымен жария оферта шартын жасасу жөнінде ұсыныс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Офертаның акцепті</em></strong>&nbsp;&ndash; Тапсырыс берушінің Орындаушының көрсететін қызметіне жүгінуі арқылы Офертаны толық және сөзсіз қабылдауы. Офертаның акцепті Тараптар арасында Оферта шартының жасалғанын білдіреді.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Қызметтің прейскуранты (прайс-лист)</em></strong>&nbsp;&ndash; Орындаушы көрсететін қызметтердің тиісті түрде, бағасын көрсете отырып Сайтта жариялаған жүйелі тізбесі.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оқу</em></strong>&nbsp;&ndash; бейнесабақ, тест және өзге де материалдардан құралған оқуға арналған сабақтар.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Тіркеу</em></strong>&nbsp;&ndash; Тапсырыс берушінің Сайтта орналасқан тіркеу формасын толтыру және жөнелтуге қатысты әрекеттері, Орындаушының Тапсырыс берушіні тіркеуге қатысты ешқандай наразылығы болмаса Тапсырыс берушіге Сайтқа кіруге логин мен құпиясөз &nbsp;беріліп, аккаунт ашылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Сайт</em></strong>&nbsp;&ndash; Онлайн-курстарды орналастыруға арналған, интернет желісінде келесі мекен жай бойынша &laquo;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&raquo; орналастырылған, ақпараттық ресурс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Онлайн-курс</em></strong>&nbsp;&ndash; Орындаушымен құрастырылып, Сайтта орналастырылған және Орындаушымен онлайн оқытуды қолдану арқылы жүзеге асырылатын &laquo;Focus&raquo; атты курс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Коммуникациялық сервистер</em></strong>&nbsp;&ndash; Онлайн-курсқа қатысушылар өзара байланысатын немесе лездік хабарламалар алмасуды қамтамасыз ететін WhatsApp Business API (Вотсап, Воцап немесе Ватсап), Telegram (Телеграмм), Viber (Вайбер), Facebook (Фейсбук), VKontakte (ВКонтакте), Skype (Скайп), Odnoklassniki (Одноклассники), Yandex (Яндекс), WeChat (ВиЧат) сияқты сервистер.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы Офертаның мəтіні Интернет желісінде мына мекен жай бойынша орналастырылған:&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">1.&nbsp;&nbsp;&nbsp;&nbsp; НЕГІЗГІ ЕРЕЖЕЛЕР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Шарттың мəтіні жария оферта болып табылады (Қазақстан Республикасының Азаматтық кодексінің 395 бабының, 5-тармағына сәйкес жария оферта - бұл ұсыныс жасаушы жақтың кез келген хабарлаушысымен ұсыныста көрсетілген жағдайларда шарт жасасу еркі көрінетін, шарттың барлық елеулі ережелері бар ұсыныс. Офертаның акцепті - онлайн сервисті қолдану (Қазақстан Республикасының Азаматтық кодексінің 396 бабына сəйкес). Акцепт - бұл оферта жолданған жақтың оны қабылдағаны туралы жауабы. Акцепт толық әрі бұлтарыссыз болуға тиіс. Осы жария оферта шартының акцепті бойынша іс-қимыл жасай отырып, Тапсырыс беруші өзінің құқық және әрекет қабілеттілігін, сондай-ақ Орындаушымен шарттық қатынасқа түсуіне заңдық құқығы бар екенін растайды. Шартты жасасудың толық әрі бұлтарыссыз келісімі (әрі қарай - Акцепт) болып&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&nbsp;қосымшасының&nbsp;қызметтеріне төлем жасау және/немесе Орындаушының ұсыну шарттарын қабылдау болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ МƏНІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарттың мәні бойынша Орындаушы ағымдағы Прейскурант пен осы Оферта шартының талаптарына сәйкес&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасында Тапсырыс берушіге авторлық құқықпен қорғалатын &laquo;Focus&raquo; курстарын оқыту бойынша қызмет көрсетуге, ал Тапсырыс беруші осы қызмет үшін ақша төлеуге міндетті болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ҚҰҚЫҚТАРЫ МЕН МІНДЕТТЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің алдын-ала келісімінсіз кез келген уақытта, біржақты тәртіппен қызметтердің Прейкурантын және осы жария Офертаның шарттарын өзгертуге құқылы, сонымен бірге өзгертілген шарттарды Интернет желісіндегі мына мекен жайда&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY жариялауды қамтамасыз етеді. Өзгертілген шарттар жарияланған сәттен бастап күшіне енеді;</span></li>\r\n<li><span style=\"color: #ffffff;\">Онлайн-курс бойынша білім беру үдерісін өздігінен жүргізуге, баға беру жүйесін (соның ішінде, Тапсырыс берушінің Онлайн-курсты игеру үдерісі кезінде), аралық және қорытынды аттестациялардың формасын, тәртібін және кезеңдерін, Онлайн-курсты игеру мерзімін таңдауға және өзгертуге.</span></li>\r\n<li><span style=\"color: #ffffff;\">Оқу аяқталғаннан кейін Тапсырыс берушімен біржақты шарты бұзуға, сондай-ақ Тапсырыс беруші Шарттың қандай-да бір талаптарын бұзған жағдайда қызмет толығымен атқарылмай тұрып біржақты шартты бұзуға құқылы. Тапсырыс берушіні шартты бұзу жайлы хабарлама тапсырылған күннен бастап Шарт бұзылған болып есептеледі. Осы тармақта көрсетілген негіздемелер бойынша Шарт бұзылған кезде Тапсырыс берушіге қызметтер құны қайтарылмайды.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Тараптар келіскен мерзімде осы Офертаның шарттарын сәйкес Тапсырыс берушіге тиісті ретпен қызмет көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Тапсырыс беруші ұсынған құпия ақпарат пен мәліметтерді жарияламау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Сайтта Онлайн-курсқа қатысты өзекті ақпаратты, соның ішінде Онлайн курстың мазмұны, көлемі, құны және оқу мерзімі бойынша ақпаратты орналастыру;</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарттың талаптарын сақтаған жағдайда Тапсырыс берушіге қызмет көрсетуге;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс берушіге оның Онлайн-курсты игеруіне барлық қажетті жағдайларды жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші барлық сабақтарды өтіп, тапсырмаларды орындаған жағдайда Онлай-курстан 100 (жүз) пайыз нәтиже шығаруға кепілдік беру.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаның шарттарына сәйкес Орындаушыдан қызметтердің уақытылы және толық көлемде көрсетілуін талап етуге құқылы.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Оферта мен қызметтер Прейскурантында қарастырылған тәртіпте, мерзімде және мөлшерде Орындаушыға көрсетілетін қызметтері үшін төлемді уақытылы және толық жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\"><a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасындағы Тіркеу кезінде өзіңіз туралы расталған, толық және нақты ақпаратты көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Орындаушы берген ақпарат пен басқа да мәліметтерді жария етпеу, соның ішінде Орындаушының жазбаша келісімісіз Оқу материалдарын қандай да бір үшінші тұлғаларға жария етпеу, жария ету арқылы пайда таппау немесе үшінші тұлғаға пайда тапқызбау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы ұсынған сабақтарды оқып біткеннен кейні, &laquo;Сабақты аяқтау&raquo; батырмасын басу арқылы аяқтау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Қызметтерді көрсету мерзімінің басталуын өздігінен қадағалау, оқу жоспарына сәйкес Онлайн-курс бағдарламасын толық көлемде игеру, соның ішінде Орындаушы бекіткен оқу жүктемелері мен өзіндік тапсырмаларды орындау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тіркеу кезінде берілген логин мен құпиясөзді үшінші тұлғаларға бермеу;</span></li>\r\n<li><span style=\"color: #ffffff;\">Логин мен құпиясөзді бұзу әрекеттері арқылы Сайттағы басқа аккаунттарға кіруге бағытталған іс-әрекеттерді жасамау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Коммуникациялық сервистерде дөрекі сөздер мен сондай мағынаға ие хабарламаларды жарияламауға, сондай-ақ келесідей әрекеттерге жол бермеуге:</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\">өшпенділікті насихаттайтын, нәсілдік, этникалық, жыныстық, діни және әлеуметтік белгілері бойынша кемсітетін;</span></li>\r\n<li><span style=\"color: #ffffff;\">басқа қолданушыларды және (немесе) үшінші тұлғаларды балағаттайтын, олардың ары мен абыройына, іскерлік беделіне нұқсан келтіретін;</span></li>\r\n<li><span style=\"color: #ffffff;\">дербес деректер заңнамасын бұзатын;</span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Өз жұмыс орнын 10 Мбит/с кем емес жылдамдықтағы Интернет желісіне қосу, және Онлайн-курс сипаттамасында көрсетілген талаптарға сай дербес компьютер немесе басқа құрылғымен өздігімен ұйымдастыру.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp; ҚЫЗМЕТ КӨРСЕТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші Орындаушы жариялаған ағымдағы Қызметтің прейскурантына сәйкес өзіне қажетті Курс түрін өздігінен анықтап және осы Шарттың 6 Бөліміне сәйкес төлем жасайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс беруші берген мәліметтерді тексереді және Орындаушының есеп шотына ақшалай қаражат түскеннен кейін, бірақ төлем жасағаны туралы төлем құжатының көшірмесін ұсынғаннан кейін, Орындаушы жеке кабинетке қолжетімділікті ашып, Тапсырыс беруші оқуды бастайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші төлемді растайтын құжаттарды ұсынып, бірақ ақшалай қаражат қандай да бір себептермен Орындаушының есеп шотына түспеген болса, онда Орындаушы бұл туралы Тапсырыс берушіге хабарлайды және осы шарт бойынша қызмет көрсетпеуге құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушының кінәсі бойынша өткізілмеген сабақтар еш жоғалтусыз сол тарификациямен басқа уақытқа ауыстырылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ БАҒАСЫ ЖӘНЕ ТӨЛЕУ ТӘРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қызметтер құны бекітілген бағалар - қызметтер Прейскуранты, прайс-лист бойынша есептеледі және төлем жасауға арналған сервис арқылы Тапсырыс берушіге ақша аударылып, түбіртекпен бекітіледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шартқа сәйкес төлем қызмет көрсетілгенге дейін 100 % мөлшерде, Онлайн-курстың басталуына 1 (бір) күн бұрын жасалады.</span></li>\r\n<li><span style=\"color: #ffffff;\">Ақшалай қаражатты аудару міндеттемелерінің орындалу күні болып ақшалай қаражаттың Орындаушының есеп шотына немесе кассасына түскен күні есептеледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің жазбаша талабы бойынша шарт жасасқан күннен бастап 14 (он төрт) күн ішінде, егер қызметтін төлену фактісін растайтын құжат сақталса:</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.1. Қызмет үшін төленген сомманың 30% шарттан шығу ақысы болып ұсталынады;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.2. Қалған қызмет үшін төленген сомманың 70% Сатып алушыға қайтарылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ЖАУАПКЕРШІЛІГІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.3. тармақшасында көрсетілген талаптар бұзылған жағдайда, Тапсырыс беруші Орындаушыға туындаған залалдың және айырылып қалған пайданың толық соммасын өтеуге міндеттенеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.5. немесе 3.4.8. тармақшасындағы көрсетілген талаптарды бұзған жағдайда, Тапсырыс беруші Орындаушыны Оқу қызметін атқаруға арналған WhatsApp сервисынадағы топтан алдын-ала ескертусіз шығаруға құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша міндеттемелерді орындамағаны немесе тиісті деңгейде орындамағы үшін Тараптар ҚР қолданыстағы заңнамасы бойынша жауап береді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тараптар Шарттың талаптарын орындау үдерісінде пайда болған келіспеушіліктерді шешу үшін барлық қажетті шараларды қабылдап, келіссөздер арқылы шешіледі. Дау туындаған сәттен бастап Шағым 20 (жиырма) жұмыс күн ішінде жіберілуі керек. Шағымды қарау мерзімі &ndash; оны алған күннен бастап 7 (жеті) жұмыс күн.</span></li>\r\n<li><span style=\"color: #ffffff;\">Келіссөздер арқылы дауды шешуге қол жеткізілмеген жағдайда, келіспеушіліктер немесе талаптар Қазақстан Республикасының материалдық және іс жүргізу құқығына сәйкес тиісті сотта шешілуге жатады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫ ТОҚТАТУ НЕГІЗДЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарт тараптардың келісімімен тоқтатылуы мүмкін. Бір Тараптың бастамасымен Шарт Қазақстан Республикасы қолданыстағы заңнамасында қарастырылған негіздер бойынша тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ ƏРЕКЕТ ЕТУ МЕРЗІМІ, ОНЫ ӨЗГЕРТУ МЕН ТОҚТАТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Орындаушының жария офертасын Тапсырыс беруші акцепті сәтінен бастап Шарт жасасқан болып есептеледі және Тараптардың Шарт бойынша өз міндеттемелерін толық орындағанға дейін әрекет етеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарт Қазақстан Республикасы заңнамасы мен Шартта қарастырылған негіздер бойынша өзгертілуі немесе тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ФОРС-МАЖОРЛЫҚ ЖАҒДАЙЛАР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Егер Тараптар осы Шартты жасасқаннан кейін, форс-мажорлық мән-жайлардан немесе Тараптардың бақылауына тәуелді болмайтын жағдайлардың әсерінен жауапкершіліктерін орындай алмаса және оның сондай мән-жайлардан туындағанын дәлелдесе, Тараптар ақы төлеу жөніндегі міндеттемелерді қоспағанда, өз міндеттемелерінің кез келгенін орындамағаны үшін жауап бермейді. Форс-мажорлық жағдайларға атап айтқанда, серверді бұғаттау, табиғи катаклизмдер, ереуілдер, өрт, су тасқыны, жарылыстар, соғыстар (жарияланған және жарияланбаған), бүліктер, апаттар, мемлекеттік органдар салатын шектеулер, төтенше жағдай, карантин жатады. Аталған мән-жайлар осы Шартты орындауға тікелей әсер етуі мүмкін.</span></li>\r\n<li><span style=\"color: #ffffff;\">Форс-мажорлық жағдайлардың туындауына байланысты осы Шарт бойынша міндеттемелерді орында алмаған Тарап жоғарыда көрсетілген жағдайлардың пайда болуы туралы екінші Тарапқа жазбаша түрде күнтізбелік 3 (үш) күн ішінде хабарлауға тиіс.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша өз міндеттемелерін орындау үшін тараптарға талап етілетін уақыт аталған жағдайларға байланысты кез келген мерзімге ұзартылады</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ОРЫНДАУШЫНЫҢ РЕКВИЗИТТЕРІ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">\"INCON GROUP\" ЖШС</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">ИИК: KZ879470398927017962</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Валюта: KZT</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН/ИИН: 200240007431</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Банк: АО ДБ &laquo;Альфа-Банк&raquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН Банка: 941240000341</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИК Банка: ALFAKZKA</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Юр адрес: Аль Фараби 13, 1В</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Директор: Асқар Алмас Ержанұлы</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">_______________________________</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; М.О.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><em>Келісім шартты мұқият оқып, танысып, пікір бөліміне \"КЕЛІСЕМІН\" деп жазыңыз. Менеджер сіздің жауабыңызды қабылдағаннан кейін сізге сабақтарға доступ ашылады.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,50,1,NULL,1,'2021-12-16 12:07:39','2022-01-11 12:56:09'),(555,170,63,'Договор','<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">АҚЫЛЫ БІЛІМ БЕРУ ҚЫЗМЕТІН КӨРСЕТУ ТУРАЛЫ ЖАРИЯ ОФЕРТА ШАРТЫ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алматы қ.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&laquo;--&raquo; қараша 2021 жыл</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы шарт жеке тұлғаларға бағытталған, (әрі қарай - &laquo;Тапсырыс беруші&raquo;). Сайтты&nbsp;<strong>&laquo;INCON GROUP&raquo;</strong>&nbsp;ЖШС ұсынады (әрі қарай - &laquo;Орындаушы&raquo;). Тапсырыс беруші мен Орындаушы осы шарттың (әрі қарай - &laquo;Шарт&raquo;) &nbsp;төмендегі талаптарын қабылдай отырып жасасты:</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТЕРМИНДЕР МЕН АНЫҚТАМАЛАР</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы жария оферта шартында төменде көрсетілген ұғымдар келесі мағынада қолданылады:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оферта</em></strong>&nbsp;&ndash; жеке және заңды тұлғаларға онлайн, ақылы білім беру қызметін көрсету туралы Орындаушымен жария оферта шартын жасасу жөнінде ұсыныс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Офертаның акцепті</em></strong>&nbsp;&ndash; Тапсырыс берушінің Орындаушының көрсететін қызметіне жүгінуі арқылы Офертаны толық және сөзсіз қабылдауы. Офертаның акцепті Тараптар арасында Оферта шартының жасалғанын білдіреді.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Қызметтің прейскуранты (прайс-лист)</em></strong>&nbsp;&ndash; Орындаушы көрсететін қызметтердің тиісті түрде, бағасын көрсете отырып Сайтта жариялаған жүйелі тізбесі.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оқу</em></strong>&nbsp;&ndash; бейнесабақ, тест және өзге де материалдардан құралған оқуға арналған сабақтар.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Тіркеу</em></strong>&nbsp;&ndash; Тапсырыс берушінің Сайтта орналасқан тіркеу формасын толтыру және жөнелтуге қатысты әрекеттері, Орындаушының Тапсырыс берушіні тіркеуге қатысты ешқандай наразылығы болмаса Тапсырыс берушіге Сайтқа кіруге логин мен құпиясөз &nbsp;беріліп, аккаунт ашылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Сайт</em></strong>&nbsp;&ndash; Онлайн-курстарды орналастыруға арналған, интернет желісінде келесі мекен жай бойынша &laquo;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&raquo; орналастырылған, ақпараттық ресурс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Онлайн-курс</em></strong>&nbsp;&ndash; Орындаушымен құрастырылып, Сайтта орналастырылған және Орындаушымен онлайн оқытуды қолдану арқылы жүзеге асырылатын &laquo;Focus&raquo; атты курс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Коммуникациялық сервистер</em></strong>&nbsp;&ndash; Онлайн-курсқа қатысушылар өзара байланысатын немесе лездік хабарламалар алмасуды қамтамасыз ететін WhatsApp Business API (Вотсап, Воцап немесе Ватсап), Telegram (Телеграмм), Viber (Вайбер), Facebook (Фейсбук), VKontakte (ВКонтакте), Skype (Скайп), Odnoklassniki (Одноклассники), Yandex (Яндекс), WeChat (ВиЧат) сияқты сервистер.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы Офертаның мəтіні Интернет желісінде мына мекен жай бойынша орналастырылған:&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">1.&nbsp;&nbsp;&nbsp;&nbsp; НЕГІЗГІ ЕРЕЖЕЛЕР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Шарттың мəтіні жария оферта болып табылады (Қазақстан Республикасының Азаматтық кодексінің 395 бабының, 5-тармағына сәйкес жария оферта - бұл ұсыныс жасаушы жақтың кез келген хабарлаушысымен ұсыныста көрсетілген жағдайларда шарт жасасу еркі көрінетін, шарттың барлық елеулі ережелері бар ұсыныс. Офертаның акцепті - онлайн сервисті қолдану (Қазақстан Республикасының Азаматтық кодексінің 396 бабына сəйкес). Акцепт - бұл оферта жолданған жақтың оны қабылдағаны туралы жауабы. Акцепт толық әрі бұлтарыссыз болуға тиіс. Осы жария оферта шартының акцепті бойынша іс-қимыл жасай отырып, Тапсырыс беруші өзінің құқық және әрекет қабілеттілігін, сондай-ақ Орындаушымен шарттық қатынасқа түсуіне заңдық құқығы бар екенін растайды. Шартты жасасудың толық әрі бұлтарыссыз келісімі (әрі қарай - Акцепт) болып&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&nbsp;қосымшасының&nbsp;қызметтеріне төлем жасау және/немесе Орындаушының ұсыну шарттарын қабылдау болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ МƏНІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарттың мәні бойынша Орындаушы ағымдағы Прейскурант пен осы Оферта шартының талаптарына сәйкес&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасында Тапсырыс берушіге авторлық құқықпен қорғалатын &laquo;Focus&raquo; курстарын оқыту бойынша қызмет көрсетуге, ал Тапсырыс беруші осы қызмет үшін ақша төлеуге міндетті болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ҚҰҚЫҚТАРЫ МЕН МІНДЕТТЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің алдын-ала келісімінсіз кез келген уақытта, біржақты тәртіппен қызметтердің Прейкурантын және осы жария Офертаның шарттарын өзгертуге құқылы, сонымен бірге өзгертілген шарттарды Интернет желісіндегі мына мекен жайда&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY жариялауды қамтамасыз етеді. Өзгертілген шарттар жарияланған сәттен бастап күшіне енеді;</span></li>\r\n<li><span style=\"color: #ffffff;\">Онлайн-курс бойынша білім беру үдерісін өздігінен жүргізуге, баға беру жүйесін (соның ішінде, Тапсырыс берушінің Онлайн-курсты игеру үдерісі кезінде), аралық және қорытынды аттестациялардың формасын, тәртібін және кезеңдерін, Онлайн-курсты игеру мерзімін таңдауға және өзгертуге.</span></li>\r\n<li><span style=\"color: #ffffff;\">Оқу аяқталғаннан кейін Тапсырыс берушімен біржақты шарты бұзуға, сондай-ақ Тапсырыс беруші Шарттың қандай-да бір талаптарын бұзған жағдайда қызмет толығымен атқарылмай тұрып біржақты шартты бұзуға құқылы. Тапсырыс берушіні шартты бұзу жайлы хабарлама тапсырылған күннен бастап Шарт бұзылған болып есептеледі. Осы тармақта көрсетілген негіздемелер бойынша Шарт бұзылған кезде Тапсырыс берушіге қызметтер құны қайтарылмайды.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Тараптар келіскен мерзімде осы Офертаның шарттарын сәйкес Тапсырыс берушіге тиісті ретпен қызмет көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Тапсырыс беруші ұсынған құпия ақпарат пен мәліметтерді жарияламау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Сайтта Онлайн-курсқа қатысты өзекті ақпаратты, соның ішінде Онлайн курстың мазмұны, көлемі, құны және оқу мерзімі бойынша ақпаратты орналастыру;</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарттың талаптарын сақтаған жағдайда Тапсырыс берушіге қызмет көрсетуге;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс берушіге оның Онлайн-курсты игеруіне барлық қажетті жағдайларды жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші барлық сабақтарды өтіп, тапсырмаларды орындаған жағдайда Онлай-курстан 100 (жүз) пайыз нәтиже шығаруға кепілдік беру.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаның шарттарына сәйкес Орындаушыдан қызметтердің уақытылы және толық көлемде көрсетілуін талап етуге құқылы.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Оферта мен қызметтер Прейскурантында қарастырылған тәртіпте, мерзімде және мөлшерде Орындаушыға көрсетілетін қызметтері үшін төлемді уақытылы және толық жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\"><a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасындағы Тіркеу кезінде өзіңіз туралы расталған, толық және нақты ақпаратты көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Орындаушы берген ақпарат пен басқа да мәліметтерді жария етпеу, соның ішінде Орындаушының жазбаша келісімісіз Оқу материалдарын қандай да бір үшінші тұлғаларға жария етпеу, жария ету арқылы пайда таппау немесе үшінші тұлғаға пайда тапқызбау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы ұсынған сабақтарды оқып біткеннен кейні, &laquo;Сабақты аяқтау&raquo; батырмасын басу арқылы аяқтау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Қызметтерді көрсету мерзімінің басталуын өздігінен қадағалау, оқу жоспарына сәйкес Онлайн-курс бағдарламасын толық көлемде игеру, соның ішінде Орындаушы бекіткен оқу жүктемелері мен өзіндік тапсырмаларды орындау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тіркеу кезінде берілген логин мен құпиясөзді үшінші тұлғаларға бермеу;</span></li>\r\n<li><span style=\"color: #ffffff;\">Логин мен құпиясөзді бұзу әрекеттері арқылы Сайттағы басқа аккаунттарға кіруге бағытталған іс-әрекеттерді жасамау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Коммуникациялық сервистерде дөрекі сөздер мен сондай мағынаға ие хабарламаларды жарияламауға, сондай-ақ келесідей әрекеттерге жол бермеуге:</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\">өшпенділікті насихаттайтын, нәсілдік, этникалық, жыныстық, діни және әлеуметтік белгілері бойынша кемсітетін;</span></li>\r\n<li><span style=\"color: #ffffff;\">басқа қолданушыларды және (немесе) үшінші тұлғаларды балағаттайтын, олардың ары мен абыройына, іскерлік беделіне нұқсан келтіретін;</span></li>\r\n<li><span style=\"color: #ffffff;\">дербес деректер заңнамасын бұзатын;</span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Өз жұмыс орнын 10 Мбит/с кем емес жылдамдықтағы Интернет желісіне қосу, және Онлайн-курс сипаттамасында көрсетілген талаптарға сай дербес компьютер немесе басқа құрылғымен өздігімен ұйымдастыру.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp; ҚЫЗМЕТ КӨРСЕТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші Орындаушы жариялаған ағымдағы Қызметтің прейскурантына сәйкес өзіне қажетті Курс түрін өздігінен анықтап және осы Шарттың 6 Бөліміне сәйкес төлем жасайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс беруші берген мәліметтерді тексереді және Орындаушының есеп шотына ақшалай қаражат түскеннен кейін, бірақ төлем жасағаны туралы төлем құжатының көшірмесін ұсынғаннан кейін, Орындаушы жеке кабинетке қолжетімділікті ашып, Тапсырыс беруші оқуды бастайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші төлемді растайтын құжаттарды ұсынып, бірақ ақшалай қаражат қандай да бір себептермен Орындаушының есеп шотына түспеген болса, онда Орындаушы бұл туралы Тапсырыс берушіге хабарлайды және осы шарт бойынша қызмет көрсетпеуге құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушының кінәсі бойынша өткізілмеген сабақтар еш жоғалтусыз сол тарификациямен басқа уақытқа ауыстырылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ БАҒАСЫ ЖӘНЕ ТӨЛЕУ ТӘРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қызметтер құны бекітілген бағалар - қызметтер Прейскуранты, прайс-лист бойынша есептеледі және төлем жасауға арналған сервис арқылы Тапсырыс берушіге ақша аударылып, түбіртекпен бекітіледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шартқа сәйкес төлем қызмет көрсетілгенге дейін 100 % мөлшерде, Онлайн-курстың басталуына 1 (бір) күн бұрын жасалады.</span></li>\r\n<li><span style=\"color: #ffffff;\">Ақшалай қаражатты аудару міндеттемелерінің орындалу күні болып ақшалай қаражаттың Орындаушының есеп шотына немесе кассасына түскен күні есептеледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің жазбаша талабы бойынша шарт жасасқан күннен бастап 14 (он төрт) күн ішінде, егер қызметтін төлену фактісін растайтын құжат сақталса:</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.1. Қызмет үшін төленген сомманың 30% шарттан шығу ақысы болып ұсталынады;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.2. Қалған қызмет үшін төленген сомманың 70% Сатып алушыға қайтарылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ЖАУАПКЕРШІЛІГІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.3. тармақшасында көрсетілген талаптар бұзылған жағдайда, Тапсырыс беруші Орындаушыға туындаған залалдың және айырылып қалған пайданың толық соммасын өтеуге міндеттенеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.5. немесе 3.4.8. тармақшасындағы көрсетілген талаптарды бұзған жағдайда, Тапсырыс беруші Орындаушыны Оқу қызметін атқаруға арналған WhatsApp сервисынадағы топтан алдын-ала ескертусіз шығаруға құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша міндеттемелерді орындамағаны немесе тиісті деңгейде орындамағы үшін Тараптар ҚР қолданыстағы заңнамасы бойынша жауап береді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тараптар Шарттың талаптарын орындау үдерісінде пайда болған келіспеушіліктерді шешу үшін барлық қажетті шараларды қабылдап, келіссөздер арқылы шешіледі. Дау туындаған сәттен бастап Шағым 20 (жиырма) жұмыс күн ішінде жіберілуі керек. Шағымды қарау мерзімі &ndash; оны алған күннен бастап 7 (жеті) жұмыс күн.</span></li>\r\n<li><span style=\"color: #ffffff;\">Келіссөздер арқылы дауды шешуге қол жеткізілмеген жағдайда, келіспеушіліктер немесе талаптар Қазақстан Республикасының материалдық және іс жүргізу құқығына сәйкес тиісті сотта шешілуге жатады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫ ТОҚТАТУ НЕГІЗДЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарт тараптардың келісімімен тоқтатылуы мүмкін. Бір Тараптың бастамасымен Шарт Қазақстан Республикасы қолданыстағы заңнамасында қарастырылған негіздер бойынша тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ ƏРЕКЕТ ЕТУ МЕРЗІМІ, ОНЫ ӨЗГЕРТУ МЕН ТОҚТАТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Орындаушының жария офертасын Тапсырыс беруші акцепті сәтінен бастап Шарт жасасқан болып есептеледі және Тараптардың Шарт бойынша өз міндеттемелерін толық орындағанға дейін әрекет етеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарт Қазақстан Республикасы заңнамасы мен Шартта қарастырылған негіздер бойынша өзгертілуі немесе тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ФОРС-МАЖОРЛЫҚ ЖАҒДАЙЛАР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Егер Тараптар осы Шартты жасасқаннан кейін, форс-мажорлық мән-жайлардан немесе Тараптардың бақылауына тәуелді болмайтын жағдайлардың әсерінен жауапкершіліктерін орындай алмаса және оның сондай мән-жайлардан туындағанын дәлелдесе, Тараптар ақы төлеу жөніндегі міндеттемелерді қоспағанда, өз міндеттемелерінің кез келгенін орындамағаны үшін жауап бермейді. Форс-мажорлық жағдайларға атап айтқанда, серверді бұғаттау, табиғи катаклизмдер, ереуілдер, өрт, су тасқыны, жарылыстар, соғыстар (жарияланған және жарияланбаған), бүліктер, апаттар, мемлекеттік органдар салатын шектеулер, төтенше жағдай, карантин жатады. Аталған мән-жайлар осы Шартты орындауға тікелей әсер етуі мүмкін.</span></li>\r\n<li><span style=\"color: #ffffff;\">Форс-мажорлық жағдайлардың туындауына байланысты осы Шарт бойынша міндеттемелерді орында алмаған Тарап жоғарыда көрсетілген жағдайлардың пайда болуы туралы екінші Тарапқа жазбаша түрде күнтізбелік 3 (үш) күн ішінде хабарлауға тиіс.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша өз міндеттемелерін орындау үшін тараптарға талап етілетін уақыт аталған жағдайларға байланысты кез келген мерзімге ұзартылады</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ОРЫНДАУШЫНЫҢ РЕКВИЗИТТЕРІ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">\"INCON GROUP\" ЖШС</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">ИИК: KZ879470398927017962</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Валюта: KZT</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН/ИИН: 200240007431</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Банк: АО ДБ &laquo;Альфа-Банк&raquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН Банка: 941240000341</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИК Банка: ALFAKZKA</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Юр адрес: Аль Фараби 13, 1В</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Директор: Асқар Алмас Ержанұлы</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">_______________________________</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; М.О.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><em>Келісім шартты мұқият оқып, танысып, пікір бөліміне \"КЕЛІСЕМІН\" деп жазыңыз. Менеджер сіздің жауабыңызды қабылдағаннан кейін сізге сабақтарға доступ ашылады.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,145,1,NULL,1,'2021-12-16 12:08:30','2022-01-04 14:09:44'),(556,169,54,'Договор','<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">АҚЫЛЫ БІЛІМ БЕРУ ҚЫЗМЕТІН КӨРСЕТУ ТУРАЛЫ ЖАРИЯ ОФЕРТА ШАРТЫ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алматы қ.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&laquo;--&raquo; қараша 2021 жыл</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы шарт жеке тұлғаларға бағытталған, (әрі қарай - &laquo;Тапсырыс беруші&raquo;). Сайтты&nbsp;<strong>&laquo;INCON GROUP&raquo;</strong>&nbsp;ЖШС ұсынады (әрі қарай - &laquo;Орындаушы&raquo;). Тапсырыс беруші мен Орындаушы осы шарттың (әрі қарай - &laquo;Шарт&raquo;) &nbsp;төмендегі талаптарын қабылдай отырып жасасты:</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТЕРМИНДЕР МЕН АНЫҚТАМАЛАР</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы жария оферта шартында төменде көрсетілген ұғымдар келесі мағынада қолданылады:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оферта</em></strong>&nbsp;&ndash; жеке және заңды тұлғаларға онлайн, ақылы білім беру қызметін көрсету туралы Орындаушымен жария оферта шартын жасасу жөнінде ұсыныс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Офертаның акцепті</em></strong>&nbsp;&ndash; Тапсырыс берушінің Орындаушының көрсететін қызметіне жүгінуі арқылы Офертаны толық және сөзсіз қабылдауы. Офертаның акцепті Тараптар арасында Оферта шартының жасалғанын білдіреді.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Қызметтің прейскуранты (прайс-лист)</em></strong>&nbsp;&ndash; Орындаушы көрсететін қызметтердің тиісті түрде, бағасын көрсете отырып Сайтта жариялаған жүйелі тізбесі.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оқу</em></strong>&nbsp;&ndash; бейнесабақ, тест және өзге де материалдардан құралған оқуға арналған сабақтар.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Тіркеу</em></strong>&nbsp;&ndash; Тапсырыс берушінің Сайтта орналасқан тіркеу формасын толтыру және жөнелтуге қатысты әрекеттері, Орындаушының Тапсырыс берушіні тіркеуге қатысты ешқандай наразылығы болмаса Тапсырыс берушіге Сайтқа кіруге логин мен құпиясөз &nbsp;беріліп, аккаунт ашылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Сайт</em></strong>&nbsp;&ndash; Онлайн-курстарды орналастыруға арналған, интернет желісінде келесі мекен жай бойынша &laquo;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&raquo; орналастырылған, ақпараттық ресурс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Онлайн-курс</em></strong>&nbsp;&ndash; Орындаушымен құрастырылып, Сайтта орналастырылған және Орындаушымен онлайн оқытуды қолдану арқылы жүзеге асырылатын &laquo;Focus&raquo; атты курс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Коммуникациялық сервистер</em></strong>&nbsp;&ndash; Онлайн-курсқа қатысушылар өзара байланысатын немесе лездік хабарламалар алмасуды қамтамасыз ететін WhatsApp Business API (Вотсап, Воцап немесе Ватсап), Telegram (Телеграмм), Viber (Вайбер), Facebook (Фейсбук), VKontakte (ВКонтакте), Skype (Скайп), Odnoklassniki (Одноклассники), Yandex (Яндекс), WeChat (ВиЧат) сияқты сервистер.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы Офертаның мəтіні Интернет желісінде мына мекен жай бойынша орналастырылған:&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">1.&nbsp;&nbsp;&nbsp;&nbsp; НЕГІЗГІ ЕРЕЖЕЛЕР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Шарттың мəтіні жария оферта болып табылады (Қазақстан Республикасының Азаматтық кодексінің 395 бабының, 5-тармағына сәйкес жария оферта - бұл ұсыныс жасаушы жақтың кез келген хабарлаушысымен ұсыныста көрсетілген жағдайларда шарт жасасу еркі көрінетін, шарттың барлық елеулі ережелері бар ұсыныс. Офертаның акцепті - онлайн сервисті қолдану (Қазақстан Республикасының Азаматтық кодексінің 396 бабына сəйкес). Акцепт - бұл оферта жолданған жақтың оны қабылдағаны туралы жауабы. Акцепт толық әрі бұлтарыссыз болуға тиіс. Осы жария оферта шартының акцепті бойынша іс-қимыл жасай отырып, Тапсырыс беруші өзінің құқық және әрекет қабілеттілігін, сондай-ақ Орындаушымен шарттық қатынасқа түсуіне заңдық құқығы бар екенін растайды. Шартты жасасудың толық әрі бұлтарыссыз келісімі (әрі қарай - Акцепт) болып&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&nbsp;қосымшасының&nbsp;қызметтеріне төлем жасау және/немесе Орындаушының ұсыну шарттарын қабылдау болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ МƏНІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарттың мәні бойынша Орындаушы ағымдағы Прейскурант пен осы Оферта шартының талаптарына сәйкес&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасында Тапсырыс берушіге авторлық құқықпен қорғалатын &laquo;Focus&raquo; курстарын оқыту бойынша қызмет көрсетуге, ал Тапсырыс беруші осы қызмет үшін ақша төлеуге міндетті болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ҚҰҚЫҚТАРЫ МЕН МІНДЕТТЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің алдын-ала келісімінсіз кез келген уақытта, біржақты тәртіппен қызметтердің Прейкурантын және осы жария Офертаның шарттарын өзгертуге құқылы, сонымен бірге өзгертілген шарттарды Интернет желісіндегі мына мекен жайда&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY жариялауды қамтамасыз етеді. Өзгертілген шарттар жарияланған сәттен бастап күшіне енеді;</span></li>\r\n<li><span style=\"color: #ffffff;\">Онлайн-курс бойынша білім беру үдерісін өздігінен жүргізуге, баға беру жүйесін (соның ішінде, Тапсырыс берушінің Онлайн-курсты игеру үдерісі кезінде), аралық және қорытынды аттестациялардың формасын, тәртібін және кезеңдерін, Онлайн-курсты игеру мерзімін таңдауға және өзгертуге.</span></li>\r\n<li><span style=\"color: #ffffff;\">Оқу аяқталғаннан кейін Тапсырыс берушімен біржақты шарты бұзуға, сондай-ақ Тапсырыс беруші Шарттың қандай-да бір талаптарын бұзған жағдайда қызмет толығымен атқарылмай тұрып біржақты шартты бұзуға құқылы. Тапсырыс берушіні шартты бұзу жайлы хабарлама тапсырылған күннен бастап Шарт бұзылған болып есептеледі. Осы тармақта көрсетілген негіздемелер бойынша Шарт бұзылған кезде Тапсырыс берушіге қызметтер құны қайтарылмайды.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Тараптар келіскен мерзімде осы Офертаның шарттарын сәйкес Тапсырыс берушіге тиісті ретпен қызмет көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Тапсырыс беруші ұсынған құпия ақпарат пен мәліметтерді жарияламау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Сайтта Онлайн-курсқа қатысты өзекті ақпаратты, соның ішінде Онлайн курстың мазмұны, көлемі, құны және оқу мерзімі бойынша ақпаратты орналастыру;</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарттың талаптарын сақтаған жағдайда Тапсырыс берушіге қызмет көрсетуге;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс берушіге оның Онлайн-курсты игеруіне барлық қажетті жағдайларды жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші барлық сабақтарды өтіп, тапсырмаларды орындаған жағдайда Онлай-курстан 100 (жүз) пайыз нәтиже шығаруға кепілдік беру.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаның шарттарына сәйкес Орындаушыдан қызметтердің уақытылы және толық көлемде көрсетілуін талап етуге құқылы.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Оферта мен қызметтер Прейскурантында қарастырылған тәртіпте, мерзімде және мөлшерде Орындаушыға көрсетілетін қызметтері үшін төлемді уақытылы және толық жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\"><a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасындағы Тіркеу кезінде өзіңіз туралы расталған, толық және нақты ақпаратты көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Орындаушы берген ақпарат пен басқа да мәліметтерді жария етпеу, соның ішінде Орындаушының жазбаша келісімісіз Оқу материалдарын қандай да бір үшінші тұлғаларға жария етпеу, жария ету арқылы пайда таппау немесе үшінші тұлғаға пайда тапқызбау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы ұсынған сабақтарды оқып біткеннен кейні, &laquo;Сабақты аяқтау&raquo; батырмасын басу арқылы аяқтау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Қызметтерді көрсету мерзімінің басталуын өздігінен қадағалау, оқу жоспарына сәйкес Онлайн-курс бағдарламасын толық көлемде игеру, соның ішінде Орындаушы бекіткен оқу жүктемелері мен өзіндік тапсырмаларды орындау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тіркеу кезінде берілген логин мен құпиясөзді үшінші тұлғаларға бермеу;</span></li>\r\n<li><span style=\"color: #ffffff;\">Логин мен құпиясөзді бұзу әрекеттері арқылы Сайттағы басқа аккаунттарға кіруге бағытталған іс-әрекеттерді жасамау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Коммуникациялық сервистерде дөрекі сөздер мен сондай мағынаға ие хабарламаларды жарияламауға, сондай-ақ келесідей әрекеттерге жол бермеуге:</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\">өшпенділікті насихаттайтын, нәсілдік, этникалық, жыныстық, діни және әлеуметтік белгілері бойынша кемсітетін;</span></li>\r\n<li><span style=\"color: #ffffff;\">басқа қолданушыларды және (немесе) үшінші тұлғаларды балағаттайтын, олардың ары мен абыройына, іскерлік беделіне нұқсан келтіретін;</span></li>\r\n<li><span style=\"color: #ffffff;\">дербес деректер заңнамасын бұзатын;</span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Өз жұмыс орнын 10 Мбит/с кем емес жылдамдықтағы Интернет желісіне қосу, және Онлайн-курс сипаттамасында көрсетілген талаптарға сай дербес компьютер немесе басқа құрылғымен өздігімен ұйымдастыру.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp; ҚЫЗМЕТ КӨРСЕТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші Орындаушы жариялаған ағымдағы Қызметтің прейскурантына сәйкес өзіне қажетті Курс түрін өздігінен анықтап және осы Шарттың 6 Бөліміне сәйкес төлем жасайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс беруші берген мәліметтерді тексереді және Орындаушының есеп шотына ақшалай қаражат түскеннен кейін, бірақ төлем жасағаны туралы төлем құжатының көшірмесін ұсынғаннан кейін, Орындаушы жеке кабинетке қолжетімділікті ашып, Тапсырыс беруші оқуды бастайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші төлемді растайтын құжаттарды ұсынып, бірақ ақшалай қаражат қандай да бір себептермен Орындаушының есеп шотына түспеген болса, онда Орындаушы бұл туралы Тапсырыс берушіге хабарлайды және осы шарт бойынша қызмет көрсетпеуге құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушының кінәсі бойынша өткізілмеген сабақтар еш жоғалтусыз сол тарификациямен басқа уақытқа ауыстырылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ БАҒАСЫ ЖӘНЕ ТӨЛЕУ ТӘРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қызметтер құны бекітілген бағалар - қызметтер Прейскуранты, прайс-лист бойынша есептеледі және төлем жасауға арналған сервис арқылы Тапсырыс берушіге ақша аударылып, түбіртекпен бекітіледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шартқа сәйкес төлем қызмет көрсетілгенге дейін 100 % мөлшерде, Онлайн-курстың басталуына 1 (бір) күн бұрын жасалады.</span></li>\r\n<li><span style=\"color: #ffffff;\">Ақшалай қаражатты аудару міндеттемелерінің орындалу күні болып ақшалай қаражаттың Орындаушының есеп шотына немесе кассасына түскен күні есептеледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің жазбаша талабы бойынша шарт жасасқан күннен бастап 14 (он төрт) күн ішінде, егер қызметтін төлену фактісін растайтын құжат сақталса:</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.1. Қызмет үшін төленген сомманың 30% шарттан шығу ақысы болып ұсталынады;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.2. Қалған қызмет үшін төленген сомманың 70% Сатып алушыға қайтарылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ЖАУАПКЕРШІЛІГІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.3. тармақшасында көрсетілген талаптар бұзылған жағдайда, Тапсырыс беруші Орындаушыға туындаған залалдың және айырылып қалған пайданың толық соммасын өтеуге міндеттенеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.5. немесе 3.4.8. тармақшасындағы көрсетілген талаптарды бұзған жағдайда, Тапсырыс беруші Орындаушыны Оқу қызметін атқаруға арналған WhatsApp сервисынадағы топтан алдын-ала ескертусіз шығаруға құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша міндеттемелерді орындамағаны немесе тиісті деңгейде орындамағы үшін Тараптар ҚР қолданыстағы заңнамасы бойынша жауап береді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тараптар Шарттың талаптарын орындау үдерісінде пайда болған келіспеушіліктерді шешу үшін барлық қажетті шараларды қабылдап, келіссөздер арқылы шешіледі. Дау туындаған сәттен бастап Шағым 20 (жиырма) жұмыс күн ішінде жіберілуі керек. Шағымды қарау мерзімі &ndash; оны алған күннен бастап 7 (жеті) жұмыс күн.</span></li>\r\n<li><span style=\"color: #ffffff;\">Келіссөздер арқылы дауды шешуге қол жеткізілмеген жағдайда, келіспеушіліктер немесе талаптар Қазақстан Республикасының материалдық және іс жүргізу құқығына сәйкес тиісті сотта шешілуге жатады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫ ТОҚТАТУ НЕГІЗДЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарт тараптардың келісімімен тоқтатылуы мүмкін. Бір Тараптың бастамасымен Шарт Қазақстан Республикасы қолданыстағы заңнамасында қарастырылған негіздер бойынша тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ ƏРЕКЕТ ЕТУ МЕРЗІМІ, ОНЫ ӨЗГЕРТУ МЕН ТОҚТАТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Орындаушының жария офертасын Тапсырыс беруші акцепті сәтінен бастап Шарт жасасқан болып есептеледі және Тараптардың Шарт бойынша өз міндеттемелерін толық орындағанға дейін әрекет етеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарт Қазақстан Республикасы заңнамасы мен Шартта қарастырылған негіздер бойынша өзгертілуі немесе тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ФОРС-МАЖОРЛЫҚ ЖАҒДАЙЛАР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Егер Тараптар осы Шартты жасасқаннан кейін, форс-мажорлық мән-жайлардан немесе Тараптардың бақылауына тәуелді болмайтын жағдайлардың әсерінен жауапкершіліктерін орындай алмаса және оның сондай мән-жайлардан туындағанын дәлелдесе, Тараптар ақы төлеу жөніндегі міндеттемелерді қоспағанда, өз міндеттемелерінің кез келгенін орындамағаны үшін жауап бермейді. Форс-мажорлық жағдайларға атап айтқанда, серверді бұғаттау, табиғи катаклизмдер, ереуілдер, өрт, су тасқыны, жарылыстар, соғыстар (жарияланған және жарияланбаған), бүліктер, апаттар, мемлекеттік органдар салатын шектеулер, төтенше жағдай, карантин жатады. Аталған мән-жайлар осы Шартты орындауға тікелей әсер етуі мүмкін.</span></li>\r\n<li><span style=\"color: #ffffff;\">Форс-мажорлық жағдайлардың туындауына байланысты осы Шарт бойынша міндеттемелерді орында алмаған Тарап жоғарыда көрсетілген жағдайлардың пайда болуы туралы екінші Тарапқа жазбаша түрде күнтізбелік 3 (үш) күн ішінде хабарлауға тиіс.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша өз міндеттемелерін орындау үшін тараптарға талап етілетін уақыт аталған жағдайларға байланысты кез келген мерзімге ұзартылады</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ОРЫНДАУШЫНЫҢ РЕКВИЗИТТЕРІ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">\"INCON GROUP\" ЖШС</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">ИИК: KZ879470398927017962</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Валюта: KZT</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН/ИИН: 200240007431</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Банк: АО ДБ &laquo;Альфа-Банк&raquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН Банка: 941240000341</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИК Банка: ALFAKZKA</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Юр адрес: Аль Фараби 13, 1В</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Директор: Асқар Алмас Ержанұлы</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">_______________________________</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; М.О.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><em>Келісім шартты мұқият оқып, танысып, пікір бөліміне \"КЕЛІСЕМІН\" деп жазыңыз. Менеджер сіздің жауабыңызды қабылдағаннан кейін сізге сабақтарға доступ ашылады.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,41,1,NULL,1,'2021-12-16 12:09:15','2022-01-03 16:10:14'),(557,168,38,'Договор','<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">АҚЫЛЫ БІЛІМ БЕРУ ҚЫЗМЕТІН КӨРСЕТУ ТУРАЛЫ ЖАРИЯ ОФЕРТА ШАРТЫ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алматы қ.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&laquo;--&raquo; қараша 2021 жыл</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы шарт жеке тұлғаларға бағытталған, (әрі қарай - &laquo;Тапсырыс беруші&raquo;). Сайтты&nbsp;<strong>&laquo;INCON GROUP&raquo;</strong>&nbsp;ЖШС ұсынады (әрі қарай - &laquo;Орындаушы&raquo;). Тапсырыс беруші мен Орындаушы осы шарттың (әрі қарай - &laquo;Шарт&raquo;) &nbsp;төмендегі талаптарын қабылдай отырып жасасты:</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТЕРМИНДЕР МЕН АНЫҚТАМАЛАР</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы жария оферта шартында төменде көрсетілген ұғымдар келесі мағынада қолданылады:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оферта</em></strong>&nbsp;&ndash; жеке және заңды тұлғаларға онлайн, ақылы білім беру қызметін көрсету туралы Орындаушымен жария оферта шартын жасасу жөнінде ұсыныс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Офертаның акцепті</em></strong>&nbsp;&ndash; Тапсырыс берушінің Орындаушының көрсететін қызметіне жүгінуі арқылы Офертаны толық және сөзсіз қабылдауы. Офертаның акцепті Тараптар арасында Оферта шартының жасалғанын білдіреді.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Қызметтің прейскуранты (прайс-лист)</em></strong>&nbsp;&ndash; Орындаушы көрсететін қызметтердің тиісті түрде, бағасын көрсете отырып Сайтта жариялаған жүйелі тізбесі.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оқу</em></strong>&nbsp;&ndash; бейнесабақ, тест және өзге де материалдардан құралған оқуға арналған сабақтар.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Тіркеу</em></strong>&nbsp;&ndash; Тапсырыс берушінің Сайтта орналасқан тіркеу формасын толтыру және жөнелтуге қатысты әрекеттері, Орындаушының Тапсырыс берушіні тіркеуге қатысты ешқандай наразылығы болмаса Тапсырыс берушіге Сайтқа кіруге логин мен құпиясөз &nbsp;беріліп, аккаунт ашылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Сайт</em></strong>&nbsp;&ndash; Онлайн-курстарды орналастыруға арналған, интернет желісінде келесі мекен жай бойынша &laquo;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&raquo; орналастырылған, ақпараттық ресурс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Онлайн-курс</em></strong>&nbsp;&ndash; Орындаушымен құрастырылып, Сайтта орналастырылған және Орындаушымен онлайн оқытуды қолдану арқылы жүзеге асырылатын &laquo;Focus&raquo; атты курс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Коммуникациялық сервистер</em></strong>&nbsp;&ndash; Онлайн-курсқа қатысушылар өзара байланысатын немесе лездік хабарламалар алмасуды қамтамасыз ететін WhatsApp Business API (Вотсап, Воцап немесе Ватсап), Telegram (Телеграмм), Viber (Вайбер), Facebook (Фейсбук), VKontakte (ВКонтакте), Skype (Скайп), Odnoklassniki (Одноклассники), Yandex (Яндекс), WeChat (ВиЧат) сияқты сервистер.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы Офертаның мəтіні Интернет желісінде мына мекен жай бойынша орналастырылған:&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">1.&nbsp;&nbsp;&nbsp;&nbsp; НЕГІЗГІ ЕРЕЖЕЛЕР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Шарттың мəтіні жария оферта болып табылады (Қазақстан Республикасының Азаматтық кодексінің 395 бабының, 5-тармағына сәйкес жария оферта - бұл ұсыныс жасаушы жақтың кез келген хабарлаушысымен ұсыныста көрсетілген жағдайларда шарт жасасу еркі көрінетін, шарттың барлық елеулі ережелері бар ұсыныс. Офертаның акцепті - онлайн сервисті қолдану (Қазақстан Республикасының Азаматтық кодексінің 396 бабына сəйкес). Акцепт - бұл оферта жолданған жақтың оны қабылдағаны туралы жауабы. Акцепт толық әрі бұлтарыссыз болуға тиіс. Осы жария оферта шартының акцепті бойынша іс-қимыл жасай отырып, Тапсырыс беруші өзінің құқық және әрекет қабілеттілігін, сондай-ақ Орындаушымен шарттық қатынасқа түсуіне заңдық құқығы бар екенін растайды. Шартты жасасудың толық әрі бұлтарыссыз келісімі (әрі қарай - Акцепт) болып&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&nbsp;қосымшасының&nbsp;қызметтеріне төлем жасау және/немесе Орындаушының ұсыну шарттарын қабылдау болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ МƏНІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарттың мәні бойынша Орындаушы ағымдағы Прейскурант пен осы Оферта шартының талаптарына сәйкес&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасында Тапсырыс берушіге авторлық құқықпен қорғалатын &laquo;Focus&raquo; курстарын оқыту бойынша қызмет көрсетуге, ал Тапсырыс беруші осы қызмет үшін ақша төлеуге міндетті болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ҚҰҚЫҚТАРЫ МЕН МІНДЕТТЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің алдын-ала келісімінсіз кез келген уақытта, біржақты тәртіппен қызметтердің Прейкурантын және осы жария Офертаның шарттарын өзгертуге құқылы, сонымен бірге өзгертілген шарттарды Интернет желісіндегі мына мекен жайда&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY жариялауды қамтамасыз етеді. Өзгертілген шарттар жарияланған сәттен бастап күшіне енеді;</span></li>\r\n<li><span style=\"color: #ffffff;\">Онлайн-курс бойынша білім беру үдерісін өздігінен жүргізуге, баға беру жүйесін (соның ішінде, Тапсырыс берушінің Онлайн-курсты игеру үдерісі кезінде), аралық және қорытынды аттестациялардың формасын, тәртібін және кезеңдерін, Онлайн-курсты игеру мерзімін таңдауға және өзгертуге.</span></li>\r\n<li><span style=\"color: #ffffff;\">Оқу аяқталғаннан кейін Тапсырыс берушімен біржақты шарты бұзуға, сондай-ақ Тапсырыс беруші Шарттың қандай-да бір талаптарын бұзған жағдайда қызмет толығымен атқарылмай тұрып біржақты шартты бұзуға құқылы. Тапсырыс берушіні шартты бұзу жайлы хабарлама тапсырылған күннен бастап Шарт бұзылған болып есептеледі. Осы тармақта көрсетілген негіздемелер бойынша Шарт бұзылған кезде Тапсырыс берушіге қызметтер құны қайтарылмайды.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Тараптар келіскен мерзімде осы Офертаның шарттарын сәйкес Тапсырыс берушіге тиісті ретпен қызмет көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Тапсырыс беруші ұсынған құпия ақпарат пен мәліметтерді жарияламау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Сайтта Онлайн-курсқа қатысты өзекті ақпаратты, соның ішінде Онлайн курстың мазмұны, көлемі, құны және оқу мерзімі бойынша ақпаратты орналастыру;</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарттың талаптарын сақтаған жағдайда Тапсырыс берушіге қызмет көрсетуге;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс берушіге оның Онлайн-курсты игеруіне барлық қажетті жағдайларды жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші барлық сабақтарды өтіп, тапсырмаларды орындаған жағдайда Онлай-курстан 100 (жүз) пайыз нәтиже шығаруға кепілдік беру.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаның шарттарына сәйкес Орындаушыдан қызметтердің уақытылы және толық көлемде көрсетілуін талап етуге құқылы.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Оферта мен қызметтер Прейскурантында қарастырылған тәртіпте, мерзімде және мөлшерде Орындаушыға көрсетілетін қызметтері үшін төлемді уақытылы және толық жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\"><a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасындағы Тіркеу кезінде өзіңіз туралы расталған, толық және нақты ақпаратты көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Орындаушы берген ақпарат пен басқа да мәліметтерді жария етпеу, соның ішінде Орындаушының жазбаша келісімісіз Оқу материалдарын қандай да бір үшінші тұлғаларға жария етпеу, жария ету арқылы пайда таппау немесе үшінші тұлғаға пайда тапқызбау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы ұсынған сабақтарды оқып біткеннен кейні, &laquo;Сабақты аяқтау&raquo; батырмасын басу арқылы аяқтау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Қызметтерді көрсету мерзімінің басталуын өздігінен қадағалау, оқу жоспарына сәйкес Онлайн-курс бағдарламасын толық көлемде игеру, соның ішінде Орындаушы бекіткен оқу жүктемелері мен өзіндік тапсырмаларды орындау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тіркеу кезінде берілген логин мен құпиясөзді үшінші тұлғаларға бермеу;</span></li>\r\n<li><span style=\"color: #ffffff;\">Логин мен құпиясөзді бұзу әрекеттері арқылы Сайттағы басқа аккаунттарға кіруге бағытталған іс-әрекеттерді жасамау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Коммуникациялық сервистерде дөрекі сөздер мен сондай мағынаға ие хабарламаларды жарияламауға, сондай-ақ келесідей әрекеттерге жол бермеуге:</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\">өшпенділікті насихаттайтын, нәсілдік, этникалық, жыныстық, діни және әлеуметтік белгілері бойынша кемсітетін;</span></li>\r\n<li><span style=\"color: #ffffff;\">басқа қолданушыларды және (немесе) үшінші тұлғаларды балағаттайтын, олардың ары мен абыройына, іскерлік беделіне нұқсан келтіретін;</span></li>\r\n<li><span style=\"color: #ffffff;\">дербес деректер заңнамасын бұзатын;</span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Өз жұмыс орнын 10 Мбит/с кем емес жылдамдықтағы Интернет желісіне қосу, және Онлайн-курс сипаттамасында көрсетілген талаптарға сай дербес компьютер немесе басқа құрылғымен өздігімен ұйымдастыру.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp; ҚЫЗМЕТ КӨРСЕТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші Орындаушы жариялаған ағымдағы Қызметтің прейскурантына сәйкес өзіне қажетті Курс түрін өздігінен анықтап және осы Шарттың 6 Бөліміне сәйкес төлем жасайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс беруші берген мәліметтерді тексереді және Орындаушының есеп шотына ақшалай қаражат түскеннен кейін, бірақ төлем жасағаны туралы төлем құжатының көшірмесін ұсынғаннан кейін, Орындаушы жеке кабинетке қолжетімділікті ашып, Тапсырыс беруші оқуды бастайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші төлемді растайтын құжаттарды ұсынып, бірақ ақшалай қаражат қандай да бір себептермен Орындаушының есеп шотына түспеген болса, онда Орындаушы бұл туралы Тапсырыс берушіге хабарлайды және осы шарт бойынша қызмет көрсетпеуге құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушының кінәсі бойынша өткізілмеген сабақтар еш жоғалтусыз сол тарификациямен басқа уақытқа ауыстырылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ БАҒАСЫ ЖӘНЕ ТӨЛЕУ ТӘРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қызметтер құны бекітілген бағалар - қызметтер Прейскуранты, прайс-лист бойынша есептеледі және төлем жасауға арналған сервис арқылы Тапсырыс берушіге ақша аударылып, түбіртекпен бекітіледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шартқа сәйкес төлем қызмет көрсетілгенге дейін 100 % мөлшерде, Онлайн-курстың басталуына 1 (бір) күн бұрын жасалады.</span></li>\r\n<li><span style=\"color: #ffffff;\">Ақшалай қаражатты аудару міндеттемелерінің орындалу күні болып ақшалай қаражаттың Орындаушының есеп шотына немесе кассасына түскен күні есептеледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің жазбаша талабы бойынша шарт жасасқан күннен бастап 14 (он төрт) күн ішінде, егер қызметтін төлену фактісін растайтын құжат сақталса:</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.1. Қызмет үшін төленген сомманың 30% шарттан шығу ақысы болып ұсталынады;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.2. Қалған қызмет үшін төленген сомманың 70% Сатып алушыға қайтарылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ЖАУАПКЕРШІЛІГІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.3. тармақшасында көрсетілген талаптар бұзылған жағдайда, Тапсырыс беруші Орындаушыға туындаған залалдың және айырылып қалған пайданың толық соммасын өтеуге міндеттенеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.5. немесе 3.4.8. тармақшасындағы көрсетілген талаптарды бұзған жағдайда, Тапсырыс беруші Орындаушыны Оқу қызметін атқаруға арналған WhatsApp сервисынадағы топтан алдын-ала ескертусіз шығаруға құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша міндеттемелерді орындамағаны немесе тиісті деңгейде орындамағы үшін Тараптар ҚР қолданыстағы заңнамасы бойынша жауап береді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тараптар Шарттың талаптарын орындау үдерісінде пайда болған келіспеушіліктерді шешу үшін барлық қажетті шараларды қабылдап, келіссөздер арқылы шешіледі. Дау туындаған сәттен бастап Шағым 20 (жиырма) жұмыс күн ішінде жіберілуі керек. Шағымды қарау мерзімі &ndash; оны алған күннен бастап 7 (жеті) жұмыс күн.</span></li>\r\n<li><span style=\"color: #ffffff;\">Келіссөздер арқылы дауды шешуге қол жеткізілмеген жағдайда, келіспеушіліктер немесе талаптар Қазақстан Республикасының материалдық және іс жүргізу құқығына сәйкес тиісті сотта шешілуге жатады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫ ТОҚТАТУ НЕГІЗДЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарт тараптардың келісімімен тоқтатылуы мүмкін. Бір Тараптың бастамасымен Шарт Қазақстан Республикасы қолданыстағы заңнамасында қарастырылған негіздер бойынша тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ ƏРЕКЕТ ЕТУ МЕРЗІМІ, ОНЫ ӨЗГЕРТУ МЕН ТОҚТАТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Орындаушының жария офертасын Тапсырыс беруші акцепті сәтінен бастап Шарт жасасқан болып есептеледі және Тараптардың Шарт бойынша өз міндеттемелерін толық орындағанға дейін әрекет етеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарт Қазақстан Республикасы заңнамасы мен Шартта қарастырылған негіздер бойынша өзгертілуі немесе тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ФОРС-МАЖОРЛЫҚ ЖАҒДАЙЛАР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Егер Тараптар осы Шартты жасасқаннан кейін, форс-мажорлық мән-жайлардан немесе Тараптардың бақылауына тәуелді болмайтын жағдайлардың әсерінен жауапкершіліктерін орындай алмаса және оның сондай мән-жайлардан туындағанын дәлелдесе, Тараптар ақы төлеу жөніндегі міндеттемелерді қоспағанда, өз міндеттемелерінің кез келгенін орындамағаны үшін жауап бермейді. Форс-мажорлық жағдайларға атап айтқанда, серверді бұғаттау, табиғи катаклизмдер, ереуілдер, өрт, су тасқыны, жарылыстар, соғыстар (жарияланған және жарияланбаған), бүліктер, апаттар, мемлекеттік органдар салатын шектеулер, төтенше жағдай, карантин жатады. Аталған мән-жайлар осы Шартты орындауға тікелей әсер етуі мүмкін.</span></li>\r\n<li><span style=\"color: #ffffff;\">Форс-мажорлық жағдайлардың туындауына байланысты осы Шарт бойынша міндеттемелерді орында алмаған Тарап жоғарыда көрсетілген жағдайлардың пайда болуы туралы екінші Тарапқа жазбаша түрде күнтізбелік 3 (үш) күн ішінде хабарлауға тиіс.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша өз міндеттемелерін орындау үшін тараптарға талап етілетін уақыт аталған жағдайларға байланысты кез келген мерзімге ұзартылады</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ОРЫНДАУШЫНЫҢ РЕКВИЗИТТЕРІ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">\"INCON GROUP\" ЖШС</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">ИИК: KZ879470398927017962</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Валюта: KZT</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН/ИИН: 200240007431</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Банк: АО ДБ &laquo;Альфа-Банк&raquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН Банка: 941240000341</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИК Банка: ALFAKZKA</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Юр адрес: Аль Фараби 13, 1В</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Директор: Асқар Алмас Ержанұлы</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">_______________________________</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; М.О.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><em>Келісім шартты мұқият оқып, танысып, пікір бөліміне \"КЕЛІСЕМІН\" деп жазыңыз. Менеджер сіздің жауабыңызды қабылдағаннан кейін сізге сабақтарға доступ ашылады.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,248,1,NULL,1,'2021-12-16 12:09:40','2022-01-16 15:07:38'),(575,173,88,'Кіріспе сабақ','<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәлем, \"FOCUS\" курсының студенті ???</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">\"FOCUS\"&nbsp; курсының \"КӘСІПКЕР\" пакетінде тауарыңызды шығынсыз сатудың техникаларын, каналдарын және кәсіпті сапалы жүргізудің жолдарын үйренесіз.</span><br /><span style=\"color: #ffffff;\">Сізде барлық сабаққа 3 ай доступ болады ✅</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Курс бағдарламасы:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">I МОДУЛЬ: Ақшаға дайындық</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">II МОДУЛЬ:&nbsp;Стратегия</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">III&nbsp;МОДУЛЬ:&nbsp;Анализ рынка</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">IV&nbsp;МОДУЛЬ:&nbsp;Тауарға арналған прогрев</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">V&nbsp;МОДУЛЬ:&nbsp;Клиентпен жұмыс</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VI&nbsp;МОДУЛЬ: Сату техникалары</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VII&nbsp;МОДУЛЬ: Логистика</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VIII&nbsp;МОДУЛЬ:&nbsp;Маркетинг</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Өміріңізді жаңа этапқа ауыстыратын білім болсын!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәттілік, миллионер!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">?Курсқа қатысу шарттары:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Чатта негатив хабарлама жазуға болмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторға артық әңгіме айту мен жеке шекарасынан асуға рұқсат жоқ;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Курс ақысы кері қайтарылмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">✅ Әр бір сабақты оқып, тапсырмаларды кураторға уақытылы жіберу керек;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторларға 2 рет тапсырманы кешіктірсеңіз, сұрағына жауап бермесеңіз, нәтижеңізді өз жауапкершілігімізге алмаймыз. Оған қоса общий группадан шығарыласыз және алдағы уақытта куратордың және наставник, трекердің қызметі көрсетілмейді!!! Алайда сабаққа доступ болады. Дальше сабақты жеке өзіңіз оқисыз. Сізге де бізге де нәтиже шығарғаныңыз керек!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сабақтардың авторлық құқығы сақталған!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізге берген логин мен құпия сөзді басқа адаммен бөлісуге болмайды.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Бөліскен жағдайда курсқа доступ жабылады, акаунтыңыз блокқа түседі.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658889534\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,NULL,NULL,NULL,841,1,NULL,0,'2021-12-20 11:43:48','2022-01-17 02:44:12'),(577,173,88,'Үлкен ақшаға ниет ету','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастамас алдын сіздің бірінші ниетіңіз дұрыс болуы қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сіз курсқа \"табысымды еслеймін, материалдық жағдайымды жақсартамын\"- деп келдіңіз. Ол үшін сіздің ақшаға деген ниетіңіз, көзқарасыңыз дұрыс болуы керек. Осы тақырыпты өз ісінің маманы, 15 жылдық тәжірибесі бар ислам шеңберіндегі психолог - Балқия Балтабай ханым түсіндіріп айтатын болады.&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658750536\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658913998\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Курсты бастаған кезде ниетіңізді дұрыстаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниетті анықтауға арналған сұрақтарға жауап беріңіз:</span></p>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Бұл не үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім қалап тұр?</span></li>\r\n<li><span style=\"color: #ffffff;\">Не аламын?</span></li>\r\n</ul>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастар алдында, соған қоса курсты бастар алдын Алла разылығы үшін, ісіңіздің берекелі болуы үшін садақа беріңіз. Міндетті түрде көп ақша болуы міндетті емес. Жағдайыңыз келгенше берсеңіз болады.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазір сіз А точкаңызда тұрсыз. Курсты барысында, курсты аяқтағандағы Б точкаңыздың қандай екенін көз алдыңызға елестетіп, детально қағазға жазып шығыңыз. Курсты аяғына дейін жеткізе алмаймын деп, шаршаған кездерде осы жазғаныңыз сізге мотивация беретін болады.</span></li>\r\n</ol>','',NULL,NULL,NULL,NULL,1484,1,NULL,0,'2021-12-20 12:46:44','2022-01-17 06:27:08'),(579,173,88,'Ақша психологиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақша психологиясы&nbsp;байлықтың маңызды аспектісі, өйткені ақша &ndash; бұл энергия, оның келуін үнемі сезініп, оң көзқараспен қарау өте маңызды. Егер миыңызда ақшаның образы негативті болса, сіздің ақша табуыңыз қиындайды. Сол үшін бірінші ақша образына қатысты мидағы установкалармен жұмыс жасау қажет. <iframe src=\"https://player.vimeo.com/video/658995855\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe> &nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қолыңызға ақшаны алып, тапсырманы орындаңыз. Ақшаны көз алдыңызда тұрған адам ретінде елестетіңіз. Ақша сізге қандай кейіпте елестеді? Оны көргенде өзіңізді қалай сезінудесіз? Ол қандай адам? Ол жақсы ма жаман ба? Қандай сезімде болғаныңызды детально жазып шығыңыз. Көп ойланбаңыз. Ойыңызға 1-ші келген ойды жазыңыз. Ақшаның сіздің миыңыздағы образын анықтаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Егер миыңыздағы ақшаның образы негативті болса, онда ақша образы позитивті болғанша осы жаттығуды орындап, жұмыс жасауыңыз қажет. Есіңізде болсын, мидағы установка бірден шешіле салмайды. Онымен үздіксіз жұмыс жасап отыру қажет.</span></p>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Күнделікті садақа беріп, нәпсіңізді сындырып, беруге миыңызды үйретіңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Көзіңізге, миыңызға иманы мен байлығын қатар алып жүрген адамдарды көп көрсетуге тырысыңыз. Өмірде таныс болмасаңыздар да, инстаграм парақшаларын қарауға болады. Миыңыз иманы мен байлығын қатар алып жүрген адамдарды көп көрсе, сіздегі ақша образы өзгеретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,1192,1,NULL,0,'2021-12-20 12:47:56','2022-01-16 17:46:27'),(581,173,88,'Бай-кедей философиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Неге мыңдаған, тіпті миллиондаған адамдар таңертең ерте тұрып, жұмысқа барады, күні бойы терлеп жұмыс істейді, бірақ біреуі бай, біреуі кедей болады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мүмкін осы сұрақтың жауабы бай мен кедейдің арасындағы айырмашылықтарда шығар...</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/659034736\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кедей психологиясындағы әдеттерден өзіңізді тыйыңыз. Өзіңізді кез-келген жерде миллиардер секілді ұстауды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Жауапкершілікті 100% өзіңізге алуды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Адамнан дәмеленуді тоқтатыңыз. Не нәрсе дәметсеңіз де, не нәрсе сұрасаңыз да Алладан сұраңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&laquo;Аллахым, мені өзіңнен басқа ешкімге мұқтаж етпе. Шайтанның, нәпсінің, сен разы болмайтын нашар ойлардың зиянынан мені сақта. Жүрегімді өзіңі ғана байла. Тәуекелім тек саған ғана болсын&raquo;, &laquo;Мені байытқан сайын, иманымды да байыт. Дүниені менің жүрегіме салма, қолыма бер&raquo;, деген дұғаларды үнемі қайталап жүруді әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тұрып жатқан қалаңыздағы ең қымбат дүкендерге кіріп көріңіз. Ең қымбат киімдерді киіп көріңіз.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,698,1,NULL,0,'2021-12-20 18:01:57','2022-01-17 04:52:28'),(583,173,88,'\"Квантты скачок\" теоремасы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақшадағы квантты скачок деген &ndash; сіздің бір материалдық жағдайдан екінші материалдық жағдайға ауысуыңыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659906586\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сабақтың конспектісін PDF форматта жоғарыдан көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">сенімді өзгерту үшін күніне кем дегенде 3 шүкіршілік айтуды әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Дәл қазір өзіңіздің Дэвид Хокинстің эмоция шкаласындағы қандай энергетикалық деңгейде тұрғаныңызды анықтаңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мидағы сенімді өзгертеміз:</span><br /><span style=\"color: #ffffff;\">- Мен баймын. Байлық маған оңай келеді.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықтың иесі.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықты беруші. Маған да оңай береді.</span></li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,977,1,NULL,0,'2021-12-20 18:03:19','2022-01-16 17:35:53'),(585,173,88,'Ақшаны көбейту жолдары','<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/661591016\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Келесі сұрақтарға жауап беру:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазіргі табысыңызды 3 есесге көбейтіңіз. Қазіргі кезге қарағанда 3 есе көп табыс табатын СІЗ - өз өміріңіздің геройысыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;1.&nbsp; &nbsp;&nbsp;Сіздің герой қайда тұрады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;Оның табысы қандай? (доход)</span><br /><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;Ол қалай көрінеді? Қандай брендтегі киімдерді киеді? Шашының түсі қандай, салмағы мен бойының ұзындығы қандай?</span><br /><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp;Оның құндылықтары қандай? Өмірлік ұстанымы қандай?</span><br /><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp;Ол біреумен жақын қарым қатынаста ма? Егес ия болса, оның серіктесі қандай?</span><br /><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp;Өзін басқа ортада қалай ұстайды?</span><br /><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp;Ол нені қалайды? Дәл қазір оның ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;Оның ортасы қандай? Қандай адамдармен араласады?</span><br /><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;Демалыс күнін қалай өткізеді?</span><br /><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;Оның хоббиі қандай?</span><br /><span style=\"color: #ffffff;\">11.&nbsp;&nbsp;&nbsp;&nbsp;Ата-анасымен қарым-қатынасы қандай? Ата-анасына қалай қарайды?</span><br /><span style=\"color: #ffffff;\">12.&nbsp;&nbsp;&nbsp;&nbsp;Оның мақсаты қандай? Өмірлік миссиясы?</span><br /><span style=\"color: #ffffff;\">13.&nbsp;&nbsp;&nbsp;&nbsp;Оның басқаларға көрсететін әсері қандай? Кімдерге сөзін өткізе алады? Оның артынан қанша адам ере алады? Ол адамдар қандай?</span><br /><span style=\"color: #ffffff;\">14.&nbsp;&nbsp;&nbsp;&nbsp;Оның мұқтаждықтары қандай?</span><br /><span style=\"color: #ffffff;\">15.&nbsp;&nbsp;&nbsp;&nbsp;Оның денесі қандай? Спортпен профессионалды түрде айналыса алады ма?</span><br /><span style=\"color: #ffffff;\">16.&nbsp;&nbsp;&nbsp;&nbsp;Ол оқиды ма? Қандай оқуды оқыды немесе оқып жатыр? кітап оқиды ма? Қандай кітаптарды оқиды?</span><br /><span style=\"color: #ffffff;\">17.&nbsp;&nbsp;&nbsp;&nbsp;Қандай тамақтарды жақсы көреді? Күнделікті қай жерден және қандай тағамдармен тамақтанады?</span><br /><span style=\"color: #ffffff;\">18.&nbsp;&nbsp;&nbsp;&nbsp;Үй қызметшісі бар ма сіздің геройда? Күнделікті қолданатын қажеттіліктерін кім дайындап береді?</span><br /><span style=\"color: #ffffff;\">19.&nbsp;&nbsp;&nbsp;&nbsp;Оның өміріндегі ең сәтті ісі қандай? Ең есінде қалған оқиғасы қандай?</span><br /><span style=\"color: #ffffff;\">20.&nbsp;&nbsp;&nbsp;&nbsp;Ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">21.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде істеген ең мейірімді ісі қандай?</span><br /><span style=\"color: #ffffff;\">22.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде не нәрсеге ең қатты өкінеді?</span><br /><span style=\"color: #ffffff;\">23.&nbsp;&nbsp;&nbsp;&nbsp;Не нәрсеге шешім қабылдай алмай жүр?</span><br /><span style=\"color: #ffffff;\">24.&nbsp;&nbsp;&nbsp;&nbsp;Бақытты болуы үшін оған не керек?</span></p>','',NULL,NULL,NULL,NULL,956,1,NULL,0,'2021-12-20 18:10:51','2022-01-17 06:04:09'),(587,172,80,'Кіріспе сабақ','<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәлем, \"FOCUS\" курсының студенті ???</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">\"FOCUS\"&nbsp; курсының \"ЭКСПЕРТ\" пакетінде сіз өз қызметіңізді сапалы презентациялап, шығынсыз сатуды және VIP клиенттерге ұсынуды үйренесіз.</span><br /><span style=\"color: #ffffff;\">Сізде барлық сабаққа 3 ай доступ болады ✅</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Курс бағдарламасы:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">I МОДУЛЬ: Ақшаға дайындық</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">II МОДУЛЬ: Распаковка личности</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">III&nbsp;МОДУЛЬ: Стратегия</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">IV&nbsp;МОДУЛЬ:&nbsp;Анализ ЦА</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">V&nbsp;МОДУЛЬ: Қызмет упаковкасы</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VI&nbsp;МОДУЛЬ: Клиентпен жұмыс</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VII&nbsp;МОДУЛЬ: Қызмет прогреві</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VIII&nbsp;МОДУЛЬ: Продажа</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Өміріңізді жаңа этапқа ауыстыратын білім болсын!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәттілік, миллионер!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">?Курсқа қатысу шарттары:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Чатта негатив хабарлама жазуға болмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторға артық әңгіме айту мен жеке шекарасынан асуға рұқсат жоқ;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Курс ақысы кері қайтарылмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">✅ Әр бір сабақты оқып, тапсырмаларды кураторға уақытылы жіберу керек;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторларға 2 рет тапсырманы кешіктірсеңіз, сұрағына жауап бермесеңіз, нәтижеңізді өз жауапкершілігімізге алмаймыз. Оған қоса общий группадан шығарыласыз және алдағы уақытта куратордың және наставник, трекердің қызметі көрсетілмейді!!! Алайда сабаққа доступ болады. Дальше сабақты жеке өзіңіз оқисыз. Сізге де бізге де нәтиже шығарғаныңыз керек!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сабақтардың авторлық құқығы сақталған!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізге берген логин мен құпия сөзді басқа адаммен бөлісуге болмайды.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Бөліскен жағдайда курсқа доступ жабылады, акаунтыңыз блокқа түседі.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658889534\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,NULL,NULL,NULL,170,1,NULL,0,'2021-12-20 18:17:05','2022-01-15 06:49:01'),(588,172,80,'Үлкен ақшаға ниетттену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастамас алдын сіздің бірінші ниетіңіз дұрыс болуы қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сіз курсқа \"табысымды еслеймін, материалдық жағдайымды жақсартамын\"- деп келдіңіз. Ол үшін сіздің ақшаға деген ниетіңіз, көзқарасыңыз дұрыс болуы керек. Осы тақырыпты өз ісінің маманы, 15 жылдық тәжірибесі бар ислам шеңберіндегі психолог - Балқия Балтабай ханым түсіндіріп айтатын болады.&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658750536\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"> <iframe src=\"https://player.vimeo.com/video/658913998\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe> </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Курсты бастаған кезде ниетіңізді дұрыстаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниетті анықтауға арналған сұрақтарға жауап беріңіз:</span></p>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Бұл не үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім қалап тұр?</span></li>\r\n<li><span style=\"color: #ffffff;\">Не аламын?</span></li>\r\n</ul>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастар алдында, соған қоса курсты бастар алдын Алла разылығы үшін, ісіңіздің берекелі болуы үшін садақа беріңіз. Міндетті түрде көп ақша болуы міндетті емес. Жағдайыңыз келгенше берсеңіз болады.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазір сіз А точкаңызда тұрсыз. Курсты барысында, курсты аяқтағандағы Б точкаңыздың қандай екенін көз алдыңызға елестетіп, детально қағазға жазып шығыңыз. Курсты аяғына дейін жеткізе алмаймын деп, шаршаған кездерде осы жазғаныңыз сізге мотивация беретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,314,1,NULL,0,'2021-12-20 18:17:25','2022-01-15 06:49:05'),(590,172,80,'Ақша психологиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақша психологиясы&nbsp;байлықтың маңызды аспектісі, өйткені ақша &ndash; бұл энергия, оның келуін үнемі сезініп, оң көзқараспен қарау өте маңызды. Егер миыңызда ақшаның образы негативті болса, сіздің ақша табуыңыз қиындайды. Сол үшін бірінші ақша образына қатысты мидағы установкалармен жұмыс жасау қажет.&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658995855\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қолыңызға ақшаны алып, тапсырманы орындаңыз. Ақшаны көз алдыңызда тұрған адам ретінде елестетіңіз. Ақша сізге қандай кейіпте елестеді? Оны көргенде өзіңізді қалай сезінудесіз? Ол қандай адам? Ол жақсы ма жаман ба? Қандай сезімде болғаныңызды детально жазып шығыңыз. Көп ойланбаңыз. Ойыңызға 1-ші келген ойды жазыңыз. Ақшаның сіздің миыңыздағы образын анықтаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Егер миыңыздағы ақшаның образы негативті болса, онда ақша образы позитивті болғанша осы жаттығуды орындап, жұмыс жасауыңыз қажет. Есіңізде болсын, мидағы установка бірден шешіле салмайды. Онымен үздіксіз жұмыс жасап отыру қажет.</span></p>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Күнделікті садақа беріп, нәпсіңізді сындырып, беруге миыңызды үйретіңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Көзіңізге, миыңызға иманы мен байлығын қатар алып жүрген адамдарды көп көрсетуге тырысыңыз. Өмірде таныс болмасаңыздар да, инстаграм парақшаларын қарауға болады. Миыңыз иманы мен байлығын қатар алып жүрген адамдарды көп көрсе, сіздегі ақша образы өзгеретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,151,1,NULL,0,'2021-12-20 18:18:33','2022-01-14 11:09:20'),(592,172,80,'Бай-кедей философиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Неге мыңдаған, тіпті миллиондаған адамдар таңертең ерте тұрып, жұмысқа барады, күні бойы терлеп жұмыс істейді, бірақ біреуі бай, біреуі кедей болады?</span></p>\r\n<p>Мүмкін осы сұрақтың жауабы бай мен кедейдің арасындағы айырмашылықтарда шығар...</p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/659034736\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кедей психологиясындағы әдеттерден өзіңізді тыйыңыз. Өзіңізді кез-келген жерде миллиардер секілді ұстауды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Жауапкершілікті 100% өзіңізге алуды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Адамнан дәмеленуді тоқтатыңыз. Не нәрсе дәметсеңіз де, не нәрсе сұрасаңыз да Алладан сұраңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&laquo;Аллахым, мені өзіңнен басқа ешкімге мұқтаж етпе. Шайтанның, нәпсінің, сен разы болмайтын нашар ойлардың зиянынан мені сақта. Жүрегімді өзіңі ғана байла. Тәуекелім тек саған ғана болсын&raquo;, &laquo;Мені байытқан сайын, иманымды да байыт. Дүниені менің жүрегіме салма, қолыма бер&raquo;, деген дұғаларды үнемі қайталап жүруді әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тұрып жатқан қалаңыздағы ең қымбат дүкендерге кіріп көріңіз. Ең қымбат киімдерді киіп көріңіз.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,132,1,NULL,0,'2021-12-20 18:19:25','2022-01-14 05:34:41'),(594,172,80,'\"Квантты скачок\" теоремасы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақшадағы квантты скачок деген &ndash; сіздің бір материалдық жағдайдан екінші материалдық жағдайға ауысуыңыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659906586\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сабақтың конспектісін PDF форматта жоғарыдан көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">сенімді өзгерту үшін күніне кем дегенде 3 шүкіршілік айтуды әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Дәл қазір өзіңіздің Дэвид Хокинстің эмоция шкаласындағы қандай энергетикалық деңгейде тұрғаныңызды анықтаңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мидағы сенімді өзгертеміз:</span><br /><span style=\"color: #ffffff;\">- Мен баймын. Байлық маған оңай келеді.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықтың иесі.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықты беруші. Маған да оңай береді.</span></li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,181,1,NULL,0,'2021-12-20 18:20:24','2022-01-13 07:05:02'),(596,172,80,'Ақшаны көбейту жолдары','<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/661591016\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Келесі сұрақтарға жауап беру:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазіргі табысыңызды 3 есесге көбейтіңіз. Қазіргі кезге қарағанда 3 есе көп табыс табатын СІЗ - өз өміріңіздің геройысыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;1.&nbsp; &nbsp;&nbsp;Сіздің герой қайда тұрады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;Оның табысы қандай? (доход)</span><br /><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;Ол қалай көрінеді? Қандай брендтегі киімдерді киеді? Шашының түсі қандай, салмағы мен бойының ұзындығы қандай?</span><br /><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp;Оның құндылықтары қандай? Өмірлік ұстанымы қандай?</span><br /><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp;Ол біреумен жақын қарым қатынаста ма? Егес ия болса, оның серіктесі қандай?</span><br /><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp;Өзін басқа ортада қалай ұстайды?</span><br /><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp;Ол нені қалайды? Дәл қазір оның ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;Оның ортасы қандай? Қандай адамдармен араласады?</span><br /><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;Демалыс күнін қалай өткізеді?</span><br /><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;Оның хоббиі қандай?</span><br /><span style=\"color: #ffffff;\">11.&nbsp;&nbsp;&nbsp;&nbsp;Ата-анасымен қарым-қатынасы қандай? Ата-анасына қалай қарайды?</span><br /><span style=\"color: #ffffff;\">12.&nbsp;&nbsp;&nbsp;&nbsp;Оның мақсаты қандай? Өмірлік миссиясы?</span><br /><span style=\"color: #ffffff;\">13.&nbsp;&nbsp;&nbsp;&nbsp;Оның басқаларға көрсететін әсері қандай? Кімдерге сөзін өткізе алады? Оның артынан қанша адам ере алады? Ол адамдар қандай?</span><br /><span style=\"color: #ffffff;\">14.&nbsp;&nbsp;&nbsp;&nbsp;Оның мұқтаждықтары қандай?</span><br /><span style=\"color: #ffffff;\">15.&nbsp;&nbsp;&nbsp;&nbsp;Оның денесі қандай? Спортпен профессионалды түрде айналыса алады ма?</span><br /><span style=\"color: #ffffff;\">16.&nbsp;&nbsp;&nbsp;&nbsp;Ол оқиды ма? Қандай оқуды оқыды немесе оқып жатыр? кітап оқиды ма? Қандай кітаптарды оқиды?</span><br /><span style=\"color: #ffffff;\">17.&nbsp;&nbsp;&nbsp;&nbsp;Қандай тамақтарды жақсы көреді? Күнделікті қай жерден және қандай тағамдармен тамақтанады?</span><br /><span style=\"color: #ffffff;\">18.&nbsp;&nbsp;&nbsp;&nbsp;Үй қызметшісі бар ма сіздің геройда? Күнделікті қолданатын қажеттіліктерін кім дайындап береді?</span><br /><span style=\"color: #ffffff;\">19.&nbsp;&nbsp;&nbsp;&nbsp;Оның өміріндегі ең сәтті ісі қандай? Ең есінде қалған оқиғасы қандай?</span><br /><span style=\"color: #ffffff;\">20.&nbsp;&nbsp;&nbsp;&nbsp;Ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">21.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде істеген ең мейірімді ісі қандай?</span><br /><span style=\"color: #ffffff;\">22.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде не нәрсеге ең қатты өкінеді?</span><br /><span style=\"color: #ffffff;\">23.&nbsp;&nbsp;&nbsp;&nbsp;Не нәрсеге шешім қабылдай алмай жүр?</span><br /><span style=\"color: #ffffff;\">24.&nbsp;&nbsp;&nbsp;&nbsp;Бақытты болуы үшін оған не керек?</span></p>','',NULL,NULL,NULL,NULL,104,1,NULL,0,'2021-12-20 18:22:24','2022-01-14 05:34:44'),(598,171,71,'Кіріспе сабақ','<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәлем, \"FOCUS\" курсының студенті ???</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">\"FOCUS\"&nbsp; курсының \"ЖАҢА НИША.&nbsp;ВИЗУАЛ МАСТЕР\" пакетінде&nbsp;сіз нарықтағы ең сұранысқа ие мамандықты игеріп, сол бойынша өзіңіздің қызметіңізді шығынсыз сатуды үйренесіз.</span><br /><span style=\"color: #ffffff;\">Сізде барлық сабаққа 6 ай доступ болады ✅</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Курс бағдарламасы:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">I МОДУЛЬ: Ақшаға дайындық</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">II МОДУЛЬ: Стилистика. Визуал</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">III&nbsp;МОДУЛЬ: Стратегия</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">IV&nbsp;МОДУЛЬ: Анализ ЦА</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">V&nbsp;МОДУЛЬ: Распаковка личности. Упаковка</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VI&nbsp;МОДУЛЬ: Клиентпен жұмыс</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VII&nbsp;МОДУЛЬ: Қызмет прогреві</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VIII&nbsp;МОДУЛЬ: Продажа</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Өміріңізді жаңа этапқа ауыстыратын білім болсын!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәттілік, миллионер!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">?Курсқа қатысу шарттары:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Чатта негатив хабарлама жазуға болмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторға артық әңгіме айту мен жеке шекарасынан асуға рұқсат жоқ;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Курс ақысы кері қайтарылмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">✅ Әр бір сабақты оқып, тапсырмаларды кураторға уақытылы жіберу керек;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторларға 2 рет тапсырманы кешіктірсеңіз, сұрағына жауап бермесеңіз, нәтижеңізді өз жауапкершілігімізге алмаймыз. Оған қоса общий группадан шығарыласыз және алдағы уақытта куратордың және наставник, трекердің қызметі көрсетілмейді!!! Алайда сабаққа доступ болады. Дальше сабақты жеке өзіңіз оқисыз. Сізге де бізге де нәтиже шығарғаныңыз керек!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сабақтардың авторлық құқығы сақталған!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізге берген логин мен құпия сөзді басқа адаммен бөлісуге болмайды.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Бөліскен жағдайда курсқа доступ жабылады, акаунтыңыз блокқа түседі.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658889534\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,NULL,NULL,NULL,100,1,NULL,0,'2021-12-20 18:24:10','2022-01-16 15:20:17'),(599,171,71,'Үлкен ақшаға ниеттену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастамас алдын сіздің бірінші ниетіңіз дұрыс болуы қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сіз курсқа \"табысымды еслеймін, материалдық жағдайымды жақсартамын\"- деп келдіңіз. Ол үшін сіздің ақшаға деген ниетіңіз, көзқарасыңыз дұрыс болуы керек. Осы тақырыпты өз ісінің маманы, 15 жылдық тәжірибесі бар ислам шеңберіндегі психолог - Балқия Балтабай ханым түсіндіріп айтатын болады.&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658750536\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658913998\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Курсты бастаған кезде ниетіңізді дұрыстаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниетті анықтауға арналған сұрақтарға жауап беріңіз:</span></p>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Бұл не үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім қалап тұр?</span></li>\r\n<li><span style=\"color: #ffffff;\">Не аламын?</span></li>\r\n</ul>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастар алдында, соған қоса курсты бастар алдын Алла разылығы үшін, ісіңіздің берекелі болуы үшін садақа беріңіз. Міндетті түрде көп ақша болуы міндетті емес. Жағдайыңыз келгенше берсеңіз болады.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазір сіз А точкаңызда тұрсыз. Курсты барысында, курсты аяқтағандағы Б точкаңыздың қандай екенін көз алдыңызға елестетіп, детально қағазға жазып шығыңыз. Курсты аяғына дейін жеткізе алмаймын деп, шаршаған кездерде осы жазғаныңыз сізге мотивация беретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,192,1,NULL,0,'2021-12-20 18:24:20','2022-01-13 11:32:57'),(601,171,71,'Ақша психологиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақша психологиясы&nbsp;байлықтың маңызды аспектісі, өйткені ақша &ndash; бұл энергия, оның келуін үнемі сезініп, оң көзқараспен қарау өте маңызды. Егер миыңызда ақшаның образы негативті болса, сіздің ақша табуыңыз қиындайды. Сол үшін бірінші ақша образына қатысты мидағы установкалармен жұмыс жасау қажет. <iframe src=\"https://player.vimeo.com/video/658995855\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қолыңызға ақшаны алып, тапсырманы орындаңыз. Ақшаны көз алдыңызда тұрған адам ретінде елестетіңіз. Ақша сізге қандай кейіпте елестеді? Оны көргенде өзіңізді қалай сезінудесіз? Ол қандай адам? Ол жақсы ма жаман ба? Қандай сезімде болғаныңызды детально жазып шығыңыз. Көп ойланбаңыз. Ойыңызға 1-ші келген ойды жазыңыз. Ақшаның сіздің миыңыздағы образын анықтаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Егер миыңыздағы ақшаның образы негативті болса, онда ақша образы позитивті болғанша осы жаттығуды орындап, жұмыс жасауыңыз қажет. Есіңізде болсын, мидағы установка бірден шешіле салмайды. Онымен үздіксіз жұмыс жасап отыру қажет.</span></p>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Күнделікті садақа беріп, нәпсіңізді сындырып, беруге миыңызды үйретіңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Көзіңізге, миыңызға иманы мен байлығын қатар алып жүрген адамдарды көп көрсетуге тырысыңыз. Өмірде таныс болмасаңыздар да, инстаграм парақшаларын қарауға болады. Миыңыз иманы мен байлығын қатар алып жүрген адамдарды көп көрсе, сіздегі ақша образы өзгеретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,113,1,NULL,0,'2021-12-20 18:25:19','2022-01-13 04:49:11'),(603,171,71,'\"Бай-кедей\" философиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Неге мыңдаған, тіпті миллиондаған адамдар таңертең ерте тұрып, жұмысқа барады, күні бойы терлеп жұмыс істейді, бірақ біреуі бай, біреуі кедей болады?</span></p>\r\n<p>Мүмкін осы сұрақтың жауабы бай мен кедейдің арасындағы айырмашылықтарда шығар...</p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/659034736\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кедей психологиясындағы әдеттерден өзіңізді тыйыңыз. Өзіңізді кез-келген жерде миллиардер секілді ұстауды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Жауапкершілікті 100% өзіңізге алуды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Адамнан дәмеленуді тоқтатыңыз. Не нәрсе дәметсеңіз де, не нәрсе сұрасаңыз да Алладан сұраңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&laquo;Аллахым, мені өзіңнен басқа ешкімге мұқтаж етпе. Шайтанның, нәпсінің, сен разы болмайтын нашар ойлардың зиянынан мені сақта. Жүрегімді өзіңі ғана байла. Тәуекелім тек саған ғана болсын&raquo;, &laquo;Мені байытқан сайын, иманымды да байыт. Дүниені менің жүрегіме салма, қолыма бер&raquo;, деген дұғаларды үнемі қайталап жүруді әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тұрып жатқан қалаңыздағы ең қымбат дүкендерге кіріп көріңіз. Ең қымбат киімдерді киіп көріңіз.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,88,1,NULL,0,'2021-12-20 18:25:47','2022-01-13 04:49:14'),(605,171,71,'\"Квантты скачок\" теоремасы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақшадағы квантты скачок деген &ndash; сіздің бір материалдық жағдайдан екінші материалдық жағдайға ауысуыңыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659906586\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сабақтың конспектісін PDF форматта жоғарыдан көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">сенімді өзгерту үшін күніне кем дегенде 3 шүкіршілік айтуды әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Дәл қазір өзіңіздің Дэвид Хокинстің эмоция шкаласындағы қандай энергетикалық деңгейде тұрғаныңызды анықтаңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мидағы сенімді өзгертеміз:</span><br /><span style=\"color: #ffffff;\">- Мен баймын. Байлық маған оңай келеді.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықтың иесі.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықты беруші. Маған да оңай береді.</span></li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,122,1,NULL,0,'2021-12-20 18:26:15','2022-01-13 04:49:28'),(607,171,71,'Ақшаны көбейту жолдары','<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/661591016\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Келесі сұрақтарға жауап беру:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазіргі табысыңызды 3 есесге көбейтіңіз. Қазіргі кезге қарағанда 3 есе көп табыс табатын СІЗ - өз өміріңіздің геройысыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;1.&nbsp; &nbsp;&nbsp;Сіздің герой қайда тұрады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;Оның табысы қандай? (доход)</span><br /><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;Ол қалай көрінеді? Қандай брендтегі киімдерді киеді? Шашының түсі қандай, салмағы мен бойының ұзындығы қандай?</span><br /><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp;Оның құндылықтары қандай? Өмірлік ұстанымы қандай?</span><br /><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp;Ол біреумен жақын қарым қатынаста ма? Егес ия болса, оның серіктесі қандай?</span><br /><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp;Өзін басқа ортада қалай ұстайды?</span><br /><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp;Ол нені қалайды? Дәл қазір оның ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;Оның ортасы қандай? Қандай адамдармен араласады?</span><br /><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;Демалыс күнін қалай өткізеді?</span><br /><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;Оның хоббиі қандай?</span><br /><span style=\"color: #ffffff;\">11.&nbsp;&nbsp;&nbsp;&nbsp;Ата-анасымен қарым-қатынасы қандай? Ата-анасына қалай қарайды?</span><br /><span style=\"color: #ffffff;\">12.&nbsp;&nbsp;&nbsp;&nbsp;Оның мақсаты қандай? Өмірлік миссиясы?</span><br /><span style=\"color: #ffffff;\">13.&nbsp;&nbsp;&nbsp;&nbsp;Оның басқаларға көрсететін әсері қандай? Кімдерге сөзін өткізе алады? Оның артынан қанша адам ере алады? Ол адамдар қандай?</span><br /><span style=\"color: #ffffff;\">14.&nbsp;&nbsp;&nbsp;&nbsp;Оның мұқтаждықтары қандай?</span><br /><span style=\"color: #ffffff;\">15.&nbsp;&nbsp;&nbsp;&nbsp;Оның денесі қандай? Спортпен профессионалды түрде айналыса алады ма?</span><br /><span style=\"color: #ffffff;\">16.&nbsp;&nbsp;&nbsp;&nbsp;Ол оқиды ма? Қандай оқуды оқыды немесе оқып жатыр? кітап оқиды ма? Қандай кітаптарды оқиды?</span><br /><span style=\"color: #ffffff;\">17.&nbsp;&nbsp;&nbsp;&nbsp;Қандай тамақтарды жақсы көреді? Күнделікті қай жерден және қандай тағамдармен тамақтанады?</span><br /><span style=\"color: #ffffff;\">18.&nbsp;&nbsp;&nbsp;&nbsp;Үй қызметшісі бар ма сіздің геройда? Күнделікті қолданатын қажеттіліктерін кім дайындап береді?</span><br /><span style=\"color: #ffffff;\">19.&nbsp;&nbsp;&nbsp;&nbsp;Оның өміріндегі ең сәтті ісі қандай? Ең есінде қалған оқиғасы қандай?</span><br /><span style=\"color: #ffffff;\">20.&nbsp;&nbsp;&nbsp;&nbsp;Ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">21.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде істеген ең мейірімді ісі қандай?</span><br /><span style=\"color: #ffffff;\">22.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде не нәрсеге ең қатты өкінеді?</span><br /><span style=\"color: #ffffff;\">23.&nbsp;&nbsp;&nbsp;&nbsp;Не нәрсеге шешім қабылдай алмай жүр?</span><br /><span style=\"color: #ffffff;\">24.&nbsp;&nbsp;&nbsp;&nbsp;Бақытты болуы үшін оған не керек?</span></p>','',NULL,NULL,NULL,NULL,122,1,NULL,0,'2021-12-20 18:27:11','2022-01-12 14:47:34'),(609,170,62,'Кіріспе сабақ','<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәлем, \"FOCUS\" курсының студенті ???</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">\"FOCUS\"&nbsp; курсының \"ЖАҢА НИША. ПРОГРЕВ-КОНТЕНТ МАСТЕР\" пакетінде&nbsp;сіз нарықтағы ең сұранысқа ие мамандықты игеріп, сол бойынша өзіңіздің қызметіңізді шығынсыз сатуды үйренесіз.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізде барлық сабаққа 3 ай доступ болады ✅</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Курс бағдарламасы:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">I МОДУЛЬ: Ақшаға дайындық</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">II МОДУЛЬ:&nbsp;Прогрев-Контент мастер мамандығын игеру</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">III&nbsp;МОДУЛЬ: Стратегия</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">IV&nbsp;МОДУЛЬ: Анализ ЦА</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">V&nbsp;МОДУЛЬ: Распаковка личности. Упаковка</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VI&nbsp;МОДУЛЬ: Клиентпен жұмыс</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VII&nbsp;МОДУЛЬ: Қызмет прогреві</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VIII&nbsp;МОДУЛЬ: Продажа</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Өміріңізді жаңа этапқа ауыстыратын білім болсын!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәттілік, миллионер!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">?Курсқа қатысу шарттары:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Чатта негатив хабарлама жазуға болмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторға артық әңгіме айту мен жеке шекарасынан асуға рұқсат жоқ;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Курс ақысы кері қайтарылмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">✅ Әр бір сабақты оқып, тапсырмаларды кураторға уақытылы жіберу керек;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторларға 2 рет тапсырманы кешіктірсеңіз, сұрағына жауап бермесеңіз, нәтижеңізді өз жауапкершілігімізге алмаймыз. Оған қоса общий группадан шығарыласыз және алдағы уақытта куратордың және наставник, трекердің қызметі көрсетілмейді!!! Алайда сабаққа доступ болады. Дальше сабақты жеке өзіңіз оқисыз. Сізге де бізге де нәтиже шығарғаныңыз керек!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сабақтардың авторлық құқығы сақталған!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізге берген логин мен құпия сөзді басқа адаммен бөлісуге болмайды.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Бөліскен жағдайда курсқа доступ жабылады, акаунтыңыз блокқа түседі.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658889534\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,NULL,NULL,NULL,246,1,NULL,0,'2021-12-20 18:30:23','2022-01-14 12:37:14'),(610,170,62,'Үлкен ақшаға ниеттену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастамас алдын сіздің бірінші ниетіңіз дұрыс болуы қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сіз курсқа \"табысымды еслеймін, материалдық жағдайымды жақсартамын\"- деп келдіңіз. Ол үшін сіздің ақшаға деген ниетіңіз, көзқарасыңыз дұрыс болуы керек. Осы тақырыпты өз ісінің маманы, 15 жылдық тәжірибесі бар ислам шеңберіндегі психолог - Балқия Балтабай ханым түсіндіріп айтатын болады.&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658750536\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658913998\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Курсты бастаған кезде ниетіңізді дұрыстаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниетті анықтауға арналған сұрақтарға жауап беріңіз:</span></p>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Бұл не үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім қалап тұр?</span></li>\r\n<li><span style=\"color: #ffffff;\">Не аламын?</span></li>\r\n</ul>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастар алдында, соған қоса курсты бастар алдын Алла разылығы үшін, ісіңіздің берекелі болуы үшін садақа беріңіз. Міндетті түрде көп ақша болуы міндетті емес. Жағдайыңыз келгенше берсеңіз болады.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазір сіз А точкаңызда тұрсыз. Курсты барысында, курсты аяқтағандағы Б точкаңыздың қандай екенін көз алдыңызға елестетіп, детально қағазға жазып шығыңыз. Курсты аяғына дейін жеткізе алмаймын деп, шаршаған кездерде осы жазғаныңыз сізге мотивация беретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,653,1,NULL,0,'2021-12-20 18:30:35','2022-01-14 16:20:34'),(612,170,62,'Ақша психологиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақша психологиясы&nbsp;байлықтың маңызды аспектісі, өйткені ақша &ndash; бұл энергия, оның келуін үнемі сезініп, оң көзқараспен қарау өте маңызды. Егер миыңызда ақшаның образы негативті болса, сіздің ақша табуыңыз қиындайды. Сол үшін бірінші ақша образына қатысты мидағы установкалармен жұмыс жасау қажет. <iframe src=\"https://player.vimeo.com/video/658995855\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қолыңызға ақшаны алып, тапсырманы орындаңыз. Ақшаны көз алдыңызда тұрған адам ретінде елестетіңіз. Ақша сізге қандай кейіпте елестеді? Оны көргенде өзіңізді қалай сезінудесіз? Ол қандай адам? Ол жақсы ма жаман ба? Қандай сезімде болғаныңызды детально жазып шығыңыз. Көп ойланбаңыз. Ойыңызға 1-ші келген ойды жазыңыз. Ақшаның сіздің миыңыздағы образын анықтаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Егер миыңыздағы ақшаның образы негативті болса, онда ақша образы позитивті болғанша осы жаттығуды орындап, жұмыс жасауыңыз қажет. Есіңізде болсын, мидағы установка бірден шешіле салмайды. Онымен үздіксіз жұмыс жасап отыру қажет.</span></p>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Күнделікті садақа беріп, нәпсіңізді сындырып, беруге миыңызды үйретіңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Көзіңізге, миыңызға иманы мен байлығын қатар алып жүрген адамдарды көп көрсетуге тырысыңыз. Өмірде таныс болмасаңыздар да, инстаграм парақшаларын қарауға болады. Миыңыз иманы мен байлығын қатар алып жүрген адамдарды көп көрсе, сіздегі ақша образы өзгеретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,348,1,NULL,0,'2021-12-20 18:32:03','2022-01-16 13:52:14'),(614,170,62,'\"Бай-кедей\" философиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Неге мыңдаған, тіпті миллиондаған адамдар таңертең ерте тұрып, жұмысқа барады, күні бойы терлеп жұмыс істейді, бірақ біреуі бай, біреуі кедей болады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мүмкін осы сұрақтың жауабы бай мен кедейдің арасындағы айырмашылықтарда шығар...</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/659034736\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кедей психологиясындағы әдеттерден өзіңізді тыйыңыз. Өзіңізді кез-келген жерде миллиардер секілді ұстауды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Жауапкершілікті 100% өзіңізге алуды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Адамнан дәмеленуді тоқтатыңыз. Не нәрсе дәметсеңіз де, не нәрсе сұрасаңыз да Алладан сұраңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&laquo;Аллахым, мені өзіңнен басқа ешкімге мұқтаж етпе. Шайтанның, нәпсінің, сен разы болмайтын нашар ойлардың зиянынан мені сақта. Жүрегімді өзіңі ғана байла. Тәуекелім тек саған ғана болсын&raquo;, &laquo;Мені байытқан сайын, иманымды да байыт. Дүниені менің жүрегіме салма, қолыма бер&raquo;, деген дұғаларды үнемі қайталап жүруді әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тұрып жатқан қалаңыздағы ең қымбат дүкендерге кіріп көріңіз. Ең қымбат киімдерді киіп көріңіз.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,258,1,NULL,0,'2021-12-20 18:35:20','2022-01-14 09:28:09'),(616,170,62,'\"Квантты скачок\" теоремасы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақшадағы квантты скачок деген &ndash; сіздің бір материалдық жағдайдан екінші материалдық жағдайға ауысуыңыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659906586\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сабақтың конспектісін PDF форматта жоғарыдан көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">сенімді өзгерту үшін күніне кем дегенде 3 шүкіршілік айтуды әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Дәл қазір өзіңіздің Дэвид Хокинстің эмоция шкаласындағы қандай энергетикалық деңгейде тұрғаныңызды анықтаңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мидағы сенімді өзгертеміз:</span><br /><span style=\"color: #ffffff;\">- Мен баймын. Байлық маған оңай келеді.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықтың иесі.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықты беруші. Маған да оңай береді.</span></li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,439,1,NULL,0,'2021-12-20 18:36:11','2022-01-12 09:01:09'),(618,170,62,'Ақшаны көбейту жолдары','<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/661591016\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Келесі сұрақтарға жауап беру:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазіргі табысыңызды 3 есесге көбейтіңіз. Қазіргі кезге қарағанда 3 есе көп табыс табатын СІЗ - өз өміріңіздің геройысыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;1.&nbsp; &nbsp;&nbsp;Сіздің герой қайда тұрады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;Оның табысы қандай? (доход)</span><br /><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;Ол қалай көрінеді? Қандай брендтегі киімдерді киеді? Шашының түсі қандай, салмағы мен бойының ұзындығы қандай?</span><br /><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp;Оның құндылықтары қандай? Өмірлік ұстанымы қандай?</span><br /><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp;Ол біреумен жақын қарым қатынаста ма? Егес ия болса, оның серіктесі қандай?</span><br /><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp;Өзін басқа ортада қалай ұстайды?</span><br /><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp;Ол нені қалайды? Дәл қазір оның ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;Оның ортасы қандай? Қандай адамдармен араласады?</span><br /><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;Демалыс күнін қалай өткізеді?</span><br /><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;Оның хоббиі қандай?</span><br /><span style=\"color: #ffffff;\">11.&nbsp;&nbsp;&nbsp;&nbsp;Ата-анасымен қарым-қатынасы қандай? Ата-анасына қалай қарайды?</span><br /><span style=\"color: #ffffff;\">12.&nbsp;&nbsp;&nbsp;&nbsp;Оның мақсаты қандай? Өмірлік миссиясы?</span><br /><span style=\"color: #ffffff;\">13.&nbsp;&nbsp;&nbsp;&nbsp;Оның басқаларға көрсететін әсері қандай? Кімдерге сөзін өткізе алады? Оның артынан қанша адам ере алады? Ол адамдар қандай?</span><br /><span style=\"color: #ffffff;\">14.&nbsp;&nbsp;&nbsp;&nbsp;Оның мұқтаждықтары қандай?</span><br /><span style=\"color: #ffffff;\">15.&nbsp;&nbsp;&nbsp;&nbsp;Оның денесі қандай? Спортпен профессионалды түрде айналыса алады ма?</span><br /><span style=\"color: #ffffff;\">16.&nbsp;&nbsp;&nbsp;&nbsp;Ол оқиды ма? Қандай оқуды оқыды немесе оқып жатыр? кітап оқиды ма? Қандай кітаптарды оқиды?</span><br /><span style=\"color: #ffffff;\">17.&nbsp;&nbsp;&nbsp;&nbsp;Қандай тамақтарды жақсы көреді? Күнделікті қай жерден және қандай тағамдармен тамақтанады?</span><br /><span style=\"color: #ffffff;\">18.&nbsp;&nbsp;&nbsp;&nbsp;Үй қызметшісі бар ма сіздің геройда? Күнделікті қолданатын қажеттіліктерін кім дайындап береді?</span><br /><span style=\"color: #ffffff;\">19.&nbsp;&nbsp;&nbsp;&nbsp;Оның өміріндегі ең сәтті ісі қандай? Ең есінде қалған оқиғасы қандай?</span><br /><span style=\"color: #ffffff;\">20.&nbsp;&nbsp;&nbsp;&nbsp;Ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">21.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде істеген ең мейірімді ісі қандай?</span><br /><span style=\"color: #ffffff;\">22.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде не нәрсеге ең қатты өкінеді?</span><br /><span style=\"color: #ffffff;\">23.&nbsp;&nbsp;&nbsp;&nbsp;Не нәрсеге шешім қабылдай алмай жүр?</span><br /><span style=\"color: #ffffff;\">24.&nbsp;&nbsp;&nbsp;&nbsp;Бақытты болуы үшін оған не керек?</span></p>','',NULL,NULL,NULL,NULL,440,1,NULL,0,'2021-12-20 18:37:12','2022-01-16 13:52:33'),(620,169,53,'Кіріспе сабақ','<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәлем, \"FOCUS\" курсының студенті ???</span><br /><span style=\"color: #ffffff;\">\"FOCUS\"&nbsp; курсының \"ЖАҢА НИША. DIRECT МАСТЕР\" пакетінде&nbsp;сіз нарықтағы ең сұранысқа ие мамандықты игеріп, сол бойынша өзіңіздің қызметіңізді шығынсыз сатуды үйренесіз.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізде барлық сабаққа&nbsp;3 ай доступ болады ✅</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Курс бағдарламасы:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">I МОДУЛЬ: Ақшаға дайындық</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">II МОДУЛЬ:&nbsp;DIRECT мастер мамандығын игеру</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">III&nbsp;МОДУЛЬ: Стратегия</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">IV&nbsp;МОДУЛЬ: Анализ ЦА</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">V&nbsp;МОДУЛЬ: Распаковка личности. Упаковка</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VI&nbsp;МОДУЛЬ: Клиентпен жұмыс</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VII&nbsp;МОДУЛЬ: Қызмет прогреві</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VIII&nbsp;МОДУЛЬ: Продажа</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Өміріңізді жаңа этапқа ауыстыратын білім болсын!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәттілік, миллионер!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">?Курсқа қатысу шарттары:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Чатта негатив хабарлама жазуға болмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторға артық әңгіме айту мен жеке шекарасынан асуға рұқсат жоқ;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Курс ақысы кері қайтарылмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">✅ Әр бір сабақты оқып, тапсырмаларды кураторға уақытылы жіберу керек;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторларға 2 рет тапсырманы кешіктірсеңіз, сұрағына жауап бермесеңіз, нәтижеңізді өз жауапкершілігімізге алмаймыз. Оған қоса общий группадан шығарыласыз және алдағы уақытта куратордың және наставник, трекердің қызметі көрсетілмейді!!! Алайда сабаққа доступ болады. Дальше сабақты жеке өзіңіз оқисыз. Сізге де бізге де нәтиже шығарғаныңыз керек!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сабақтардың авторлық құқығы сақталған!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізге берген логин мен құпия сөзді басқа адаммен бөлісуге болмайды.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Бөліскен жағдайда курсқа доступ жабылады, акаунтыңыз блокқа түседі.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658889534\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,NULL,NULL,NULL,51,1,NULL,0,'2021-12-20 18:38:17','2022-01-10 15:21:48'),(621,169,53,'Үлкен ақшаға ниеттену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастамас алдын сіздің бірінші ниетіңіз дұрыс болуы қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сіз курсқа \"табысымды еслеймін, материалдық жағдайымды жақсартамын\"- деп келдіңіз. Ол үшін сіздің ақшаға деген ниетіңіз, көзқарасыңыз дұрыс болуы керек. Осы тақырыпты өз ісінің маманы, 15 жылдық тәжірибесі бар ислам шеңберіндегі психолог - Балқия Балтабай ханым түсіндіріп айтатын болады.&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658750536\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658913998\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Курсты бастаған кезде ниетіңізді дұрыстаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниетті анықтауға арналған сұрақтарға жауап беріңіз:</span></p>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Бұл не үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім қалап тұр?</span></li>\r\n<li><span style=\"color: #ffffff;\">Не аламын?</span></li>\r\n</ul>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастар алдында, соған қоса курсты бастар алдын Алла разылығы үшін, ісіңіздің берекелі болуы үшін садақа беріңіз. Міндетті түрде көп ақша болуы міндетті емес. Жағдайыңыз келгенше берсеңіз болады.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазір сіз А точкаңызда тұрсыз. Курсты барысында, курсты аяқтағандағы Б точкаңыздың қандай екенін көз алдыңызға елестетіп, детально қағазға жазып шығыңыз. Курсты аяғына дейін жеткізе алмаймын деп, шаршаған кездерде осы жазғаныңыз сізге мотивация беретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,93,1,NULL,0,'2021-12-20 18:38:26','2022-01-14 05:05:52'),(623,169,53,'Ақша психологиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақша психологиясы&nbsp;байлықтың маңызды аспектісі, өйткені ақша &ndash; бұл энергия, оның келуін үнемі сезініп, оң көзқараспен қарау өте маңызды. Егер миыңызда ақшаның образы негативті болса, сіздің ақша табуыңыз қиындайды. Сол үшін бірінші ақша образына қатысты мидағы установкалармен жұмыс жасау қажет. <iframe src=\"https://player.vimeo.com/video/658995855\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қолыңызға ақшаны алып, тапсырманы орындаңыз. Ақшаны көз алдыңызда тұрған адам ретінде елестетіңіз. Ақша сізге қандай кейіпте елестеді? Оны көргенде өзіңізді қалай сезінудесіз? Ол қандай адам? Ол жақсы ма жаман ба? Қандай сезімде болғаныңызды детально жазып шығыңыз. Көп ойланбаңыз. Ойыңызға 1-ші келген ойды жазыңыз. Ақшаның сіздің миыңыздағы образын анықтаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Егер миыңыздағы ақшаның образы негативті болса, онда ақша образы позитивті болғанша осы жаттығуды орындап, жұмыс жасауыңыз қажет. Есіңізде болсын, мидағы установка бірден шешіле салмайды. Онымен үздіксіз жұмыс жасап отыру қажет.</span></p>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Күнделікті садақа беріп, нәпсіңізді сындырып, беруге миыңызды үйретіңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Көзіңізге, миыңызға иманы мен байлығын қатар алып жүрген адамдарды көп көрсетуге тырысыңыз. Өмірде таныс болмасаңыздар да, инстаграм парақшаларын қарауға болады. Миыңыз иманы мен байлығын қатар алып жүрген адамдарды көп көрсе, сіздегі ақша образы өзгеретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,56,1,NULL,0,'2021-12-20 18:39:55','2022-01-15 05:11:11'),(625,169,53,'\"Бай-кедей\" философиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Неге мыңдаған, тіпті миллиондаған адамдар таңертең ерте тұрып, жұмысқа барады, күні бойы терлеп жұмыс істейді, бірақ біреуі бай, біреуі кедей болады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мүмкін осы сұрақтың жауабы бай мен кедейдің арасындағы айырмашылықтарда шығар...</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/659034736\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кедей психологиясындағы әдеттерден өзіңізді тыйыңыз. Өзіңізді кез-келген жерде миллиардер секілді ұстауды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Жауапкершілікті 100% өзіңізге алуды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Адамнан дәмеленуді тоқтатыңыз. Не нәрсе дәметсеңіз де, не нәрсе сұрасаңыз да Алладан сұраңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&laquo;Аллахым, мені өзіңнен басқа ешкімге мұқтаж етпе. Шайтанның, нәпсінің, сен разы болмайтын нашар ойлардың зиянынан мені сақта. Жүрегімді өзіңі ғана байла. Тәуекелім тек саған ғана болсын&raquo;, &laquo;Мені байытқан сайын, иманымды да байыт. Дүниені менің жүрегіме салма, қолыма бер&raquo;, деген дұғаларды үнемі қайталап жүруді әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тұрып жатқан қалаңыздағы ең қымбат дүкендерге кіріп көріңіз. Ең қымбат киімдерді киіп көріңіз.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,42,1,NULL,0,'2021-12-20 18:40:46','2022-01-14 05:57:11'),(627,169,53,'\"Квантты скачок\" теоремасы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақшадағы квантты скачок деген &ndash; сіздің бір материалдық жағдайдан екінші материалдық жағдайға ауысуыңыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659906586\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сабақтың конспектісін PDF форматта жоғарыдан көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">сенімді өзгерту үшін күніне кем дегенде 3 шүкіршілік айтуды әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Дәл қазір өзіңіздің Дэвид Хокинстің эмоция шкаласындағы қандай энергетикалық деңгейде тұрғаныңызды анықтаңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мидағы сенімді өзгертеміз:</span><br /><span style=\"color: #ffffff;\">- Мен баймын. Байлық маған оңай келеді.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықтың иесі.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықты беруші. Маған да оңай береді.</span></li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,79,1,NULL,0,'2021-12-20 18:42:44','2022-01-13 14:20:50'),(629,169,53,'Ақшаны көбейту жолдары','<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/661591016\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Келесі сұрақтарға жауап беру:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазіргі табысыңызды 3 есесге көбейтіңіз. Қазіргі кезге қарағанда 3 есе көп табыс табатын СІЗ - өз өміріңіздің геройысыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;1.&nbsp; &nbsp;&nbsp;Сіздің герой қайда тұрады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;Оның табысы қандай? (доход)</span><br /><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;Ол қалай көрінеді? Қандай брендтегі киімдерді киеді? Шашының түсі қандай, салмағы мен бойының ұзындығы қандай?</span><br /><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp;Оның құндылықтары қандай? Өмірлік ұстанымы қандай?</span><br /><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp;Ол біреумен жақын қарым қатынаста ма? Егес ия болса, оның серіктесі қандай?</span><br /><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp;Өзін басқа ортада қалай ұстайды?</span><br /><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp;Ол нені қалайды? Дәл қазір оның ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;Оның ортасы қандай? Қандай адамдармен араласады?</span><br /><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;Демалыс күнін қалай өткізеді?</span><br /><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;Оның хоббиі қандай?</span><br /><span style=\"color: #ffffff;\">11.&nbsp;&nbsp;&nbsp;&nbsp;Ата-анасымен қарым-қатынасы қандай? Ата-анасына қалай қарайды?</span><br /><span style=\"color: #ffffff;\">12.&nbsp;&nbsp;&nbsp;&nbsp;Оның мақсаты қандай? Өмірлік миссиясы?</span><br /><span style=\"color: #ffffff;\">13.&nbsp;&nbsp;&nbsp;&nbsp;Оның басқаларға көрсететін әсері қандай? Кімдерге сөзін өткізе алады? Оның артынан қанша адам ере алады? Ол адамдар қандай?</span><br /><span style=\"color: #ffffff;\">14.&nbsp;&nbsp;&nbsp;&nbsp;Оның мұқтаждықтары қандай?</span><br /><span style=\"color: #ffffff;\">15.&nbsp;&nbsp;&nbsp;&nbsp;Оның денесі қандай? Спортпен профессионалды түрде айналыса алады ма?</span><br /><span style=\"color: #ffffff;\">16.&nbsp;&nbsp;&nbsp;&nbsp;Ол оқиды ма? Қандай оқуды оқыды немесе оқып жатыр? кітап оқиды ма? Қандай кітаптарды оқиды?</span><br /><span style=\"color: #ffffff;\">17.&nbsp;&nbsp;&nbsp;&nbsp;Қандай тамақтарды жақсы көреді? Күнделікті қай жерден және қандай тағамдармен тамақтанады?</span><br /><span style=\"color: #ffffff;\">18.&nbsp;&nbsp;&nbsp;&nbsp;Үй қызметшісі бар ма сіздің геройда? Күнделікті қолданатын қажеттіліктерін кім дайындап береді?</span><br /><span style=\"color: #ffffff;\">19.&nbsp;&nbsp;&nbsp;&nbsp;Оның өміріндегі ең сәтті ісі қандай? Ең есінде қалған оқиғасы қандай?</span><br /><span style=\"color: #ffffff;\">20.&nbsp;&nbsp;&nbsp;&nbsp;Ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">21.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде істеген ең мейірімді ісі қандай?</span><br /><span style=\"color: #ffffff;\">22.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде не нәрсеге ең қатты өкінеді?</span><br /><span style=\"color: #ffffff;\">23.&nbsp;&nbsp;&nbsp;&nbsp;Не нәрсеге шешім қабылдай алмай жүр?</span><br /><span style=\"color: #ffffff;\">24.&nbsp;&nbsp;&nbsp;&nbsp;Бақытты болуы үшін оған не керек?</span></p>','',NULL,NULL,NULL,NULL,147,1,NULL,0,'2021-12-20 18:43:47','2022-01-13 11:03:43'),(631,168,37,'Кіріспе сабақ','<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәлем, \"FOCUS\" курсының студенті ???</span><br /><span style=\"color: #ffffff;\">\"FOCUS\"&nbsp; курсының \"ЖАҢА НИША. САТУ МАМАНЫ\" пакетінде&nbsp;сіз нарықтағы ең сұранысқа ие мамандықты игеріп, сол бойынша өзіңіздің қызметіңізді шығынсыз сатуды үйренесіз. </span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізде барлық сабаққа 3 ай доступ болады ✅</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Курс бағдарламасы:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">I МОДУЛЬ: Ақшаға дайындық</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">II МОДУЛЬ: Распаковка</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">III&nbsp;МОДУЛЬ: Стратегия</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">IV&nbsp;МОДУЛЬ: Инфопродукт</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">V&nbsp;МОДУЛЬ: Прогрев</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VI&nbsp;МОДУЛЬ: Запуск</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VII&nbsp;МОДУЛЬ: Продажа</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VIII&nbsp;МОДУЛЬ: Масштаб</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Өміріңізді жаңа этапқа ауыстыратын білім болсын!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәттілік, миллионер!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">?Курсқа қатысу шарттары:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Чатта негатив хабарлама жазуға болмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторға артық әңгіме айту мен жеке шекарасынан асуға рұқсат жоқ;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Курс ақысы кері қайтарылмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">✅ Әр бір сабақты оқып, тапсырмаларды кураторға уақытылы жіберу керек;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторларға 2 рет тапсырманы кешіктірсеңіз, сұрағына жауап бермесеңіз, нәтижеңізді өз жауапкершілігімізге алмаймыз. Оған қоса общий группадан шығарыласыз және алдағы уақытта куратордың және наставник, трекердің қызметі көрсетілмейді!!! Алайда сабаққа доступ болады. Дальше сабақты жеке өзіңіз оқисыз. Сізге де бізге де нәтиже шығарғаныңыз керек!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сабақтардың авторлық құқығы сақталған!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізге берген логин мен құпия сөзді басқа адаммен бөлісуге болмайды.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Бөліскен жағдайда курсқа доступ жабылады, акаунтыңыз блокқа түседі.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658889534\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,NULL,NULL,NULL,339,1,NULL,0,'2021-12-20 18:46:08','2022-01-15 09:25:26'),(632,168,37,'Үлкен ақшаға ниеттену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастамас алдын сіздің бірінші ниетіңіз дұрыс болуы қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сіз курсқа \"табысымды еслеймін, материалдық жағдайымды жақсартамын\"- деп келдіңіз. Ол үшін сіздің ақшаға деген ниетіңіз, көзқарасыңыз дұрыс болуы керек. Осы тақырыпты өз ісінің маманы, 15 жылдық тәжірибесі бар ислам шеңберіндегі психолог - Балқия Балтабай ханым түсіндіріп айтатын болады.&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658750536\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658913998\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Курсты бастаған кезде ниетіңізді дұрыстаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниетті анықтауға арналған сұрақтарға жауап беріңіз:</span></p>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Бұл не үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім қалап тұр?</span></li>\r\n<li><span style=\"color: #ffffff;\">Не аламын?</span></li>\r\n</ul>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастар алдында, соған қоса курсты бастар алдын Алла разылығы үшін, ісіңіздің берекелі болуы үшін садақа беріңіз. Міндетті түрде көп ақша болуы міндетті емес. Жағдайыңыз келгенше берсеңіз болады.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазір сіз А точкаңызда тұрсыз. Курсты барысында, курсты аяқтағандағы Б точкаңыздың қандай екенін көз алдыңызға елестетіп, детально қағазға жазып шығыңыз. Курсты аяғына дейін жеткізе алмаймын деп, шаршаған кездерде осы жазғаныңыз сізге мотивация беретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,671,1,NULL,0,'2021-12-20 18:47:25','2022-01-15 20:15:25'),(634,168,37,'Ақша психологиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақша психологиясы&nbsp;байлықтың маңызды аспектісі, өйткені ақша &ndash; бұл энергия, оның келуін үнемі сезініп, оң көзқараспен қарау өте маңызды. Егер миыңызда ақшаның образы негативті болса, сіздің ақша табуыңыз қиындайды. Сол үшін бірінші ақша образына қатысты мидағы установкалармен жұмыс жасау қажет.<iframe src=\"https://player.vimeo.com/video/658995855\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қолыңызға ақшаны алып, тапсырманы орындаңыз. Ақшаны көз алдыңызда тұрған адам ретінде елестетіңіз. Ақша сізге қандай кейіпте елестеді? Оны көргенде өзіңізді қалай сезінудесіз? Ол қандай адам? Ол жақсы ма жаман ба? Қандай сезімде болғаныңызды детально жазып шығыңыз. Көп ойланбаңыз. Ойыңызға 1-ші келген ойды жазыңыз. Ақшаның сіздің миыңыздағы образын анықтаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Егер миыңыздағы ақшаның образы негативті болса, онда ақша образы позитивті болғанша осы жаттығуды орындап, жұмыс жасауыңыз қажет. Есіңізде болсын, мидағы установка бірден шешіле салмайды. Онымен үздіксіз жұмыс жасап отыру қажет.</span></p>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Күнделікті садақа беріп, нәпсіңізді сындырып, беруге миыңызды үйретіңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Көзіңізге, миыңызға иманы мен байлығын қатар алып жүрген адамдарды көп көрсетуге тырысыңыз. Өмірде таныс болмасаңыздар да, инстаграм парақшаларын қарауға болады. Миыңыз иманы мен байлығын қатар алып жүрген адамдарды көп көрсе, сіздегі ақша образы өзгеретін болады.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,313,1,NULL,0,'2021-12-20 18:48:29','2022-01-16 09:41:39'),(636,168,37,'\"Бай-кедей\" философиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Неге мыңдаған, тіпті миллиондаған адамдар таңертең ерте тұрып, жұмысқа барады, күні бойы терлеп жұмыс істейді, бірақ біреуі бай, біреуі кедей болады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мүмкін осы сұрақтың жауабы бай мен кедейдің арасындағы айырмашылықтарда шығар...</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/659034736\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кедей психологиясындағы әдеттерден өзіңізді тыйыңыз. Өзіңізді кез-келген жерде миллиардер секілді ұстауды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Жауапкершілікті 100% өзіңізге алуды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Адамнан дәмеленуді тоқтатыңыз. Не нәрсе дәметсеңіз де, не нәрсе сұрасаңыз да Алладан сұраңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&laquo;Аллахым, мені өзіңнен басқа ешкімге мұқтаж етпе. Шайтанның, нәпсінің, сен разы болмайтын нашар ойлардың зиянынан мені сақта. Жүрегімді өзіңі ғана байла. Тәуекелім тек саған ғана болсын&raquo;, &laquo;Мені байытқан сайын, иманымды да байыт. Дүниені менің жүрегіме салма, қолыма бер&raquo;, деген дұғаларды үнемі қайталап жүруді әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тұрып жатқан қалаңыздағы ең қымбат дүкендерге кіріп көріңіз. Ең қымбат киімдерді киіп көріңіз.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,226,1,NULL,0,'2021-12-20 18:49:18','2022-01-16 10:06:50'),(638,168,37,'\"Квантты скачок\" теоремасы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақшадағы квантты скачок деген &ndash; сіздің бір материалдық жағдайдан екінші материалдық жағдайға ауысуыңыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659906586\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сабақтың конспектісін PDF форматта жоғарыдан көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">сенімді өзгерту үшін күніне кем дегенде 3 шүкіршілік айтуды әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Дәл қазір өзіңіздің Дэвид Хокинстің эмоция шкаласындағы қандай энергетикалық деңгейде тұрғаныңызды анықтаңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мидағы сенімді өзгертеміз:</span><br /><span style=\"color: #ffffff;\">- Мен баймын. Байлық маған оңай келеді.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықтың иесі.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықты беруші. Маған да оңай береді.</span></li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,267,1,NULL,0,'2021-12-20 18:50:06','2022-01-16 10:18:04'),(640,168,37,'Ақшаны көбейту жолдары','<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/661591016\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Келесі сұрақтарға жауап беру:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазіргі табысыңызды 3 есесге көбейтіңіз. Қазіргі кезге қарағанда 3 есе көп табыс табатын СІЗ - өз өміріңіздің геройысыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;1.&nbsp; &nbsp;&nbsp;Сіздің герой қайда тұрады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;Оның табысы қандай? (доход)</span><br /><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;Ол қалай көрінеді? Қандай брендтегі киімдерді киеді? Шашының түсі қандай, салмағы мен бойының ұзындығы қандай?</span><br /><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp;Оның құндылықтары қандай? Өмірлік ұстанымы қандай?</span><br /><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp;Ол біреумен жақын қарым қатынаста ма? Егес ия болса, оның серіктесі қандай?</span><br /><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp;Өзін басқа ортада қалай ұстайды?</span><br /><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp;Ол нені қалайды? Дәл қазір оның ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;Оның ортасы қандай? Қандай адамдармен араласады?</span><br /><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;Демалыс күнін қалай өткізеді?</span><br /><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;Оның хоббиі қандай?</span><br /><span style=\"color: #ffffff;\">11.&nbsp;&nbsp;&nbsp;&nbsp;Ата-анасымен қарым-қатынасы қандай? Ата-анасына қалай қарайды?</span><br /><span style=\"color: #ffffff;\">12.&nbsp;&nbsp;&nbsp;&nbsp;Оның мақсаты қандай? Өмірлік миссиясы?</span><br /><span style=\"color: #ffffff;\">13.&nbsp;&nbsp;&nbsp;&nbsp;Оның басқаларға көрсететін әсері қандай? Кімдерге сөзін өткізе алады? Оның артынан қанша адам ере алады? Ол адамдар қандай?</span><br /><span style=\"color: #ffffff;\">14.&nbsp;&nbsp;&nbsp;&nbsp;Оның мұқтаждықтары қандай?</span><br /><span style=\"color: #ffffff;\">15.&nbsp;&nbsp;&nbsp;&nbsp;Оның денесі қандай? Спортпен профессионалды түрде айналыса алады ма?</span><br /><span style=\"color: #ffffff;\">16.&nbsp;&nbsp;&nbsp;&nbsp;Ол оқиды ма? Қандай оқуды оқыды немесе оқып жатыр? кітап оқиды ма? Қандай кітаптарды оқиды?</span><br /><span style=\"color: #ffffff;\">17.&nbsp;&nbsp;&nbsp;&nbsp;Қандай тамақтарды жақсы көреді? Күнделікті қай жерден және қандай тағамдармен тамақтанады?</span><br /><span style=\"color: #ffffff;\">18.&nbsp;&nbsp;&nbsp;&nbsp;Үй қызметшісі бар ма сіздің геройда? Күнделікті қолданатын қажеттіліктерін кім дайындап береді?</span><br /><span style=\"color: #ffffff;\">19.&nbsp;&nbsp;&nbsp;&nbsp;Оның өміріндегі ең сәтті ісі қандай? Ең есінде қалған оқиғасы қандай?</span><br /><span style=\"color: #ffffff;\">20.&nbsp;&nbsp;&nbsp;&nbsp;Ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">21.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде істеген ең мейірімді ісі қандай?</span><br /><span style=\"color: #ffffff;\">22.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде не нәрсеге ең қатты өкінеді?</span><br /><span style=\"color: #ffffff;\">23.&nbsp;&nbsp;&nbsp;&nbsp;Не нәрсеге шешім қабылдай алмай жүр?</span><br /><span style=\"color: #ffffff;\">24.&nbsp;&nbsp;&nbsp;&nbsp;Бақытты болуы үшін оған не керек?</span></p>','',NULL,NULL,NULL,NULL,181,1,NULL,0,'2021-12-20 18:50:53','2022-01-16 08:09:10'),(642,175,100,'Договор','<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">АҚЫЛЫ БІЛІМ БЕРУ ҚЫЗМЕТІН КӨРСЕТУ ТУРАЛЫ ЖАРИЯ ОФЕРТА ШАРТЫ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алматы қ.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&laquo;--&raquo; қараша 2021 жыл</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы шарт жеке тұлғаларға бағытталған, (әрі қарай - &laquo;Тапсырыс беруші&raquo;). Сайтты&nbsp;<strong>&laquo;INCON GROUP&raquo;</strong>&nbsp;ЖШС ұсынады (әрі қарай - &laquo;Орындаушы&raquo;). Тапсырыс беруші мен Орындаушы осы шарттың (әрі қарай - &laquo;Шарт&raquo;) &nbsp;төмендегі талаптарын қабылдай отырып жасасты:</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТЕРМИНДЕР МЕН АНЫҚТАМАЛАР</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы жария оферта шартында төменде көрсетілген ұғымдар келесі мағынада қолданылады:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оферта</em></strong>&nbsp;&ndash; жеке және заңды тұлғаларға онлайн, ақылы білім беру қызметін көрсету туралы Орындаушымен жария оферта шартын жасасу жөнінде ұсыныс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Офертаның акцепті</em></strong>&nbsp;&ndash; Тапсырыс берушінің Орындаушының көрсететін қызметіне жүгінуі арқылы Офертаны толық және сөзсіз қабылдауы. Офертаның акцепті Тараптар арасында Оферта шартының жасалғанын білдіреді.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Қызметтің прейскуранты (прайс-лист)</em></strong>&nbsp;&ndash; Орындаушы көрсететін қызметтердің тиісті түрде, бағасын көрсете отырып Сайтта жариялаған жүйелі тізбесі.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Оқу</em></strong>&nbsp;&ndash; бейнесабақ, тест және өзге де материалдардан құралған оқуға арналған сабақтар.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Тіркеу</em></strong>&nbsp;&ndash; Тапсырыс берушінің Сайтта орналасқан тіркеу формасын толтыру және жөнелтуге қатысты әрекеттері, Орындаушының Тапсырыс берушіні тіркеуге қатысты ешқандай наразылығы болмаса Тапсырыс берушіге Сайтқа кіруге логин мен құпиясөз &nbsp;беріліп, аккаунт ашылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Сайт</em></strong>&nbsp;&ndash; Онлайн-курстарды орналастыруға арналған, интернет желісінде келесі мекен жай бойынша &laquo;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&raquo; орналастырылған, ақпараттық ресурс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Онлайн-курс</em></strong>&nbsp;&ndash; Орындаушымен құрастырылып, Сайтта орналастырылған және Орындаушымен онлайн оқытуды қолдану арқылы жүзеге асырылатын &laquo;Focus&raquo; атты курс.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong><em>Коммуникациялық сервистер</em></strong>&nbsp;&ndash; Онлайн-курсқа қатысушылар өзара байланысатын немесе лездік хабарламалар алмасуды қамтамасыз ететін WhatsApp Business API (Вотсап, Воцап немесе Ватсап), Telegram (Телеграмм), Viber (Вайбер), Facebook (Фейсбук), VKontakte (ВКонтакте), Skype (Скайп), Odnoklassniki (Одноклассники), Yandex (Яндекс), WeChat (ВиЧат) сияқты сервистер.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы Офертаның мəтіні Интернет желісінде мына мекен жай бойынша орналастырылған:&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">1.&nbsp;&nbsp;&nbsp;&nbsp; НЕГІЗГІ ЕРЕЖЕЛЕР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Шарттың мəтіні жария оферта болып табылады (Қазақстан Республикасының Азаматтық кодексінің 395 бабының, 5-тармағына сәйкес жария оферта - бұл ұсыныс жасаушы жақтың кез келген хабарлаушысымен ұсыныста көрсетілген жағдайларда шарт жасасу еркі көрінетін, шарттың барлық елеулі ережелері бар ұсыныс. Офертаның акцепті - онлайн сервисті қолдану (Қазақстан Республикасының Азаматтық кодексінің 396 бабына сəйкес). Акцепт - бұл оферта жолданған жақтың оны қабылдағаны туралы жауабы. Акцепт толық әрі бұлтарыссыз болуға тиіс. Осы жария оферта шартының акцепті бойынша іс-қимыл жасай отырып, Тапсырыс беруші өзінің құқық және әрекет қабілеттілігін, сондай-ақ Орындаушымен шарттық қатынасқа түсуіне заңдық құқығы бар екенін растайды. Шартты жасасудың толық әрі бұлтарыссыз келісімі (әрі қарай - Акцепт) болып&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY&nbsp;қосымшасының&nbsp;қызметтеріне төлем жасау және/немесе Орындаушының ұсыну шарттарын қабылдау болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ МƏНІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарттың мәні бойынша Орындаушы ағымдағы Прейскурант пен осы Оферта шартының талаптарына сәйкес&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасында Тапсырыс берушіге авторлық құқықпен қорғалатын &laquo;Focus&raquo; курстарын оқыту бойынша қызмет көрсетуге, ал Тапсырыс беруші осы қызмет үшін ақша төлеуге міндетті болып табылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ҚҰҚЫҚТАРЫ МЕН МІНДЕТТЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің алдын-ала келісімінсіз кез келген уақытта, біржақты тәртіппен қызметтердің Прейкурантын және осы жария Офертаның шарттарын өзгертуге құқылы, сонымен бірге өзгертілген шарттарды Интернет желісіндегі мына мекен жайда&nbsp;<a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY жариялауды қамтамасыз етеді. Өзгертілген шарттар жарияланған сәттен бастап күшіне енеді;</span></li>\r\n<li><span style=\"color: #ffffff;\">Онлайн-курс бойынша білім беру үдерісін өздігінен жүргізуге, баға беру жүйесін (соның ішінде, Тапсырыс берушінің Онлайн-курсты игеру үдерісі кезінде), аралық және қорытынды аттестациялардың формасын, тәртібін және кезеңдерін, Онлайн-курсты игеру мерзімін таңдауға және өзгертуге.</span></li>\r\n<li><span style=\"color: #ffffff;\">Оқу аяқталғаннан кейін Тапсырыс берушімен біржақты шарты бұзуға, сондай-ақ Тапсырыс беруші Шарттың қандай-да бір талаптарын бұзған жағдайда қызмет толығымен атқарылмай тұрып біржақты шартты бұзуға құқылы. Тапсырыс берушіні шартты бұзу жайлы хабарлама тапсырылған күннен бастап Шарт бұзылған болып есептеледі. Осы тармақта көрсетілген негіздемелер бойынша Шарт бұзылған кезде Тапсырыс берушіге қызметтер құны қайтарылмайды.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Орындаушының міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Тараптар келіскен мерзімде осы Офертаның шарттарын сәйкес Тапсырыс берушіге тиісті ретпен қызмет көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Тапсырыс беруші ұсынған құпия ақпарат пен мәліметтерді жарияламау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Сайтта Онлайн-курсқа қатысты өзекті ақпаратты, соның ішінде Онлайн курстың мазмұны, көлемі, құны және оқу мерзімі бойынша ақпаратты орналастыру;</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарттың талаптарын сақтаған жағдайда Тапсырыс берушіге қызмет көрсетуге;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс берушіге оның Онлайн-курсты игеруіне барлық қажетті жағдайларды жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші барлық сабақтарды өтіп, тапсырмаларды орындаған жағдайда Онлай-курстан 100 (жүз) пайыз нәтиже шығаруға кепілдік беру.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің құқықтары:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаның шарттарына сәйкес Орындаушыдан қызметтердің уақытылы және толық көлемде көрсетілуін талап етуге құқылы.</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\"><strong>Тапсырыс берушінің міндеттері:</strong></span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Осы Оферта мен қызметтер Прейскурантында қарастырылған тәртіпте, мерзімде және мөлшерде Орындаушыға көрсетілетін қызметтері үшін төлемді уақытылы және толық жасау;</span></li>\r\n<li><span style=\"color: #ffffff;\"><a style=\"color: #ffffff;\" href=\"https://www.cerebrum.kz\">INCON</a>&nbsp;ACADEMY қосымшасындағы Тіркеу кезінде өзіңіз туралы расталған, толық және нақты ақпаратты көрсету;</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Офертаны орындауға байланысты Орындаушы берген ақпарат пен басқа да мәліметтерді жария етпеу, соның ішінде Орындаушының жазбаша келісімісіз Оқу материалдарын қандай да бір үшінші тұлғаларға жария етпеу, жария ету арқылы пайда таппау немесе үшінші тұлғаға пайда тапқызбау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы ұсынған сабақтарды оқып біткеннен кейні, &laquo;Сабақты аяқтау&raquo; батырмасын басу арқылы аяқтау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Қызметтерді көрсету мерзімінің басталуын өздігінен қадағалау, оқу жоспарына сәйкес Онлайн-курс бағдарламасын толық көлемде игеру, соның ішінде Орындаушы бекіткен оқу жүктемелері мен өзіндік тапсырмаларды орындау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Тіркеу кезінде берілген логин мен құпиясөзді үшінші тұлғаларға бермеу;</span></li>\r\n<li><span style=\"color: #ffffff;\">Логин мен құпиясөзді бұзу әрекеттері арқылы Сайттағы басқа аккаунттарға кіруге бағытталған іс-әрекеттерді жасамау;</span></li>\r\n<li><span style=\"color: #ffffff;\">Коммуникациялық сервистерде дөрекі сөздер мен сондай мағынаға ие хабарламаларды жарияламауға, сондай-ақ келесідей әрекеттерге жол бермеуге:</span></li>\r\n</ul>\r\n</li>\r\n<li><span style=\"color: #ffffff;\">өшпенділікті насихаттайтын, нәсілдік, этникалық, жыныстық, діни және әлеуметтік белгілері бойынша кемсітетін;</span></li>\r\n<li><span style=\"color: #ffffff;\">басқа қолданушыларды және (немесе) үшінші тұлғаларды балағаттайтын, олардың ары мен абыройына, іскерлік беделіне нұқсан келтіретін;</span></li>\r\n<li><span style=\"color: #ffffff;\">дербес деректер заңнамасын бұзатын;</span>\r\n<ul>\r\n<li><span style=\"color: #ffffff;\">Өз жұмыс орнын 10 Мбит/с кем емес жылдамдықтағы Интернет желісіне қосу, және Онлайн-курс сипаттамасында көрсетілген талаптарға сай дербес компьютер немесе басқа құрылғымен өздігімен ұйымдастыру.</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp; ҚЫЗМЕТ КӨРСЕТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші Орындаушы жариялаған ағымдағы Қызметтің прейскурантына сәйкес өзіне қажетті Курс түрін өздігінен анықтап және осы Шарттың 6 Бөліміне сәйкес төлем жасайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс беруші берген мәліметтерді тексереді және Орындаушының есеп шотына ақшалай қаражат түскеннен кейін, бірақ төлем жасағаны туралы төлем құжатының көшірмесін ұсынғаннан кейін, Орындаушы жеке кабинетке қолжетімділікті ашып, Тапсырыс беруші оқуды бастайды.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тапсырыс беруші төлемді растайтын құжаттарды ұсынып, бірақ ақшалай қаражат қандай да бір себептермен Орындаушының есеп шотына түспеген болса, онда Орындаушы бұл туралы Тапсырыс берушіге хабарлайды және осы шарт бойынша қызмет көрсетпеуге құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушының кінәсі бойынша өткізілмеген сабақтар еш жоғалтусыз сол тарификациямен басқа уақытқа ауыстырылады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ БАҒАСЫ ЖӘНЕ ТӨЛЕУ ТӘРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қызметтер құны бекітілген бағалар - қызметтер Прейскуранты, прайс-лист бойынша есептеледі және төлем жасауға арналған сервис арқылы Тапсырыс берушіге ақша аударылып, түбіртекпен бекітіледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шартқа сәйкес төлем қызмет көрсетілгенге дейін 100 % мөлшерде, Онлайн-курстың басталуына 1 (бір) күн бұрын жасалады.</span></li>\r\n<li><span style=\"color: #ffffff;\">Ақшалай қаражатты аудару міндеттемелерінің орындалу күні болып ақшалай қаражаттың Орындаушының есеп шотына немесе кассасына түскен күні есептеледі.</span></li>\r\n<li><span style=\"color: #ffffff;\">Орындаушы Тапсырыс берушінің жазбаша талабы бойынша шарт жасасқан күннен бастап 14 (он төрт) күн ішінде, егер қызметтін төлену фактісін растайтын құжат сақталса:</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.1. Қызмет үшін төленген сомманың 30% шарттан шығу ақысы болып ұсталынады;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">5.4.2. Қалған қызмет үшін төленген сомманың 70% Сатып алушыға қайтарылады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp; ТАРАПТАРДЫҢ ЖАУАПКЕРШІЛІГІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.3. тармақшасында көрсетілген талаптар бұзылған жағдайда, Тапсырыс беруші Орындаушыға туындаған залалдың және айырылып қалған пайданың толық соммасын өтеуге міндеттенеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы шарртың 3.4.5. немесе 3.4.8. тармақшасындағы көрсетілген талаптарды бұзған жағдайда, Тапсырыс беруші Орындаушыны Оқу қызметін атқаруға арналған WhatsApp сервисынадағы топтан алдын-ала ескертусіз шығаруға құқылы.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша міндеттемелерді орындамағаны немесе тиісті деңгейде орындамағы үшін Тараптар ҚР қолданыстағы заңнамасы бойынша жауап береді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Тараптар Шарттың талаптарын орындау үдерісінде пайда болған келіспеушіліктерді шешу үшін барлық қажетті шараларды қабылдап, келіссөздер арқылы шешіледі. Дау туындаған сәттен бастап Шағым 20 (жиырма) жұмыс күн ішінде жіберілуі керек. Шағымды қарау мерзімі &ndash; оны алған күннен бастап 7 (жеті) жұмыс күн.</span></li>\r\n<li><span style=\"color: #ffffff;\">Келіссөздер арқылы дауды шешуге қол жеткізілмеген жағдайда, келіспеушіліктер немесе талаптар Қазақстан Республикасының материалдық және іс жүргізу құқығына сәйкес тиісті сотта шешілуге жатады.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫ ТОҚТАТУ НЕГІЗДЕРІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Осы Шарт тараптардың келісімімен тоқтатылуы мүмкін. Бір Тараптың бастамасымен Шарт Қазақстан Республикасы қолданыстағы заңнамасында қарастырылған негіздер бойынша тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ШАРТТЫҢ ƏРЕКЕТ ЕТУ МЕРЗІМІ, ОНЫ ӨЗГЕРТУ МЕН ТОҚТАТУ ТƏРТІБІ</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Орындаушының жария офертасын Тапсырыс беруші акцепті сәтінен бастап Шарт жасасқан болып есептеледі және Тараптардың Шарт бойынша өз міндеттемелерін толық орындағанға дейін әрекет етеді.</span></li>\r\n<li><span style=\"color: #ffffff;\">Шарт Қазақстан Республикасы заңнамасы мен Шартта қарастырылған негіздер бойынша өзгертілуі немесе тоқтатылуы мүмкін.</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ФОРС-МАЖОРЛЫҚ ЖАҒДАЙЛАР</span></h1>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Егер Тараптар осы Шартты жасасқаннан кейін, форс-мажорлық мән-жайлардан немесе Тараптардың бақылауына тәуелді болмайтын жағдайлардың әсерінен жауапкершіліктерін орындай алмаса және оның сондай мән-жайлардан туындағанын дәлелдесе, Тараптар ақы төлеу жөніндегі міндеттемелерді қоспағанда, өз міндеттемелерінің кез келгенін орындамағаны үшін жауап бермейді. Форс-мажорлық жағдайларға атап айтқанда, серверді бұғаттау, табиғи катаклизмдер, ереуілдер, өрт, су тасқыны, жарылыстар, соғыстар (жарияланған және жарияланбаған), бүліктер, апаттар, мемлекеттік органдар салатын шектеулер, төтенше жағдай, карантин жатады. Аталған мән-жайлар осы Шартты орындауға тікелей әсер етуі мүмкін.</span></li>\r\n<li><span style=\"color: #ffffff;\">Форс-мажорлық жағдайлардың туындауына байланысты осы Шарт бойынша міндеттемелерді орында алмаған Тарап жоғарыда көрсетілген жағдайлардың пайда болуы туралы екінші Тарапқа жазбаша түрде күнтізбелік 3 (үш) күн ішінде хабарлауға тиіс.</span></li>\r\n<li><span style=\"color: #ffffff;\">Осы Шарт бойынша өз міндеттемелерін орындау үшін тараптарға талап етілетін уақыт аталған жағдайларға байланысты кез келген мерзімге ұзартылады</span></li>\r\n</ul>\r\n<h1 style=\"text-align: justify;\"><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ОРЫНДАУШЫНЫҢ РЕКВИЗИТТЕРІ</span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">\"INCON GROUP\" ЖШС</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">ИИК: KZ879470398927017962</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Валюта: KZT</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН/ИИН: 200240007431</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Банк: АО ДБ &laquo;Альфа-Банк&raquo;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИН Банка: 941240000341</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">БИК Банка: ALFAKZKA</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Юр адрес: Аль Фараби 13, 1В</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Директор: Асқар Алмас Ержанұлы</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">_______________________________</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; М.О.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\"><em>Келісім шартты мұқият оқып, танысып, пікір бөліміне \"КЕЛІСЕМІН\" деп жазыңыз. Менеджер сіздің жауабыңызды қабылдағаннан кейін сізге сабақтарға доступ ашылады.</em></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ff0000;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,189,1,NULL,1,'2021-12-20 19:42:03','2022-01-15 09:12:36'),(643,175,109,'Кіріспе сабақ','<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәлем, \"FOCUS\" курсының студенті ???</span></p>\r\n<p style=\"text-align: left;\">\"FOCUS\"&nbsp; курсының \"ИНФОБИЗНЕС\" пакетінің бағдарламасы сізге 2 ай ішінде өз өніміңізді 0-ден бастап кеңейтілген масштабқа жеткізуге көмектеседі.&nbsp;<br /><span style=\"color: #ffffff;\">Сізде барлық сабаққа 6 ай доступ болады ✅</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Курс бағдарламасы:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">I МОДУЛЬ: Ақшаға дайындық</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">II МОДУЛЬ:&nbsp;Распаковка</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">III&nbsp;МОДУЛЬ:&nbsp;Стратегия</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">IV&nbsp;МОДУЛЬ:&nbsp;Инфопродукт. Клиентпен жұмыс</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">V&nbsp;МОДУЛЬ:&nbsp;Прогрев</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VI&nbsp;МОДУЛЬ:&nbsp;Запуск</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VII&nbsp;МОДУЛЬ: Продажа</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">VIII&nbsp;МОДУЛЬ:&nbsp;Масштаб</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Өміріңізді жаңа этапқа ауыстыратын білім болсын!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сәттілік, миллионер!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">?Курсқа қатысу шарттары:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Чатта негатив хабарлама жазуға болмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторға артық әңгіме айту мен жеке шекарасынан асуға рұқсат жоқ;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Курс ақысы кері қайтарылмайды;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">✅ Әр бір сабақты оқып, тапсырмаларды кураторға уақытылы жіберу керек;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">? Кураторларға 2 рет тапсырманы кешіктірсеңіз, сұрағына жауап бермесеңіз, нәтижеңізді өз жауапкершілігімізге алмаймыз. Оған қоса общий группадан шығарыласыз және алдағы уақытта куратордың және наставник, трекердің қызметі көрсетілмейді!!! Алайда сабаққа доступ болады. Дальше сабақты жеке өзіңіз оқисыз. Сізге де бізге де нәтиже шығарғаныңыз керек!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сабақтардың авторлық құқығы сақталған!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Сізге берген логин мен құпия сөзді басқа адаммен бөлісуге болмайды.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ffffff;\">Бөліскен жағдайда курсқа доступ жабылады, акаунтыңыз блокқа түседі.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658889534\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,NULL,NULL,NULL,326,1,NULL,0,'2021-12-20 06:33:34','2022-01-17 04:00:07'),(644,175,109,'Үлкен ақшаға ниеттену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастамас алдын сіздің бірінші ниетіңіз дұрыс болуы қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сіз курсқа \"табысымды еслеймін, материалдық жағдайымды жақсартамын\"- деп келдіңіз. Ол үшін сіздің ақшаға деген ниетіңіз, көзқарасыңыз дұрыс болуы керек. Осы тақырыпты өз ісінің маманы, 15 жылдық тәжірибесі бар ислам шеңберіндегі психолог - Балқия Балтабай ханым түсіндіріп айтатын болады.&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658750536\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe><span style=\"color: #ffffff;\"><br /></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658913998\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Курсты бастаған кезде ниетіңізді дұрыстаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниетті анықтауға арналған сұрақтарға жауап беріңіз:</span></p>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Бұл не үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім үшін?</span></li>\r\n<li><span style=\"color: #ffffff;\">Кім қалап тұр?</span></li>\r\n<li><span style=\"color: #ffffff;\">Не аламын?</span></li>\r\n</ul>\r\n<ol style=\"text-align: justify;\" start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кез-келген істі бастар алдында, соған қоса курсты бастар алдын Алла разылығы үшін, ісіңіздің берекелі болуы үшін садақа беріңіз. Міндетті түрде көп ақша болуы міндетті емес. Жағдайыңыз келгенше берсеңіз болады.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазір сіз А точкаңызда тұрсыз. Курсты барысында, курсты аяқтағандағы Б точкаңыздың қандай екенін көз алдыңызға елестетіп, детально қағазға жазып шығыңыз. Курсты аяғына дейін жеткізе алмаймын деп, шаршаған кездерде осы жазғаныңыз сізге мотивация беретін болады.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,564,1,NULL,0,'2021-12-20 08:22:52','2022-01-16 15:44:55'),(646,175,109,'Ақша психологиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақша психологиясы&nbsp;байлықтың маңызды аспектісі, өйткені ақша &ndash; бұл энергия, оның келуін үнемі сезініп, оң көзқараспен қарау өте маңызды. Егер миыңызда ақшаның образы негативті болса, сіздің ақша табуыңыз қиындайды. Сол үшін бірінші ақша образына қатысты мидағы установкалармен жұмыс жасау қажет.&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658995855\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Қолыңызға ақшаны алып, тапсырманы орындаңыз. Ақшаны көз алдыңызда тұрған адам ретінде елестетіңіз. Ақша сізге қандай кейіпте елестеді? Оны көргенде өзіңізді қалай сезінудесіз? Ол қандай адам? Ол жақсы ма жаман ба? Қандай сезімде болғаныңызды детально жазып шығыңыз. Көп ойланбаңыз. Ойыңызға 1-ші келген ойды жазыңыз. Ақшаның сіздің миыңыздағы образын анықтаңыз.</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Егер миыңыздағы ақшаның образы негативті болса, онда ақша образы позитивті болғанша осы жаттығуды орындап, жұмыс жасауыңыз қажет. Есіңізде болсын, мидағы установка бірден шешіле салмайды. Онымен үздіксіз жұмыс жасап отыру қажет.</span></p>\r\n<ol start=\"2\">\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Күнделікті садақа беріп, нәпсіңізді сындырып, беруге миыңызды үйретіңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Көзіңізге, миыңызға иманы мен байлығын қатар алып жүрген адамдарды көп көрсетуге тырысыңыз. Өмірде таныс болмасаңыздар да, инстаграм парақшаларын қарауға болады. Миыңыз иманы мен байлығын қатар алып жүрген адамдарды көп көрсе, сіздегі ақша образы өзгеретін болады.</span></li>\r\n</ol>','',NULL,NULL,NULL,NULL,252,1,NULL,0,'2021-12-20 08:25:13','2022-01-16 16:06:55'),(648,175,109,'\"Бай-кедей\" философиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Неге мыңдаған, тіпті миллиондаған адамдар таңертең ерте тұрып, жұмысқа барады, күні бойы терлеп жұмыс істейді, бірақ біреуі бай, біреуі кедей болады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мүмкін осы сұрақтың жауабы бай мен кедейдің арасындағы айырмашылықтарда шығар...</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/659034736\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Кедей психологиясындағы әдеттерден өзіңізді тыйыңыз. Өзіңізді кез-келген жерде миллиардер секілді ұстауды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Жауапкершілікті 100% өзіңізге алуды үйреніңіз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Адамнан дәмеленуді тоқтатыңыз. Не нәрсе дәметсеңіз де, не нәрсе сұрасаңыз да Алладан сұраңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&laquo;Аллахым, мені өзіңнен басқа ешкімге мұқтаж етпе. Шайтанның, нәпсінің, сен разы болмайтын нашар ойлардың зиянынан мені сақта. Жүрегімді өзіңі ғана байла. Тәуекелім тек саған ғана болсын&raquo;, &laquo;Мені байытқан сайын, иманымды да байыт. Дүниені менің жүрегіме салма, қолыма бер&raquo;, деген дұғаларды үнемі қайталап жүруді әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тұрып жатқан қалаңыздағы ең қымбат дүкендерге кіріп көріңіз. Ең қымбат киімдерді киіп көріңіз.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,196,1,NULL,0,'2021-12-20 19:52:15','2022-01-16 14:31:52'),(650,175,109,'\"Квантты скачок\" теоремасы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақшадағы квантты скачок деген &ndash; сіздің бір материалдық жағдайдан екінші материалдық жағдайға ауысуыңыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659906586\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сабақтың конспектісін PDF форматта жоғарыдан көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">сенімді өзгерту үшін күніне кем дегенде 3 шүкіршілік айтуды әдетке айналдырыңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Дәл қазір өзіңіздің Дэвид Хокинстің эмоция шкаласындағы қандай энергетикалық деңгейде тұрғаныңызды анықтаңыз.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мидағы сенімді өзгертеміз:</span><br /><span style=\"color: #ffffff;\">- Мен баймын. Байлық маған оңай келеді.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықтың иесі.</span><br /><span style=\"color: #ffffff;\">- Аллах бүкіл ризықты беруші. Маған да оңай береді.</span></li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\"><a href=\"http://185.100.67.139/uploads/1640346818E5nqT.pdf\">пдф файл</a></span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,211,1,NULL,0,'2021-12-20 19:53:11','2022-01-16 16:24:06'),(652,175,109,'Ақшаны көбейту жолдары','<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/661591016\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Келесі сұрақтарға жауап беру:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қазіргі табысыңызды 3 есесге көбейтіңіз. Қазіргі кезге қарағанда 3 есе көп табыс табатын СІЗ - өз өміріңіздің геройысыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;1.&nbsp; &nbsp;&nbsp;Сіздің герой қайда тұрады?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">2.&nbsp;&nbsp;&nbsp;&nbsp;Оның табысы қандай? (доход)</span><br /><span style=\"color: #ffffff;\">3.&nbsp;&nbsp;&nbsp;&nbsp;Ол қалай көрінеді? Қандай брендтегі киімдерді киеді? Шашының түсі қандай, салмағы мен бойының ұзындығы қандай?</span><br /><span style=\"color: #ffffff;\">4.&nbsp;&nbsp;&nbsp;&nbsp;Оның құндылықтары қандай? Өмірлік ұстанымы қандай?</span><br /><span style=\"color: #ffffff;\">5.&nbsp;&nbsp;&nbsp;&nbsp;Ол біреумен жақын қарым қатынаста ма? Егес ия болса, оның серіктесі қандай?</span><br /><span style=\"color: #ffffff;\">6.&nbsp;&nbsp;&nbsp;&nbsp;Өзін басқа ортада қалай ұстайды?</span><br /><span style=\"color: #ffffff;\">7.&nbsp;&nbsp;&nbsp;&nbsp;Ол нені қалайды? Дәл қазір оның ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">8.&nbsp;&nbsp;&nbsp;&nbsp;Оның ортасы қандай? Қандай адамдармен араласады?</span><br /><span style=\"color: #ffffff;\">9.&nbsp;&nbsp;&nbsp;&nbsp;Демалыс күнін қалай өткізеді?</span><br /><span style=\"color: #ffffff;\">10.&nbsp;&nbsp;&nbsp;&nbsp;Оның хоббиі қандай?</span><br /><span style=\"color: #ffffff;\">11.&nbsp;&nbsp;&nbsp;&nbsp;Ата-анасымен қарым-қатынасы қандай? Ата-анасына қалай қарайды?</span><br /><span style=\"color: #ffffff;\">12.&nbsp;&nbsp;&nbsp;&nbsp;Оның мақсаты қандай? Өмірлік миссиясы?</span><br /><span style=\"color: #ffffff;\">13.&nbsp;&nbsp;&nbsp;&nbsp;Оның басқаларға көрсететін әсері қандай? Кімдерге сөзін өткізе алады? Оның артынан қанша адам ере алады? Ол адамдар қандай?</span><br /><span style=\"color: #ffffff;\">14.&nbsp;&nbsp;&nbsp;&nbsp;Оның мұқтаждықтары қандай?</span><br /><span style=\"color: #ffffff;\">15.&nbsp;&nbsp;&nbsp;&nbsp;Оның денесі қандай? Спортпен профессионалды түрде айналыса алады ма?</span><br /><span style=\"color: #ffffff;\">16.&nbsp;&nbsp;&nbsp;&nbsp;Ол оқиды ма? Қандай оқуды оқыды немесе оқып жатыр? кітап оқиды ма? Қандай кітаптарды оқиды?</span><br /><span style=\"color: #ffffff;\">17.&nbsp;&nbsp;&nbsp;&nbsp;Қандай тамақтарды жақсы көреді? Күнделікті қай жерден және қандай тағамдармен тамақтанады?</span><br /><span style=\"color: #ffffff;\">18.&nbsp;&nbsp;&nbsp;&nbsp;Үй қызметшісі бар ма сіздің геройда? Күнделікті қолданатын қажеттіліктерін кім дайындап береді?</span><br /><span style=\"color: #ffffff;\">19.&nbsp;&nbsp;&nbsp;&nbsp;Оның өміріндегі ең сәтті ісі қандай? Ең есінде қалған оқиғасы қандай?</span><br /><span style=\"color: #ffffff;\">20.&nbsp;&nbsp;&nbsp;&nbsp;Ең үлкен арманы қандай?</span><br /><span style=\"color: #ffffff;\">21.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде істеген ең мейірімді ісі қандай?</span><br /><span style=\"color: #ffffff;\">22.&nbsp;&nbsp;&nbsp;&nbsp;Өмірінде не нәрсеге ең қатты өкінеді?</span><br /><span style=\"color: #ffffff;\">23.&nbsp;&nbsp;&nbsp;&nbsp;Не нәрсеге шешім қабылдай алмай жүр?</span><br /><span style=\"color: #ffffff;\">24.&nbsp;&nbsp;&nbsp;&nbsp;Бақытты болуы үшін оған не керек?</span></p>','',NULL,NULL,NULL,NULL,154,1,NULL,0,'2021-12-20 19:54:51','2022-01-17 05:36:24'),(655,175,109,'Білімге дұрыс ниеттену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Білім &ndash; пайғамбарлардың мұрасы әрі баға жетпес игілік. Білім &ndash; жүректің өмірі, көздің нұры, рухтың шипасы, жанның рақаты. Білім &ndash; сөздерді, істерді, оқиғаларды өлшеуге болатын таразы. Білім арқылы адам Алланы таниды, құлшылығын бір Құдайға арнайды, Оны мадақтайды. Білімнің себебімен тура жол табылады. Білімнің көмегімен тыйым салынған мен рұқсат етілгенді анықтауға болады. Алла разы болатын немесе Алланы қаһарландыратын істер танылады. Көздеген мақсатқа оңай әрі дұрыс жетудің жолы көрсетіледі. Білім іздену &ndash; парыз, әрі құлшылық. Білу &ndash; Алладан қорқу. Білгеніңді үйрету &ndash; садақа, қайталау &ndash; тәсбих. Білімді болғаныңыз &ndash; Алладан қорыққаныңыз, махаббаттың артқаны. Білім су мен тамақтан да артық.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ең әуелі білімді не мақсатта алғың келеді, дүние табу үшінбе, атақ мақтангершілік үшін бе, әлде амалға асырып, Алланың разылына бөлену үшін бе, соған мән беруіміз қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Білімге қалай дұрыс ниет қою керектігін&nbsp;НҰР-МҮБАРАК университетінің педагог маманы, қари ұстаз Малика Айтжанқызы толықтай түсіндіреді.</span></p>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658986690\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li><span style=\"color: #ffffff;\">Алла разылығы үшін білім алуға ниет етіңіз.</span></li>\r\n<li>\r\n<p><span style=\"color: #ffffff;\">Рабби зидни ъилмән (Раббым, білімімді арттыр) дұғасын жиі айтуды әдетке айналдырыңыз.</span></p>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,306,1,NULL,0,'2021-12-20 08:24:10','2022-01-17 06:34:21'),(656,173,88,'Білімге дұрыс ниеттену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Білім &ndash; пайғамбарлардың мұрасы әрі баға жетпес игілік. Білім &ndash; жүректің өмірі, көздің нұры, рухтың шипасы, жанның рақаты. Білім &ndash; сөздерді, істерді, оқиғаларды өлшеуге болатын таразы. Білім арқылы адам Алланы таниды, құлшылығын бір Құдайға арнайды, Оны мадақтайды. Білімнің себебімен тура жол табылады. Білімнің көмегімен тыйым салынған мен рұқсат етілгенді анықтауға болады. Алла разы болатын немесе Алланы қаһарландыратын істер танылады. Көздеген мақсатқа оңай әрі дұрыс жетудің жолы көрсетіледі. Білім іздену &ndash; парыз, әрі құлшылық. Білу &ndash; Алладан қорқу. Білгеніңді үйрету &ndash; садақа, қайталау &ndash; тәсбих. Білімді болғаныңыз &ndash; Алладан қорыққаныңыз, махаббаттың артқаны. Білім су мен тамақтан да артық.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ең әуелі білімді не мақсатта алғың келеді, дүние табу үшінбе, атақ мақтангершілік үшін бе, әлде амалға асырып, Алланың разылына бөлену үшін бе, соған мән беруіміз қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Білімге қалай дұрыс ниет қою керектігін&nbsp;НҰР-МҮБАРАК университетінің педагог маманы, қари ұстаз Малика Айтжанқызы толықтай түсіндіреді.</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658986690\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li><span style=\"color: #ffffff;\">Алла разылығы үшін білім алуға ниет етіңіз.</span></li>\r\n<li>\r\n<p><span style=\"color: #ffffff;\">Рабби зидни ъилмән (Раббым, білімімді арттыр) дұғасын жиі айтуды әдетке айналдырыңыз.</span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,425,1,NULL,0,'2021-12-20 12:48:58','2022-01-17 04:52:47'),(657,172,80,'Білімге дұрыс ниетиену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Білім &ndash; пайғамбарлардың мұрасы әрі баға жетпес игілік. Білім &ndash; жүректің өмірі, көздің нұры, рухтың шипасы, жанның рақаты. Білім &ndash; сөздерді, істерді, оқиғаларды өлшеуге болатын таразы. Білім арқылы адам Алланы таниды, құлшылығын бір Құдайға арнайды, Оны мадақтайды. Білімнің себебімен тура жол табылады. Білімнің көмегімен тыйым салынған мен рұқсат етілгенді анықтауға болады. Алла разы болатын немесе Алланы қаһарландыратын істер танылады. Көздеген мақсатқа оңай әрі дұрыс жетудің жолы көрсетіледі. Білім іздену &ndash; парыз, әрі құлшылық. Білу &ndash; Алладан қорқу. Білгеніңді үйрету &ndash; садақа, қайталау &ndash; тәсбих. Білімді болғаныңыз &ndash; Алладан қорыққаныңыз, махаббаттың артқаны. Білім су мен тамақтан да артық.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ең әуелі білімді не мақсатта алғың келеді, дүние табу үшінбе, атақ мақтангершілік үшін бе, әлде амалға асырып, Алланың разылына бөлену үшін бе, соған мән беруіміз қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Білімге қалай дұрыс ниет қою керектігін&nbsp;НҰР-МҮБАРАК университетінің педагог маманы, қари ұстаз Малика Айтжанқызы толықтай түсіндіреді.</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658986690\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li><span style=\"color: #ffffff;\">Алла разылығы үшін білім алуға ниет етіңіз.</span></li>\r\n<li>\r\n<p><span style=\"color: #ffffff;\">Рабби зидни ъилмән (Раббым, білімімді арттыр) дұғасын жиі айтуды әдетке айналдырыңыз.</span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,171,1,NULL,0,'2021-12-20 18:19:16','2022-01-14 13:17:08'),(658,171,71,'Білімге дұрыс ниетиену','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Білім &ndash; пайғамбарлардың мұрасы әрі баға жетпес игілік. Білім &ndash; жүректің өмірі, көздің нұры, рухтың шипасы, жанның рақаты. Білім &ndash; сөздерді, істерді, оқиғаларды өлшеуге болатын таразы. Білім арқылы адам Алланы таниды, құлшылығын бір Құдайға арнайды, Оны мадақтайды. Білімнің себебімен тура жол табылады. Білімнің көмегімен тыйым салынған мен рұқсат етілгенді анықтауға болады. Алла разы болатын немесе Алланы қаһарландыратын істер танылады. Көздеген мақсатқа оңай әрі дұрыс жетудің жолы көрсетіледі. Білім іздену &ndash; парыз, әрі құлшылық. Білу &ndash; Алладан қорқу. Білгеніңді үйрету &ndash; садақа, қайталау &ndash; тәсбих. Білімді болғаныңыз &ndash; Алладан қорыққаныңыз, махаббаттың артқаны. 