көрсетіледі. Білім іздену &ndash; парыз, әрі құлшылық. Білу &ndash; Алладан қорқу. Білгеніңді үйрету &ndash; садақа, қайталау &ndash; тәсбих. Білімді болғаныңыз &ndash; Алладан қорыққаныңыз, махаббаттың артқаны. Білім су мен тамақтан да артық.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ең әуелі білімді не мақсатта алғың келеді, дүние табу үшінбе, атақ мақтангершілік үшін бе, әлде амалға асырып, Алланың разылына бөлену үшін бе, соған мән беруіміз қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Білімге қалай дұрыс ниет қою керектігін&nbsp;НҰР-МҮБАРАК университетінің педагог маманы, қари ұстаз Малика Айтжанқызы толықтай түсіндіреді.</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/658986690\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol>\r\n<li><span style=\"color: #ffffff;\">Алла разылығы үшін білім алуға ниет етіңіз.</span></li>\r\n<li>\r\n<p><span style=\"color: #ffffff;\">Рабби зидни ъилмән (Раббым, білімімді арттыр) дұғасын жиі айтуды әдетке айналдырыңыз.</span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,278,1,NULL,0,'2021-12-20 18:49:10','2022-01-15 14:14:45'),(663,173,88,'Медитациялар жинағы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Медитация- ақыл ойды шоғырлау, бір жүйеге келтіру. Медитациямен айналыссаңыз миыңыз тазаланып, түпсанаңызды проблеманы шешуге бағыттайсыз, сол арқылы ең оңтайлы тәсілді дөп басып таба алатын боласыз.</span></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\">&nbsp;</h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алла разылығы үшін деп ниет етіп,&nbsp;медитация алдында сізді жын-шайтаннан, қауіп-қатерден сақтайтын Аятуль-күрсі сүресін&nbsp;оқығаныңыз дұрыс болады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Медитацияны бастамас бұрын:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&bull; Аятуль-күрсі сүресін оқыңыз;</span><br /><span style=\"color: #ffffff;\">&bull; Установкалар мен мидағы артық ойлардан құтылыңыз;</span><br /><span style=\"color: #ffffff;\">&bull; Медитациядағы дауысты сезініп, түпсанаңызбен байланыс орнатыңыз;</span><br /><span style=\"color: #ffffff;\">&bull; Тыныштықта отырып, медитацияны соңына дейін тыңдаңыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><img src=\"https://ibb.co/26DG4Hp\" alt=\"\" /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><img src=\"https://i.ibb.co/YWzHswV/Whats-App-Image-2021-12-14-at-20-31-54-2.jpg\" alt=\"\" width=\"604\" height=\"521\" /></span></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 1 медитация. 1 күнге ниет қою.</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниет қою бұл маңызды. Бір күнге ниет қою, яғни бір күн бойы фокусыңды күні бойы ниет еткен затыңда/дүниеңде ұстау. Бұл адамға жинақылық (собранность) және ізгі ниет, пейілмен өмір сүруді үйретеді. Бұл техниканы практикада жасап көріп, ұмытпай күнделікті істесеңіз, сіздің өміріңізге тек оң әсерін беретіні анық.</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659877993\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 2 медитация. Ақша медитацисы</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақша медитациясы - ақшаны арттырудың, өзіңе бай болуға, қалталы болуға мүмкіндік беретін тамаша әрі тиімді медитация. Бұл медитацияны жасау арқылы өзіңді молшылыққа, байлыққа, сәттілікке, қаржылай тәуелсіздікке жеткізесіз. Ол үшін жайланып отырып, медитация арқылы ақшаның мықты энергетикасын сезініп және өміріңізге ендіру қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659221706\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 3 медитация. Жаңа деңгей медитациясы.</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Көп жағдайда біз бірсарынды күнделікті күйбең тірлікпен күн кешіп жатқандай, алға жылжымай, бір орында қалып кеткен секілді көрінеміз. Еш өзгерісі жоқ, өзгеріс болған күннің өзінде де мұны толыққанды жан-тәнімізбен сезінбейтін секілдіміз. \"Жаңа деңгей\" медитациясы сіздің ойлау жүйеңізге әсер етіп, жаңа ойлау деңгейіне шығарады деген сенімдеміз. Ол үшін, әрине, берілген медитацияны дұрыс жасау маңызды. Дайын болсаңыз, медитацияны жасауға көшейік.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></h3>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659220802\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 4 медитация.&nbsp; Қорқыныштан арылу медитациясы.</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қорқыныш бәріміздің бойымызда болады. Қорқыныштың түрлері де, деңгейлері де әр адамда өмір сүру дағдысына қарай әртүрлі. Қорқыныштарымызды жеңіп, алға қадам жасау, денедегі, санадағы блоктардан арылудың маңызы үлкен, себебі қорқыныш ол - тежеуіш. Бүгін жасайтын медитация арқылы денеміздегі блоктардан арылып, қорқыныштарымызға қарсы шығуды үйренетін боламыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659662324\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 5 медитация. Балалық шаққа саяхат.</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Адам өміріндегі керемет кезеңдердің бірі - балалық шақ әрине. Небір армандарға қиял бітіріп, ешбір алаңсыз өткен күндер. Десе де, \"Егер балалық шақ болмаса, адамда проблема да болмас еді\" дейді оқымыстылар, демек бала кездің адам өмірінде қаншалықты рөл ойнайтынын қазіргі таңда өте жақсы түсініп келеміз. Кішкентай кезімізде естіген сөздер, жасалған істер санада жатталып, көңілде қалып қояды. Оны өмір бойы арқалап, жүк қылып өтеміз. Сол себептен бүгін жасайтын \"Балалық шаққа саяхат медитациясының\" маңызы зор. Ендеше, медитациямызды бастайық.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659223325\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p><span style=\"color: #ffffff;\">Медитациядан алған әсеріңізді куратормен бөлісіңіз.</span></p>','',NULL,NULL,NULL,NULL,72,1,NULL,0,'2021-12-24 08:48:09','2022-01-16 18:04:56'),(664,175,109,'Медитациялар жинағы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Медитация- ақыл ойды шоғырлау, бір жүйеге келтіру. Медитациямен айналыссаңыз миыңыз тазаланып, түпсанаңызды проблеманы шешуге бағыттайсыз, сол арқылы ең оңтайлы тәсілді дөп басып таба алатын боласыз.</span></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\">&nbsp;</h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алла разылығы үшін деп ниет етіп,&nbsp;медитация алдында сізді жын-шайтаннан, қауіп-қатерден сақтайтын Аятуль-күрсі сүресін&nbsp;оқығаныңыз дұрыс болады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Медитацияны бастамас бұрын:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&bull; Аятуль-күрсі сүресін оқыңыз;</span><br /><span style=\"color: #ffffff;\">&bull; Установкалар мен мидағы артық ойлардан құтылыңыз;</span><br /><span style=\"color: #ffffff;\">&bull; Медитациядағы дауысты сезініп, түпсанаңызбен байланыс орнатыңыз;</span><br /><span style=\"color: #ffffff;\">&bull; Тыныштықта отырып, медитацияны соңына дейін тыңдаңыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><img src=\"https://ibb.co/26DG4Hp\" alt=\"\" /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><img src=\"https://i.ibb.co/YWzHswV/Whats-App-Image-2021-12-14-at-20-31-54-2.jpg\" alt=\"\" width=\"604\" height=\"521\" /></span></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 1 медитация. 1 күнге ниет қою.</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниет қою бұл маңызды. Бір күнге ниет қою, яғни бір күн бойы фокусыңды күні бойы ниет еткен затыңда/дүниеңде ұстау. Бұл адамға жинақылық (собранность) және ізгі ниет, пейілмен өмір сүруді үйретеді. Бұл техниканы практикада жасап көріп, ұмытпай күнделікті істесеңіз, сіздің өміріңізге тек оң әсерін беретіні анық.</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659877993\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 2 медитация. Ақша медитацисы</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ақша медитациясы - ақшаны арттырудың, өзіңе бай болуға, қалталы болуға мүмкіндік беретін тамаша әрі тиімді медитация. Бұл медитацияны жасау арқылы өзіңді молшылыққа, байлыққа, сәттілікке, қаржылай тәуелсіздікке жеткізесіз. Ол үшін жайланып отырып, медитация арқылы ақшаның мықты энергетикасын сезініп және өміріңізге ендіру қажет.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659221706\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 3 медитация. Жаңа деңгей медитациясы.</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Көп жағдайда біз бірсарынды күнделікті күйбең тірлікпен күн кешіп жатқандай, алға жылжымай, бір орында қалып кеткен секілді көрінеміз. Еш өзгерісі жоқ, өзгеріс болған күннің өзінде де мұны толыққанды жан-тәнімізбен сезінбейтін секілдіміз. \"Жаңа деңгей\" медитациясы сіздің ойлау жүйеңізге әсер етіп, жаңа ойлау деңгейіне шығарады деген сенімдеміз. Ол үшін, әрине, берілген медитацияны дұрыс жасау маңызды. Дайын болсаңыз, медитацияны жасауға көшейік.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></h3>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659220802\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 4 медитация.&nbsp; Қорқыныштан арылу медитациясы.</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Қорқыныш бәріміздің бойымызда болады. Қорқыныштың түрлері де, деңгейлері де әр адамда өмір сүру дағдысына қарай әртүрлі. Қорқыныштарымызды жеңіп, алға қадам жасау, денедегі, санадағы блоктардан арылудың маңызы үлкен, себебі қорқыныш ол - тежеуіш. Бүгін жасайтын медитация арқылы денеміздегі блоктардан арылып, қорқыныштарымызға қарсы шығуды үйренетін боламыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659662324\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 5 медитация. Балалық шаққа саяхат.</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Адам өміріндегі керемет кезеңдердің бірі - балалық шақ әрине. Небір армандарға қиял бітіріп, ешбір алаңсыз өткен күндер. Десе де, \"Егер балалық шақ болмаса, адамда проблема да болмас еді\" дейді оқымыстылар, демек бала кездің адам өмірінде қаншалықты рөл ойнайтынын қазіргі таңда өте жақсы түсініп келеміз. Кішкентай кезімізде естіген сөздер, жасалған істер санада жатталып, көңілде қалып қояды. Оны өмір бойы арқалап, жүк қылып өтеміз. Сол себептен бүгін жасайтын \"Балалық шаққа саяхат медитациясының\" маңызы зор. Ендеше, медитациямызды бастайық.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/659223325\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p><span style=\"color: #ffffff;\">Медитациядан алған әсеріңізді куратормен бөлісіңіз.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,39,1,NULL,0,'2021-12-24 08:56:16','2022-01-13 12:58:25'),(665,172,80,'Медитациялар жинағы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Медитация- ақыл ойды шоғырлау, бір жүйеге келтіру. Медитациямен айналыссаңыз миыңыз тазаланып, түпсанаңызды проблеманы шешуге бағыттайсыз, сол арқылы ең оңтайлы тәсілді дөп басып таба алатын боласыз.</span></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\">&nbsp;</h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Алла разылығы үшін деп ниет етіп,&nbsp;медитация алдында сізді жын-шайтаннан, қауіп-қатерден сақтайтын Аятуль-күрсі сүресін&nbsp;оқығаныңыз дұрыс болады.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Медитацияны бастамас бұрын:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&bull; Аятуль-күрсі сүресін оқыңыз;</span><br /><span style=\"color: #ffffff;\">&bull; Установкалар мен мидағы артық ойлардан құтылыңыз;</span><br /><span style=\"color: #ffffff;\">&bull; Медитациядағы дауысты сезініп, түпсанаңызбен байланыс орнатыңыз;</span><br /><span style=\"color: #ffffff;\">&bull; Тыныштықта отырып, медитацияны соңына дейін тыңдаңыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><img src=\"https://ibb.co/26DG4Hp\" alt=\"\" /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><img src=\"https://i.ibb.co/YWzHswV/Whats-App-Image-2021-12-14-at-20-31-54-2.jpg\" alt=\"\" width=\"604\" height=\"521\" /></span></p>\r\n<h3 class=\"LC20lb MBeuO DKV0Md\" style=\"text-align: justify;\"><span style=\"color: #ffffff;\">№ 1 медитация. 1 күнге ниет қою.</span></h3>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Ниет қою бұл маңызды. Бір күнге ниет қою, яғни бір күн бойы фокусыңды күні бойы ниет еткен затыңда/дүниеңде ұс