 <iframe src=\"https://player.vimeo.com/video/665313354?h=bc413e2762\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe> </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">ТАПСЫРМА 1:</span></p>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">НИК</span></li>\r\n<li><span style=\"color: #ffffff;\">Аватвр</span></li>\r\n<li><span style=\"color: #ffffff;\">Профиль шапкасы</span></li>\r\n<li><span style=\"color: #ffffff;\">Хайлайтс</span></li>\r\n<li><span style=\"color: #ffffff;\">Лента</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">берілген пункттер бойынша парақшаңызды дұрыстап, кураторға тексерту.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">ТАПСЫРМА 2:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Интернет магазин парақшасында күнделікті 20 сторис, 3 пост, аптасына 1-2 рет тікелей эфир өткізу.</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,412,1,NULL,0,'2021-12-24 15:00:23','2022-01-17 05:55:02'),(728,173,87,'Контент маркетинг матрицасы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Контент маркетинг дегеніміз - аудиторияға дұрыс сату стратегиясы.</span></p>\r\n<div style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Контент маркетингтің 4 түрі болады. Сабақта осы 4 түрін қалай микс жасап, өз контентіңізде қолдануға болатыны жайлы айтылған.</span></div>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/665153027?h=181e794e04\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сабақтың конспектісін жоғарыда&nbsp;жоғарыда ПДФ файлмен көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сабақта берілген 4 контент матрица түрінен микс жасап 1 айлық контент план құрастыру</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;<a href=\"http://185.100.67.139/uploads/1641985344SyQp0.pdf\">пдф файл </a></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,224,1,NULL,0,'2021-12-24 15:00:30','2022-01-17 06:48:06'),(729,173,87,'Сататын визуал жасақтау','<p><iframe src=\"https://player.vimeo.com/video/666272918?h=889475d242\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">1. Парақша түсін соңғы трендпен жасағыңыз келсе: Pantone 2022-2023 жылғы тренд түстерін қарап, парақшаны жүргізетін 1 түсті таңдау</span><br /><br /><span style=\"color: #ffffff;\">2. Инстаграмда @awsmcolor парақшасына кіріп, сол негізгі түске қай түстер үйлесетінін тауып, фотоларды сол түсті кадрлармен толтыру.</span><br /><br /><span style=\"color: #ffffff;\">3. Фотоны өңдеп, 1 апталық фотоконтент жасау.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Төменде&nbsp;сабақтың конспектісін ПДФ форматта көре аласыз және қасына фотоны өңдеуге көмектесетін чек-лист берілген.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #00ffff;\"><a style=\"color: #00ffff;\" href=\"http://185.100.67.139/uploads/1642205270MAw6Z.pdf\">ПДФ ФАЙЛ КОНСПЕКТ</a></span></p>\r\n<p style=\"text-align: justify;\"><span s