65,'сабақ салынбады 1','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:28:02','2021-12-24 15:28:02'),(881,171,65,'сабақ салынбады 2','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:28:09','2021-12-24 15:28:09'),(882,171,65,'сабақ салынбады 3','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:28:14','2021-12-24 15:28:14'),(883,171,65,'сабақ салынбады 4','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:28:22','2021-12-24 15:28:22'),(884,171,65,'сабақ салынбады 5','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:28:27','2021-12-24 15:28:27'),(885,171,65,'сабақ салынбады 6','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:28:31','2021-12-24 15:28:31'),(886,171,65,'сабақ салынбады 7','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:28:35','2021-12-24 15:28:35'),(887,171,65,'сабақ салынбады 8','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:28:40','2021-12-24 15:28:40'),(888,171,64,'сабақ салынбады 1','','',NULL,NULL,NULL,NULL,1,1,NULL,0,'2021-12-24 15:29:02','2021-12-27 10:38:17'),(889,171,64,'сабақ салынбады 2','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:29:07','2021-12-24 15:29:07'),(890,171,64,'сабақ салынбады 3','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:29:11','2021-12-24 15:29:11'),(891,171,64,'сабақ салынбады 4','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:29:15','2021-12-24 15:29:15'),(892,171,64,'сабақ салынбады 5','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:29:20','2021-12-24 15:29:20'),(893,171,64,'сабақ салынбады 6','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:29:24','2021-12-24 15:29:24'),(894,171,64,'сабақ салынбады 7','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:29:29','2021-12-24 15:29:29'),(895,171,64,'сабақ салынбады 8','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:29:35','2021-12-24 15:29:35'),(896,170,61,'Эксперттің блогтағы ролін қалыптастыру','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Жалпы блог дегеніміз не?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Блог деген - бір тема айналасындағы адамдар жиыны.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Инстанрамдағы блог ол - автор өзінің ойымен бөлісетін жер. Инстаграмдағы жеке блог - эксперттің өзінің эксперттілігін көрсете алатын, өз өнімін дамыта алатын, жеке брендімен жұмыс жасай алатын жер.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сіз де осы блогта өзіңіздің роліңізді табуыңыз қажет. Бұл жайлы Жұлдыз ханым видео сабақта толықтай түсіндіретін болады.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Берілген сабақтың конспектісін төменгі жақтағы PDF файл ретінде&nbsp;көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><iframe src=\"https://player.vimeo.com/video/665169870?h=8e2d9e5c65\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тарсырмасы:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Блогты упаковкалау:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">-Сен блогыңда не жайлы қозғайсың, блогта не істейсің және ол әлемге не үшін маңызды екенін көрсететіндей профиль шапкаңды толтыру керек;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">-Хайлайтс толтыру (ол жерде немен айналысатының анық болу керек, өніміңе байланысты бүкіл клиенттің ойындағы сұраққа жауап болу керек);</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">-Бүгіннен бастап күніне 15-20 сторис түсіру;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">-Аптасына 1-2 пост шығару;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">=Өзіңді таныстыру постын салу.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тапсырма 1:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Мақсатты аудиторияны табуға көмектесетін пункттердің барлығына жауап жазу.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тапсырма 2:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Өзіңнің блогтағы стратегияңның тізімін жазып шығу</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Тапсырма 3:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Өз блогыңның миссиясын жазу.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;<a href=\"http://185.100.67.139/uploads/1642011700p4ch7.pdf\">ПДФ файл</a></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,201,1,NULL,0,'2021-12-24 15:29:52','2022-01-17 04:10:56'),(897,170,61,'Табыс алып келетін блог концепциясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Блогтың экспертке табыс алып келуі үшін не істеу керек? Жалпы блогтың қандай түрлері бар және блогтың табыс алып келуі үшін қайсы блогты қолдану керек? Осы сұрақтың барлығына бүгінгі сабақта жауап аласың.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;Өзіңнің блогыңда құндылықтарыңды көрсету өте маңызды. төменде өз блогыңда қандай құндылықтар туралы айтуға болатыны жайлы тізім беріледі. Блогыңда осы тақырыптарды қолдансаң болады:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong>Құндылықтар және негативті сенімдер.<br />Қандай құндылықтарды көрсетуге болады?</strong></span><br /><span style=\"color: #ffffff;\"><strong>Өзін-өзі дамыту:</strong></span><br /><span style=\"color: #ffffff;\">1. Жеке тұлға ретінде даму</span><br /><span style=\"color: #ffffff;\">2. Еркіндік</span><br /><span style=\"color: #ffffff;\">3. Тәртіп</span><br /><span style=\"color: #ffffff;\">4. Креативтілік</span><br /><span style=\"color: #ffffff;\">5. Ақыл және білімділік</span><br /><span style=\"color: #ffffff;\">6. Көзқарастың кеңдігі</span><br /><span style=\"color: #ffffff;\">7. Өмірлік даналық</span><br /><span style=\"color: #ffffff;\">8. Шабыт</span><br /><span style=\"color: #ffffff;\">9. Потенциалдың, құлшыныстың болуы</span><br /><span style=\"color: #ffffff;\">10. Актитві өмірлік позиция</span><br /><span style=\"color: #ffffff;\">11. Тәуелсіздік</span><br /><span style=\"color: #ffffff;\">12. Белсенділік</span><br /><span style=\"color: #ffffff;\">13. Позитивті ойлау</span><br /><span style=\"color: #ffffff;\">14. Позитвті әдеттер (привычкалар)</span><br /><span style=\"color: #ffffff;\">15. Жауапкершілік</span><br /><span style=\"color: #ffffff;\">16. Мінездің ашықтығы</span><br /><span style=\"color: #ffffff;\">17. Өзіндік шешім қабылдау</span><br /><span style=\"color: #ffffff;\">18. Материалдық қамтамасыздану</span><br /><span style=\"color: #ffffff;\">19. Рухани өсу</span><br /><span style=\"color: #ffffff;\">20. Қуаныш</span><br /><span style=\"color: #ffffff;\">21. Карьера</span><br /><span style=\"color: #ffffff;\">22. Адалдық</span><br /><span style=\"color: #ffffff;\">23. Құзыреттілік</span><br /><span style=\"color: #ffffff;\">24. Табиғи болу</span><br /><span style=\"color: #ffffff;\">25. Атақтылық</span><br /><span style=\"color: #ffffff;\">26. Сұранысқа ие болу</span><br /><span style=\"color: #ffffff;\">27. Шынайылық</span><br /><span style=\"color: #ffffff;\">28. Батылдық</span><br /><span style=\"color: #ffffff;\"><strong>ЖЕКЕ ӨМІР:</strong></span><br /><span style=\"color: #ffffff;\">1. Махаббат</span><br /><span style=\"color: #ffffff;\">2. Қабылдау</span><br /><span style=\"color: #ffffff;\">3. Жанұя, отбасы</span><br /><span style=\"color: #ffffff;\">4. Қамқорлық</span><br /><span style=\"color: #ffffff;\">5. Қауіпсіздік</span><br /><span style=\"color: #ffffff;\">6. Өзара түсінушілік</span><br /><span style=\"color: #ffffff;\">7. Адалдық</span><br /><span style=\"color: #ffffff;\">8. Сенім</span><br /><span style=\"color: #ffffff;\">9. Сыйластық</span><br /><span style=\"color: #ffffff;\">10. Достық</span><br /><span style=\"color: #ffffff;\">11. Этикет</span><br /><span style=\"color: #ffffff;\">12. Жеке шекараны сыйлау</span><br /><span style=\"color: #ffffff;\">13. Әділдік</span><br /><span style=\"color: #ffffff;\">14. Юмор</span><br /><span style=\"color: #ffffff;\">15. Қолдау көрсету</span><br /><span style=\"color: #ffffff;\">16. Жауапкершілік</span><br /><span style=\"color: #ffffff;\">17. Сенім</span><br /><span style=\"color: #ffffff;\">18. Кеңпейілдік</span><br /><span style=\"color: #ffffff;\">19. Қарым-қатынас, араласу, сөйлесу</span><br /><span style=\"color: #ffffff;\">20. Бірлік</span><br /><span style=\"color: #ffffff;\">21. Ашықтық</span><br /><span style=\"color: #ffffff;\">22. Қамқорлық</span><br /><span style=\"color: #ffffff;\"><strong>ЖҰМЫС:</strong></span><br /><span style=\"color: #ffffff;\">1. Табыс</span><br /><span style=\"color: #ffffff;\">2. Мойындау</span><br /><span style=\"color: #ffffff;\">3. Әрқашан даму</span><br /><span style=\"color: #ffffff;\">4. Өзіңе камфорт өмірді бере алу</span><br /><span style=\"color: #ffffff;\">5. Карьера</span><br /><span style=\"color: #ffffff;\">6. Бизнес</span><br /><span style=\"color: #ffffff;\">7. Тұрақтылық</span><br /><span style=\"color: #ffffff;\">8. Жетістік</span><br /><span style=\"color: #ffffff;\">9. Шеберлік</span><br /><span style=\"color: #ffffff;\">10. Еңбекқорлық</span><br /><span style=\"color: #ffffff;\">11. Өз ісінің маманы, профессионализм</span><br /><span style=\"color: #ffffff;\">12. Міндеттер</span><br /><span style=\"color: #ffffff;\">13. Байлық</span><br /><span style=\"color: #ffffff;\">14. Жетістік</span><br /><span style=\"color: #ffffff;\">15. Сабырлық</span><br /><span style=\"color: #ffffff;\">16. Эффективтілік</span><br /><span style=\"color: #ffffff;\">17. Мақсатқа ұмтылу</span><br /><span style=\"color: #ffffff;\">18. Жауапкершілік</span><br /><span style=\"color: #ffffff;\"><strong>ДЕМАЛЫС:</strong></span><br /><span style=\"color: #ffffff;\">1. Саяхаттау</span><br /><span style=\"color: #ffffff;\">2. Ұйқының дұрыстығы</span><br /><span style=\"color: #ffffff;\">3. Көңіл көтеру</span><br /><span style=\"color: #ffffff;\">4. Шығармашылық</span><br /><span style=\"color: #ffffff;\">5. Хобби</span><br /><span style=\"color: #ffffff;\">6. Сұлулық</span><br /><span style=\"color: #ffffff;\">7. Юмор</span><br /><span style=\"color: #ffffff;\">8. Эмоциональный</span><br /><span style=\"color: #ffffff;\">9. Өмірге деген құлшыныс</span><br /><span style=\"color: #ffffff;\">10. Тыныштық</span><br /><span style=\"color: #ffffff;\">11. Дара болу (индивидуальность)</span><br /><span style=\"color: #ffffff;\">12. Сыйлықтар</span><br /><span style=\"color: #ffffff;\">13. Стандартты емес болу</span><br /><span style=\"color: #ffffff;\">14. Ойындар</span><br /><span style=\"color: #ffffff;\"><strong>ДЕНСАУЛЫҚ:</strong></span><br /><span style=\"color: #ffffff;\">1. Энергичный болу</span><br /><span style=\"color: #ffffff;\">2. Психологиялық тұрақтылық</span><br /><span style=\"color: #ffffff;\">3. Рухтың мықты болуы</span><br /><span style=\"color: #ffffff;\">4. Белсенділік</span><br /><span style=\"color: #ffffff;\">5. Спортпен айналысу</span><br /><span style=\"color: #ffffff;\">6. Пайдалы әдеттер</span><br /><span style=\"color: #ffffff;\">7. Баланс</span><br /><span style=\"color: #ffffff;\">8. Пайдалы болу</span><br /><span style=\"color: #ffffff;\">9. Қауіпсіздік</span><br /><span style=\"color: #ffffff;\">10. Қамқорлық</span><br /><span style=\"color: #ffffff;\">11. Сұлулық</span></p>\r\n<p><iframe src=\"https://player.vimeo.com/video/665112928?h=40b8eb2595\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><span style=\"color: #ffffff;\">Cабақ конспектісін төменде&nbsp;ПДФ форматта көре аласыз</span></p>\r\n<p><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p><span style=\"color: #ffffff;\">1. Адамдарға керекті сабақта берілген 7 пунктке сай не бере аласың?</span><br /><span style=\"color: #ffffff;\">Тізімін жазып шық. Соны блогыңа пайдалануды бүгіннен баста.</span></p>\r\n<p><span style=\"color: #ffffff;\">2.&nbsp;Өзің жақсы көріп қарайтын 5 блогердің блогының ұнамды тұстарын жазу.</span></p>\r\n<p><span style=\"color: #ffffff;\">3.&nbsp;Сататын өніміңнен бөлек өзіңе қызықты білімің бар 3-5 теманы жаз [кітап, сериал]</span></p>\r\n<p>&nbsp;<a href=\"http://185.100.67.139/uploads/1642011727pjy1m.pdf\">ПДФ файл</a></p>\r\n<p>&nbsp;</p>','',NULL,NULL,NULL,NULL,129,1,NULL,0,'2021-12-24 15:30:08','2022-01-17 06:50:02'),(898,170,61,'Эксперттілік демонстрациясы','<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/665596903?h=225add5087\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<div style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></div>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">- Парақшаға пост-серия салу (3-10 серия).</span><br /><span style=\"color: #ffffff;\">- Әр постта эксперттік контент және сенімсіздіктің 4 түрі қамтылуы керек.</span></p>\r\n<div style=\"text-align: justify;\"><span style=\"color: #ffffff;\">- Постты толығымен жазып тастап, кураторға тексерт.</span><br /><span style=\"color: #ffffff;\">- Сосын барып, 1 сериядан салып отыр.</span><br />\r\n<p><span style=\"color: #ffffff;\">Сабақтың конспектісін төменде \"Пдф файлдан\" көре аласыз.</span></p>\r\n</div>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><a style=\"color: #ffffff;\" href=\"http://185.100.67.139/uploads/164215366106ywS.pdf\">ПДФ ФАЙЛ</a></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Төменде \"Эксперттілік контент\" түрлері және оларды контентке қалай қолдануға болатын мысалдарымен көрсетілген таблица ПДФ файлда беріледі</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #00ffff;\">&nbsp;<a style=\"color: #00ffff;\" href=\"http://185.100.67.139/uploads/1642184864tN1X8.pdf\">ПДФ ФАЙЛ</a></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,35,1,NULL,0,'2021-12-24 15:30:14','2022-01-16 16:17:59'),(899,170,61,'сабақ салынбады 4','','',NULL,NULL,NULL,NULL,5,1,NULL,0,'2021-12-24 15:30:24','2022-01-08 02:55:32'),(900,170,61,'сабақ салынбады 5','','',NULL,NULL,NULL,NULL,2,1,NULL,0,'2021-12-24 15:30:29','2022-01-03 09:38:08'),(901,170,61,'сабақ салынбады 6','','',NULL,NULL,NULL,NULL,5,1,NULL,0,'2021-12-24 15:30:35','2022-01-03 16:33:52'),(902,170,61,'сабақ салынбады 7','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:30:40','2021-12-24 15:30:40'),(903,170,61,'сабақ салынбады 8','','',NULL,NULL,NULL,NULL,3,1,NULL,0,'2021-12-24 15:30:44','2021-12-31 06:16:56'),(904,170,59,'сабақ салынбады 1','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:31:58','2021-12-24 15:31:58'),(905,170,59,'сабақ салынбады 2','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:32:05','2021-12-24 15:32:05'),(906,170,59,'сабақ салынбады 3','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:32:09','2021-12-24 15:32:09'),(907,170,59,'сабақ салынбады 4','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:32:13','2021-12-24 15:32:13'),(908,170,59,'сабақ салынбады 5','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:32:19','2021-12-24 15:32:19'),(909,170,59,'сабақ салынбады 6','','',NULL,NULL,NULL,NULL,1,1,NULL,0,'2021-12-24 15:32:24','2021-12-27 15:55:02'),(910,170,59,'сабақ салынбады 7','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24