\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p><span style=\"color: #ffffff;\">-Әр түрлі саладағы эксперттерге зерттеу жүргізіңіз</span></p>\r\n<p><span style=\"color: #ffffff;\">-Дайректтеріне жазып өнімі жайлы, тағы басқа ақпараттар жайлы сұрап көріңіз</span></p>\r\n<p><span style=\"color: #ffffff;\">-Курсты бітірген соң Ин Ша Алла жұмысқа орналасасыз, сол кезде орындайтын тапсырмалар бар, сол уақытта қайта сабақтарды қарап қайта орындаңыз.</span></p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;Төменде сабақтың конспектісін ПДФ файл ретінде көре аласыз:</span></p>\r\n<p><a href=\"http://185.100.67.139/uploads/16420824134Mdf9.pdf\">ПДФ файл</a></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,25,1,NULL,0,'2021-12-24 15:39:09','2022-01-16 16:51:23'),(954,169,52,'Эксперт контенті','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Эксперттің контенті деген - эксперттің жұмыс сценарийі, жоспары.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Дайректолог маман экспертпен әрқашан тығыз байланыста болуы керек. Өйткені дайректолог маман эксперттің өз блогын қалай жүргізетінін біліп, сезінгенде ғана сенімді продажа жасай алады.</span></p>\r\n<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/665125961?h=acc9164fe8\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Инстаграмдағы эксперттердің коньентін зерттеу, анықтау.</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,25,1,NULL,0,'2021-12-24 15:39:15','2022-01-16 16:51:02'),(955,169,52,'Эксперт как личность','<p><iframe src=\"https://player.vimeo.com/video/665953623?h=322e46b0eb\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>','',NULL,NULL,NULL,NULL,7,1,NULL,0,'2021-12-24 15:39:20','2022-01-16 15:04:29'),(956,169,52,'сабақ салынбады 5','','',NULL,NULL,NULL,NULL,3,1,NULL,0,'2021-12-24 15:39:24','2022-01-16 15:04:55'),(957,169,52,'сабақ салынбады 6','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:39:35','2021-12-24 15:39:35'),(958,169,52,'сабақ салынбады 7','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:39:41','2021-12-24 15:39:41'),(959,169,52,'сабақ салынбады 8','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:39:45','2021-12-24 15:39:45'),(960,169,51,'сабақ салынбады 1','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:40:02','2021-12-24 15:40:02'),(961,169,51,'сабақ салынбады 2','','',NULL,NULL,NULL,NULL,1,1,NULL,0,'2021-12-24 15:40:11','2022-01-03 16:10:22'),(962,169,51,'сабақ салынбады 3','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:40:16','2021-12-24 15:40:16'),(963,169,51,'сабақ салынбады 4','','',NULL,NULL,NULL,NULL,1,1,NULL,0,'2021-12-24 15:40:23','2022-01-03 07:30:39'),(964,169,51,'сабақ салынбады 5','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:40:32','2021-12-24 15:40:32'),(965,169,51,'сабақ салынбады 6','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:40:37','2021-12-24 15:40:41'),(966,169,51,'сабақ салынбады 7','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:40:46','2021-12-24 15:40:52'),(967,169,51,'сабақ салынбады 8','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:40:58','2021-12-24 15:40:58'),(968,169,50,'сабақ салынбады 1','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:41:24','2021-12-24 15:41:24'),(969,169,50,'сабақ салынбады 2','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:41:29','2021-12-24 15:41:29'),(970,169,50,'сабақ салынбады 3','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:41:33','2021-12-24 15:41:33'),(971,169,50,'сабақ салынбады 4','','',NUL