ULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:58:18','2021-12-24 15:58:18'),(1007,169,46,'сабақ салынбады 8','','',NULL,NULL,NULL,NULL,0,1,NULL,0,'2021-12-24 15:58:23','2021-12-24 15:58:23'),(1008,168,36,'ABC клиент типтері','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Сату маманы мамандығын сізге ИНКОН компаниясының 2 жылдық тәжірибесі бар сату маманы - Ақмарал Амангелдіқызы және Жұлдыз Ақболат ханым жүргізетін болады. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Клиентпен сапалы әрі табысты жұмыс жасау үшін сіз клиенттің қандай типтегі клиент екенін анықтап алуыңыз қажет. Клиент типтерін анықтап алғаннан кейін, оған қандай подход жасау керектігін, ол клиентке маңызды не нәрсе екенін білетін боласыз. Осы ақпараттарды қолдана отырып сіз клиентпен сөйлнсу уақытыңызды үнемдейсіз, продажаға алып барар қысқа жолды таба алатын боласыз.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"> <iframe src=\"https://player.vimeo.com/video/661951014\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"> <iframe src=\"https://player.vimeo.com/video/661950345\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong>-Клиенттерге АВС анализ жасау<br /> <br />-Қай категориялы клиенттер қанша % құрайтынын сараптаңыз</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"><strong>Сабақ конспектісін төмендегі ПДФ файлдан көре аласыз<br />&nbsp;</strong></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','',NULL,NULL,NULL,NULL,173,1,NULL,0,'2021-12-24 15:58:37','2022-01-16 18:47:43'),(1009,168,36,'Клиент типологиясы','<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Клиенттер ЮНГ типологиясы бойынша 4-ке бөлінеді. Осы типтерін анықтап алғаннан кейін сізге клиенттермен сөйлесу оңай болады.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\"> <iframe src=\"https://player.vimeo.com/video/665125961?h=acc9164fe8\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe> </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<ol style=\"text-align: justify;\">\r\n<li><span style=\"color: #ffffff;\">Обзвон жасағанда немесе перепискамен сөйлескенде клиент типологиясын анықтап бөліп жазыңыз.</span></li>\r\n<li><span style=\"color: #ffffff;\">Әр түрлі типологиядағы клиенттердің возражениесін немесе сәтті сделка болса соны анализдеңіз.</span></li>\r\n<li><span style=\"color: #ffffff;\">Басқа компания, дүкендерге жәй ғана клиент ретінде заявка қалдырыңыз</span></li>\r\n</ol>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Осы әр түрлі типологиядағы клиент роліне кіріп сөйлесіп басқа менеджерлердің жауабына қараңыз</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;</span></p>','',NULL,NULL,NULL,NULL,67,1,NULL,0,'2021-12-24 15:58:44','2022-01-17 06:22:57'),(1010,168,36,'Менеджер жібермеу керек қателіктер','<p style=\"text-align: justify;\"><iframe src=\"https://player.vimeo.com/video/665725123?h=45e1f9fc7c\" width=\"640\" height=\"564\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Үй тапсырмасы:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">Басқа компания, дүкендерге жәй ғана клиент ретінде заявка қалдырыңыз</span><br /><span style=\"color: #ffffff;\">- Олардан сату менеджерлері сізге хабарласқанда олардың сөйлесуіне мән беріңіз, қателіктері бар-жоғына қараңыз&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Басқа компания, дүкендерге жәй ғана клиент ретінде заявка қалдырыңыз</span><br /><span style=\"color: #ffffff;\">- Олардан сату менеджерлері сізге хабарласқанда олардың сөйлесуіне мән беріңіз, қателіктері бар-жоғына қараңыз </span><br /><span style=\"color: #ffffff;\">- Әр түрлі жерге қалдырып, әр түрлі менеджермен сөйлесіңіз</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #ffffff;\">&nbsp;Сабақтың конспектісін төменде \"Пдф файлдан\" көре аласыз.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #00ffff;\"><a style=\"color: #00ffff;\" href=\"http://185.100.67.139/uploads/16421552698462G.pdf\">ПДФ ФАЙЛ</a></span></p>','',NULL,NULL,NULL,NULL,39,1,NULL,0,'2021-12-24 15:58:48','2022-01-17 06:05:22'),(1011,168,36,'сабақ салынбады 4','','',NULL,NULL,NULL,NULL,12,1,NULL,0,'2021-12-24 15:58:52','2022-01-15 08:55:01'),(1012,168,36,'сабақ салынбады 5','','',NULL,NULL,NULL,NULL,2,1,NULL,0,'2021-12-24 15:58:55','2021-12-31 02:42:15'),(1013,168,36,'сабақ салынбады 6','','',NULL,NULL,NULL,NULL,4,1,NULL,0,'2021-12-24 15:58:59','2022-01-03 02:16:33'),(1014,168,36,'сабақ салынбады 7','','',NULL,NULL,NULL,NULL,2,1,NULL,0,'2021-12-24 15:59:03','2021-12-30 19:47:39'),(1015,168,36,'сабақ салынбады 8','','',NULL,NULL,NULL,NULL,4,1,NULL,0,'2021-12-24 15:59:06','2022-01-14 09:57:14'),(1016,168,35,'сабақ салынбады 1','','',NULL,NULL,NULL,NULL,7,1,NULL,0,'2021-12-24 15:59:17','2022-01-16 19:28:44'),(1017,168,35,'сабақ салынбады 2','','',NULL,NULL,NULL,NULL,3,1,NULL,0,'2021-12-24 15:59:20','2022-01-13 06:11: