INSERT INTO `posts` VALUES (364,1,'[\"uploads/1640085139yz3qz.png\"]','“INCON ACADEMY” қосымшасына қош келдіңіз!','<p><span style=\"color: #ffffff;\">\"INCON ACADEMY\" қосымшасына қош келдіңіз!?</span></p>\r\n<p><span style=\"color: #ffffff;\">Алдағы 2 айдың ішінде сіздің сұранысқа ие маман атанып, табысыңыздың еселенуін тілейміз?.</span></p>\r\n<p><span style=\"color: #ffffff;\">Сәттілік, студент!❤️</span></p>',NULL,164,'2021-12-21 11:12:19','2022-01-15 11:28:13'),(365,1,'[\"uploads/1640089579wfkzk.jpg\"]','?FOCUS курсының алғашқы сабақтарына доступ ашылды?','<p><span style=\"color: #ffffff;\">?Курстың алғашқы сабақтарына доступ ашылды?</span></p>\r\n<p><span style=\"color: #ffffff;\">Кез-келген істі бастар алдын ниетті дұрыстап, шектеулер мен блоктардан арылу қажет.</span></p>\r\n<p><span style=\"color: #ffffff;\">Адамның миы мен жүрегі таза кезде ғана пайдалы білімді өзіне сіңіреді. Сондықтан FOCUS курсының алғашқы модульі - \"АҚШАҒА ДАЙЫНДЫҚ\". ??</span></p>\r\n<p><span style=\"color: #ffffff;\">Сәттілік, студент? Хайырлы білім болсын!?</span></p>\r\n<p><span style=\"color: #ffffff;\">Сабақтарды мұқият оқып, үй тапсырмасын кураторға жіберуді ұмытпаңыз ☝️</span></p>',NULL,181,'2021-12-21 12:26:19','2022-01-17 06:29:51');
/*!40000 ALTER TABLE `posts` ENABLE KEYS */;
UNLOCK TABLES;

